(1, 'pelagicus', '1', '1', 'januari', '2020', 'Pengaruh Penambahan Arang Aktif Terhadap Mutu Sabun Mandi Cair Rumput Laut (Gracilaria sp.)', 'Sabun merupakan molekul organik yang terdiri dari dua gugus yaitu gugus polar dan non polar. Formulasi penambahan arang aktif pada sabun mandi cair dipercaya dapat menyerap dan mengangkat kotoran dari permukaan sampai ke dalam pori-pori. Penelitian ini bertujuan untuk memformulasikan pembuatan sabun mandi cair rumput laut dengan penambahan arang aktif, serta melakukan pengujian mutu sabun mandi cair rumput laut yang meliputi pengujian organoleptik, pH, kadar logam merkuri, viskositas dan stabilitas busa. Penelitian dilakukan dari tanggal 11 Maret 2019 sampai dengan 29 Juni 2019 di PT. Rumah Rumput Laut Bogor, dengan bahan baku rumput laut diambil dari Kabupaten Karawang. Penelitian ini menggunakan perlakuan penambahan dan tanpa penambahan arang aktif. Data yang diperoleh kemudian diolah menggunakan statistik untuk mencari nilai rata-rata. Formulasi bahan dalam pembuatan sabun mandi cair rumput laut adalah TEA dan setil alkohol 2.08%, EDTA, sodium klorida dan penoxyetanol 0.98%, gliserin dan VCO 3,47%, esensial oil 0.58%, bubur 23.16%, asam sitrat dan arang aktif 2.32%, aquades 50.96%, KOH 1.97% dan minyak jarak 4.63%. Pengujian mutu yang dilakukan pada sabun mandi cair rumput laut pada laboratorium dengan penambahan arang aktif adalah pH sebesar 9.44, tidak ditemukannya logam merkuri, viskositas sebesar 424 cPs, stabilitas busa sebesar 78.95% dan nilai kesukaan terhadap warna, aroma, kekentalan, jumlah busa, kesan licin, kesan lembut yang ditinggalkan sebesar 6 (suka) dari skala 1 sampai dengan 7.', 'arang aktif; sabun cair; rumput laut (Gracilaria sp)', 'D1'),
(2, 'jurnal segara', '15', '1', 'april', '2019', 'Budi daya Rumput Laut dan Pengelolaannya di Pesisir Kabupaten Dompu, Provinsi Nusa Tenggara Barat Berdasarkan Analisa Kesesuaian Lahan dan Daya Dukung Lingkungan', 'Rumput laut (makro alga) merupakan salah satu komoditas sumber daya pesisir yang mermiliki potensi ekonomis, mudah dibudidayakan dengan biaya produksi yang rendah. Perairan Kabupaten Dompu Provinsi, Nusa Tenggara Barat (NTB) merupakan kawasan memiliki beragam sumber daya hayati pesisir dan laut (SDHPL), diantaranya rumput laut jenis Eucheuma cottoni dan Kappaphycus alvarezii yang merupakan rumput laut dari 5 jenis yang dimanfaatkan dan dibudidayakan di Indonesia, namun data dan informasi yang menunjang usaha budidaya rumput laut di Kabupaten Dompu masih sangat minim. Tujuan dari penelitian ini adalah mengetahui kesesuaian perairan dan menduga daya dukung lingkungannya untuk budidaya rumput laut di Kabupaten Dompu. Metode spasial, yaitu metode untuk mendapatkan informasi pengamatan yang dipengaruhi efek ruang digunakan dalam kajian ini. Pengaruh efek ruang tersebut disajikan dalam bentuk pembobotan.  Parameter unsur hara, yaitu Nitrogen (N) dan Phosfat (P) digunakan sebagai dasar untuk menghitung daya dukung lingkungan.  Hasil penelitian menunjukkan bahwa luas area yang sesuai untuk budidaya rumput laut sekitar 72.515 ha atau 99,49 % dari luas total wilayah kawasan yang dikaji. Luas area budidaya rumput laut yang telah dimanfaatkan hingga saat ini adalah 500 ha atau 3,3 % dari total luasan daya dukung, sehingga luas area yang belum termanfaatkan adalah 14.719 Ha atau 66,7 % dari total luasan daya dukung. Skenario ideal pengembangan usaha budidaya rumput laut yaitu; melalui penambahan bibit unggul dan informasi musim tanam serta melaksanakan budidaya secara optimal sehingga potensi ekonomi pertahun dapat tercapai.', 'Budi daya, rumput laut, kesesuaian lahan, daya dukung, Kabupaten Dompu', 'D2'),
(3, 'chanos chanos', '18', '2', '-', '2020', 'KARAKTERISTIK FISIKOKIMIA DAN ORGANOLEPTIK FORMULASI YOGURT DENGAN PENAMBAHAN RUMPUT LAUT Eucheuma spinosum', 'Yogurt dipercaya sebagai makanan bioaktif fungsional. Rumput laut sendiri mengandung berbagai senyawa bioaktif dengan manfaat kesehatan sehingga banyak dimanfaatkan untuk produk susu salah satunya adalah yogurt. Penelitian ini bertujuan untuk mempelajari karakteristik fisikokimia dan organoleptik dari yogurt dengan penambahan rumput laut. Penelitian ini dirancang dengan rancangan percobaan RAL (Rancangan Acak Lengkap) dengan penambahan rumput laut 0%, 5%, 10% dan 15% dengan respon pH, sineresis dan viskositas serta uji organoleptik dengan atribut rasa, tekstur, kesukaan dan aroma. Rumput laut memberikan pengaruh yang nyata (p<0.05) terhadap pH, Sineresis dan viskositas. Nilai pH mulai 4.08 0.11 - 4.34 0.09, nilai sineresis berkisar 11.9 1.14% - 36.44 0.98% dan nilai viskositas berkisar 2.56 0.93 mPa.s - 194.68 4.27 mPa.s. Penerimaan panelis menunjukkan bahwa perlakuan penambahan rumput laut berpengaruh nyata (p<0.05) terhadap rasa, aroma dan kesukaan, namun tidak berpengaruh nyata (p>0.05) terhadap  tekstur yogurt. Uji hedonik menunjukkan bahwa panelis cenderung menyukai yogurt dengan penambahan rumput laut sebanyak 5%', 'Fisikokimia, organoleptik, yogurt rumput laut', 'D3'),
(4, 'buletin teknik litkayasa akuakultur', '17', '2', 'desember', '2019', 'TEKNIK BUDIDAYA RUMPUT LAUT Kappaphycus alvarezii DENGAN METODE VERTIKULTUR', 'Semakin meningkatnya jumlah permintaan rumput laut sebagai bahan baku kegiatan industri, diperlukan suatu kegiatan pengembangan untuk meningkatkan produksi rumput laut. Pengembangan teknologi budidaya rumput laut Kappaphycus alvarezii menggunakan metode vertikultur dapat meningkatkan jumlah produksi rumput laut karena selain memanfaatkan permukaan perairan juga memanfaatkan kolom perairan sebagai lahan budidaya. Budidaya rumput laut dengan metode vertikultur sebelumnya pernah diuji coba di beberapa daerah menggunakan jarak tanam antar rumpun yang berbeda. Kegiatan ini bertujuan untuk mengetahui tahapan budidaya rumput laut Kappaphycus alvarezii menggunakan metode vertikultur dengan perlakuan jarak tanam antar rumpun. Tahapan budidaya rumput laut Kappaphycus alvarezii dengan metode vertikultur meliputi pemilihan lokasi, pembuatan konstruksi budidaya rumput laut, pembuatan jaring vertikultur, penanaman bibit rumput laut, pemeliharaan bibit rumput laut, pengukuran kualitas air, panen dan pascapanen. Konstruksi yang digunakan untuk budidaya rumput laut metode vertikultur berbentuk rakit berukuran 10 m x 10 m. Media pengikat rumput laut menggunakan jaring vertikultur berukuran 5 m x 2 m. Bobot awal bibit yaitu 50 g yang diikat dengan perlakuan jarak tanam antar rumpun 15 cm, 25 cm, dan 35 cm. Masing-masing perlakuan dilakukan tiga kali ulangan. Pertumbuhan rumput laut Kappaphycus alvarezii jarak tanam antar rumpun 25 cm memiliki laju pertumbuhan harian lebih tinggi yaitu 2,13% per hari. Satu konstruksi budidaya vertikultur memuat 36 jaring vertikultur dengan jarak tanam 25 cm antar rumpun, maka jumlah keseluruhan tali cincin untuk mengikat rumpun rumput laut yaitu 12.096 titik rumpun.', 'Kappaphycus alvarezii; vertikulturr; Buton Tengah', 'D4'),
(5, 'media akuakultur', '8', '1', 'juni', '2013', 'BUDIDAYA RUMPUT LAUT DALAM UPAYA PENINGKATAN INDUSTRIALISASI PERIKANAN', 'Rumput laut (seaweed) merupakan salah satu komoditas potensial dan dapat dijadikan andalan bagi upaya pengembangan usaha skala kecil dan menengah yang sering disebut sebagai Usaha Kecil Menengah (UKM). Ini terjadi karena rumput laut sangat banyak manfaatnya, baik melalui pengolahan sederhana yang langsung dapat dikonsumsi maupun melalui pengolahan yang lebih kompleks, seperti produk farmasi, kosmetik, dan pangan, serta produk lainnya. Perairan Indonesia yang luasnya sekitar 70% dari wilayah Nusantara mempunyai potensi untuk usaha budidaya laut, termasuk di antaranya budidaya rumput laut. Jenis rumput laut yang mempunyai potensi untuk dibudidayakan adalah Eucheuma sp. dan Gracilaria sp. Upaya mengembangkan budidaya rumput laut jenis ini perlu dilakukan untuk meningkatkan kuantitas dan kualitasnya, khususnya dalam rangka memenuhi permintaan industri. Tulisan ini membahas mengenai budidaya rumput laut yang sangat erat kaitannya dengan industri pengolahannya menjadi barang setengah jadi, yaitu tepung rumput laut atau biasa disebut  karaginan , sebagai bahan baku industri produk farmasi dan lain sebagainya', 'rumput laut; budidaya; industri hilir; industri pengolahan', 'D5'),
(6, 'media akuakultur', '8', '2', 'desember', '2013', 'PENGARUH MASA TANAM TERHADAP KUALITAS RUMPUT LAUT, Kappaphycus alvarezii', 'Budidaya rumput laut memliki peranan yang sangat penting dalam usaha meningkatkan produksi perikanan serta memenuhi kebutuhan pangan dan gizi. Beberapa kendala yang masih dijumpai di lapangan antara lain kualitas hasil panen yang masih rendah akibat pemanenan rumput laut yang lebih awal dari waktu panen yang seharusnya (6-7 minggu), akibat permintaan rumput laut cukup tinggi. Percobaan ini bertujuan untuk memperlihatkan kandungan nilai gizi rumput laut yang dipanen pada masa tanam 10, 20, dan 30 hari. Jenis rumput laut yang ditanam adalah Kappaphycus alvarezii yang dibudidayakan di sekitar perairan Teluk Maumere Desa Kojadoi Kecamatan Alok Timur Kabupaten Sikka, Nusa Tenggara Timur. Metode budidaya rumput laut yang digunakan adalah metode tali panjang (long line), dengan panjang tali 35 m sebanyak 750 bentangan. Jarak antara bentangan 1 m, jarak tanam yang diaplikasikan adalah 15 cm, dengan bobot awal bibit 50 g. Setiap 10 hari sampel diambil secara acak untuk dianalisis proksimatnya (kadar air, protein, karbohidrat, serat, dan abu), sehingga diperoleh masa tanam 10, 20, dan 30 hari. Sebelum dianalisis, rumput laut tersebut dijemur selama 3 hari sampai kering. Untuk mengetahui kadar air, abu, lemak, dan serat kasar, rumput laut dianalisis dengan menggunakan metode gravimetrik, sedang kadar protein dan BETN dengan metode trimetri. Hasil penelitian menunjukkan bahwa kadar air, abu, lemak, dan bahan ekstrak tanpa nitrogen (BETN) menurun seiring dengan lamanya masa tanam, sedangkan kadar protein dan serat kasar meningkat seiring dengan lamanya masa tanam.', 'masa tanam; rumput laut Kappaphycus alvarezii; kualitas rumput laut', 'D6'),
(7, 'buletin teknik litkayasa akuakultur', '17', '1', 'juni', '2019', 'TEKNIK BUDIDAYA RUMPUT LAUT Halymenia sp. DENGAN METODE LEPAS DASAR', 'Rumput laut hingga saat ini masih menjadi andalan ekspor perikanan di Indonesia, namun disayangkan produksinya terus mengalami penurunan akibat masih banyaknya serangan penyakit ice-ice pada tahapan budidayanya. Sehingga perlu alternatif diversifikasi jenis rumput laut baru yang lebih tahan terhadap penyakit. Rumput laut yang dapat menjadi kandidat spesies baru dalam komoditas perikanan budidaya adalah Halymenia sp. Namun pengembangan teknologi budidaya rumput laut ini masih sangat minim dan terbatas dibandingkan jenis rumput laut penghasil karaginan pendahulunya yaitu Kappaphycus sp. yang saat ini sudah banyak diterapkan oleh masyarakat pembudidaya. Sehubungan dengan hal tersebut, perlu dilakukan kegiatan untuk mengkaji teknik pelaksanaan budidaya rumput laut Halymenia sp. sesuai dengan habitat aslinya di dasar perairan yaitu dengan metode lepas dasar. Kegiatan ini bertujuan untuk mengetahui teknik budidaya rumput laut Halymenia sp. dengan metode lepas dasar dari mulai tahapan pemilihan lokasi yang optimal untuk kegiatan budidaya, konstruksi wadah yang efektif dan efisien, penyediaan bibit yang baik, pengikatan dan penanaman bibit, pemeliharaan rumput laut, dan wadah budidya, serta panen dan penanganan pascapanen. Kegiatan budidaya rumput laut Halymenia sp. metode lepas dasar dengan menggunakan wadah berukuran 35 m x 50 m dapat memuat tali ris sebanyak 50 bentang dan membutuhkan bibit sekitar 350-380 kg. Potensi produksi rumput laut setelah 45 hari pemeliharaan dapat mencapai 3,8 ton rumput laut basah.', 'halymenia; lepas dasar; rumput laut', 'D7'),
(8, 'jurnal riset akuakultur', '11', '3', 'september', '2016', 'SELEKSI RUMPUT LAUT Kappaphycus striatum DALAM UPAYA PENINGKATAN LAJU PERTUMBUHAN BIBIT UNTUK BUDIDAYA', 'Budidaya rumput laut di Indonesia semakin berkembang seiring dengan peningkatan permintaan bahan baku industri untuk pasar domestik dan eksport. Rumput laut Kappaphycus striatum, salah satu spesies rumput laut komersil, telah intensif dibudidayakan di perairan pantai. Saat ini, masalah utama yang dihadapi pembudidaya adalah rendahnya kualitas bibit yang berasal dari hasil budidaya. Seleksi varietas merupakan salah satu metode yang diharapkan dapat meningkatkan laju pertumbuhan rumput laut. Penelitian ini dilakukan dengan tujuan untuk mengetahui pengaruh seleksi varietas terhadap pertumbuhan rumput laut sehingga dapat dilakukan produksi bibit unggul untuk keperluan budidaya. Budidaya rumput laut K. striatum telah dilakukan di Teluk Laikang, Kabupaten Takalar, Provinsi Sulawesi Selatan dengan menggunakan metode long line. Seleksi varietas dilakukan berdasarkan parameter laju pertumbuhan harian (LPH) dan metode seleksi mengacu pada protokol seleksi yang telah dikembangkan pada rumput laut K. alvarezii. Hasil penelitian menunjukkan bahwa LPH bibit hasil seleksi lebih tinggi (P<0,05) dibandingkan dengan kontrol, dimana LPH seleksi mencapai 3,47%/hari, sedangkan LPH kontrol 1,81%/hari. Dari tiga siklus produksi bibit, rata-rata LPH hasil seleksi adalah 2,92%/hari dan kontrol 1,58%/hari, atau dapat diasumsikan terjadi peningkatan sebesar 84,25%. Kandungan karaginan dan kekuatan gel hasil seleksi relatif lebih tinggi dibandingkan kontrol, dimana LPH memiliki korelasi yang erat dengan kandungan karaginan (r=0,6604) tetapi relatif lebih rendah dengan kekuatan gel (r=0,1048). Kualitas air (salinitas, nitrat, fosfat, and pH) masih dalah batas yang dapat mendukung pertumbuhan rumput laut.', 'seleksi varietas; pertumbuhan; bibit; rumput laut Kapppaphycus striatum; selection; growth rate; seed; seaweed Kappaphycus striatum', 'D8'),
(9, 'jurnal kelautan nasional', '15', '3', 'desember', '2020', 'Evaluasi Pertumbuhan Rumput Vetiver Sebagai Pencegah Abrasi di Pantai Wonokerto Kulon, Kabupaten Pekalongan', 'Vetiver (Vetiveria zizanioides) dikenal di Indonesia sebagai akar wangi bahan baku minyak atsiri; adalah anggota keluarga Poaceae berupa rumput tahunan. Vetiver memiliki perakaran dalam sehingga banyak digunakan sebagai penguat lereng. Vetiver termasuk toleran garam, tetapi pemanfaatannya untuk penguat pantai di Indonesia masih jarang dikaji. Penelitian ini bertujuan untuk melakukan evaluasi pertumbuhan vetiver sebagai penahan abrasi dengan tipologi gelombang besar di tiga jenis pantai yakni Wonokerto kulon, Kabupaten Pekalongan-Jawa Tengah; Batu Tampih, Kabupaten Tabanan-Bali; dan Congot, Kabupaten Kulon Progo - Daerah Istimewa Yogyakarta. Rumput vetiver ditanam bertahap pada Oktober 2014-Agustus 2016 sebagai bagian dari teknologi eco-hybrid. Evaluasi pertumbuhan dilakukan sejak ditanam hingga November 2017. Hasil menunjukkan bahwa vetiver tumbuh dengan baik pada enam bulan pertama di semua lokasi; yang mencerminkan vetiver cocok sebagai tanaman pantai. Vetiver mampu bertahan hingga November 2017 di pantai Batu Tampih dan pantai Wonokerto kulon dengan tingkat kerusakan 0-25% akibat gelombang pasang. Di pantai Congot seluruh vetiver mati tercerabut karena hantaman gelombang besar pada pertengahan 2016. Dengan demikian, keberhasilan penggunaan vetiver ditentukan oleh tingkat gelombang pasang. Penggunaan vetiver sebagai penguat pantai kemungkinan besar akan sukses pada pantai dengan gelombang kecil hingga sedang, tetapi hal tersebut perlu dikaji lebih lanjut.', 'Evaluasi pertumbuhan; vetiver; pencegah abrasi; pantai Wonokerto Kulon; eco-hybrid', 'D9'),
(10, 'buletin ilmiah marina sosial ekonomi kelautan dan perikanan', '9', '1', '-', '2014', 'Profil Budidaya dan Kelembagaan Pemasaran Rumput Laut (Grasillaria Sp) fi Kecamatan Muara Gembong, Kabupaten Bekasi, Jawa Barat', 'Rumput laut Gracilaria sp di Kecamatan Muara Gembong, Kabupaten Bekasi, Jawa Barat dibudidayakan di tambak dengan sistem polikultur dengan Ikan Bandeng atau Udang. Namun, permasalahan terkait dengan sulitnya pembudidaya mengakses harga dan informasi serta sulitnya memenuhi kualitas rumput laut yang diminta konsumen masih dihadapi oleh pembudidaya rumput laut. Kajian ini bertujuan untuk menggambarkan kegiatan budidaya rumput laut dan rantai pemasaran mulai dari hulu sampai hilir di Kecamatan Muara Gembong, Kabupaten Bekasi, Jawa Barat. Kajian ini dilakukan pada tahun 2014 dengan menggunakan metode survei melalui observasi dan wawancara dengan kuesioner terstruktur. Data yang digunakan adalah data primer terkait kegiatan usaha rumput laut dan data sekunder terkait dokumen penunjang dari Dinas Kelautan dan Perikanan Kabupaten Bekasi. Data yang terkumpul kemudian dianalisis secara deskriptif kualitatif. Hasil kajian menunjukkan bahwa terdapat dua saluran pemasaran rumput laut, yaitu (1) pembudidaya menjual ke pedagang pengumpul kemudian dilanjutkan ke PPTP lalu dijual ke perusahaan agar-agar; dan (2) pembudidaya menjual ke pengumpul kemudian dilanjutkan ke pedagang besar di luar Kabupaten Bekasi. Kajian juga menunjukkan adanya masalah kualitas rumput laut yang masih termasuk kelas 2 dan terjadinya ketimpangan informasi sehinggapembudidaya sulit mengakses informasi harga dan pasar. Oleh karena itu, peran pemerintah daerah diperlukan dalam memperkuat koordinasi antar stakeholder daerah dalam rangka mengembangkan budidaya rumput laut dengan sistem polikultur ini', 'rumput laut; Muara Gembong; kelembagaan; pemasaran', 'D10'),
(11, 'jurnal kelautan dan perikana terapan (JKPT)', '2', '2', 'JKPT desember', '2019', 'PERFORMANSI PERTUMBUHAN RUMPUT LAUT (Kappaphycus alvarezii) DENGAN MENGGUNAKAN BIBIT HASIL KULTUR DAN NON KULTUR JARINGAN DI BBPBL LAMPUNG', 'Rumput laut merupakan salah satu komoditas perikanan penting di Indonesia. Salah satu jenis rumput laut yang dibudidayakan oleh masyarakat adalah Eucheuma cottonii atau yang biasa disebut Kappaphycus alvarezii. Permasalahan yang dihadapi pembudidaya adalah pemilihan bibit rumput laut yang berkualitas. Kajian ini bertujuan untuk mengetahui pertumbuhan dan keuntungan budidaya rumput laut Kappaphycus alvarezii dengan menggunakan bibit hasil kultur jaringan dan non kultur jaringan dengan berat awal tanam sebesar 50 gram. Metode pengumpulan data menggunakan metode observasi, meliputi penimbangan berat dan pengukuran kualitas air (suhu, kecerahan, kedalaman, pH, salinitas, DO). Hasil kajian menunjukkan pertumbuhan bibit rumput laut yang menggunakan bibit hasil kultur jaringan mempunyai pertumbuhan yang lebih baik (berat rata-rata akhir 655,31 gram, pertumbuhan mutlak 605,3 gram dan LPH 6,32%) untuk bibit kultur jaringan, sedangkan bibit non kultur jaringan (berat rata-rata 385,39 gram, pertumbuhan mutlak 335,39 gram, dan LPH 4,98%). Berdasarkan perhitungan analisa finansial sederhana,keuntungan yang didapatkan dari penjualan rumput laut yang menggunakan bibit hasil kultur jaringan Rp. 689.200 sedangkan bibit non kultur jaringan sebesaran Rp 221.200 artinya bibit kultur jaringan lebih menguntungkan.', 'Kappaphycus alvarezii; kultur jaringan; pertumbuhan; keuntungan', 'D11'),
(12, 'buletin ilmiah marina sosial ekonomi kelautan dan perikanan', '1', '1', '-', '2015', 'Pengaruh Program Minapolitan Terhadap Kelembagaan Usaha Budidaya Rumput Laut di Pulau Sumbawa', 'Tujuan dari penelitian ini menganalisis pengaruh program minapolitan terhadap karakteristik kelembagaan usaha budidaya rumput laut di Pulau Sumbawa. Aspek yang dilihat adalah kelembagaan aktor dan pola hubungan, kelembagaan aturan, kebijakan pemerintah pusat, kebijakan pendukung internal, dan kebijakan eksternal. Dari sisi kelembagaan aktor terlihat bahwa sebelum program minapolitan usaha budidaya rumput laut bersifat perorarangan, akan tetapi setelah program minapolitan budidaya rumput laut berkelompok. Hal inilah yang menjadi kelemahan dari motivasi pembudidaya rumput laut di Pulau Sumbawa, dimana hanya wahana pencairan bantuan. Pada sisi kelembagaan aturan, sebelum program minapolitan harga ditentukan oleh pengepul karena adanya ikatan utang. Setelah program minapolitan bargaining position pembudidaya naik sehingga harga ditentukan berdasarkan kesepakan pembudidaya dan pengepul. Pada dimensi kebijakan internal pemerintah: pemerintah daerah menindak lanjuti kebijakan pemerintah pusat dalam bantuan PUMP untuk pembudidaya rumput laut dengan fasilitasi berupa pembentukan kelompok pembudidaya rumput laut, penentuan penerima bantuan, dan pembuatan aturan yang terkait zonasi. Pada dimensi kebijakan eksternal berupa bantuan dari pihak perbankan untuk penguatan kelembagaan dimana Bank Bukopin menginisiasi pembentukan koperasi  Algae Bersaing  dengan bantuan modal untuk petani rumput laut sebesar Rp. 900 juta. Diharapkan pemerintah membenahi motivasi berkelompok pembudidaya rumput laut, yaitu untuk mencapai tujuan yang sama, tapi di Pulau Sumbawa setelah pencairan bantuan kelompok pembudidaya banyak yang bubar.', 'kelembagaan; bargaining position; kelompok; internal; ekternal', 'D12'),
(13, 'media akuakultur', '6', '1', 'desember', '2011', 'SELEKSI KLON BIBIT RUMPUT LAUT, Gracilaria verrucosa', 'Upaya peningkatan produksi rumput laut juga tidak terlepas dari permasalahan, yaitu:ketersediaan bibit unggul dalam jumlah yang cukup, adanya serangan  hama dan penyakit, dan faktor pembatas musim tanam. Bibit rumput laut\r\nunggul dapat diperoleh dengan menggunakan metode seleksi klon dan   bioteknologi (kultur jaringan dan rekayasa gen). Seleksi klon/massa dapat dilakukan dengan mudah dan dapat menghasilkan varietas bibit unggul dalam\r\npertumbuhan relatif cepat, daya tahan terhadap penyakit, dan lingkungan, serta keunggulan spesifik lokasi/kawasan. Keberhasilan budidaya rumput laut sangat dipengaruhi oleh kondisi lingkungan. Karena itu, kegiatan pemilihan bibit\r\nyang berupa pelaksanaan seleksi klon harus memperhatikan faktor lingkungan perairan. Variasi kondisi lingkungan perairan di Indonesia yang relatif besar, maka pelaksanaan seleksi klon/massa sangat dianjurkan untuk dilakukan\r\ndi setiap sentra produksi rumput laut. Tujuan seleksi klon ini adalah untuk mendapatkan bibit unggul varietas rumput laut Gracilaria verrucosa yang cepat pertumbuhannya. Sasaran penerapan metode seleksi klon ini adalah penyediaan bibit unggul untuk mendukung target peningkatan produksi. Selain itu, sasaran dari seleksi klon/ massa adalah penyediaan bibit untuk mendukung pengembangan kebun bibit di setiap sentra produksi.', 'budidaya rumput laut; blue economy; Teluk Sereweh; Lombok', 'D13'),
(14, 'media akuakultur', '10', '2', 'desember', '2015', 'PENGEMBANGAN BUDIDAYA RUMPUT LAUT: IMPLIKASI PENERAPAN BLUE ECONOMY DI TELUK SEREWEH, NUSA TENGGARA BARAT', 'Rumput laut merupakan komoditas budidaya yang juga berperan dalam perbaikan kualitas lingkungan perairan, sehingga dijadikan sebagai salah satu komponen pengembangan budidaya laut dengan konsep ekonomi biru (blue economy). Penelitian ini bertujuan untuk menganalisis kondisi perairan bagi pengembangan budidaya rumput laut sebagai implikasi penerapan blue economy di Teluk Sereweh, Nusa Tenggara Barat. Pengumpulan data lapangan meliputi beberapa paremeter kualitas perairan pada 32 titik pengamatan in situ dan 16 titik pengamatan ek situ yang disebar pada seluruh kawasan penelitian, serta kondisi existing budidaya rumput laut melalui wawancara langsung dengan masyarakat pembudidaya. Data yang terkumpul digunakan untuk mengestimasi daya dukung lingkungan perairan untuk budidaya rumput laut dan dianalisis menggunakan statistik deskriptif yang ditampilkan dalam bentuk tabel dan gambar. Hasil penelitian memperlihatkan bahwa kondisi perairan Teluk Sereweh sangat baik untuk pengembangan budidaya rumput laut dengan daya dukung mencapai 93,3 ha untuk sistem long line dan 142,2 ha untuk sistem rakit apung. Namun pemanfaatan kawasan perairan untuk budidaya rumput laut perlu diatur berdasarkan daya dukung perairan tersebut, sehingga dapat menghasilkan produksi yang optimum, dan rumput laut sebagai komponen budidaya berbasis blue economy dapat memperlihatkan peranannya untuk mendukung keberlanjutan usaha budidaya rumput lautoleh masyarakat pesisir.', '-', 'D14'),
(15, 'Aurelia journal', '2', '1', 'oktober', '2020', 'KARAKTERISTIK MUTU TORTILA DENGAN PENAMBAHAN RUMPUT LAUT (Eucheuma Cottonii)', 'Penelitian ini bertujuan untuk mengetahui karakteristik mutu tortila dengan penambahan rumput laut  (Eucheuma Cottonii)..Penelitian dilakukan bulan Juni sampai bulan September 2019 di Workshop Pengolahan Poltek Karawang serta Laboratorium Kimia Sekolah Politeknik AUP  Jakarta. Penelitian dilakukan dengan eksperimen menggunakan  Rancangan Acak Lengkap (RAL) terdiri dari 1 perlakuan yaitu konsentrasi  rumput laut yang ditambahkan dengan 4 variabel yaitu konsentrasi A (0%), B (1%), C (1,5%) dan D(2%). dengan ulangan 3 kali. Analisis data dilakukan dengan Anova, apabila hasilnya berbeda nyata dilanjutkan dengan BNJ. Hasil Penelitian menujukkan : Tortilla A: kadar air 3,6%, kadar abu 2,95%, lemak 15,65%, protein 8,4%, dan kadar serat kasar 1,34%. Tortilla B: kadar air 4,4%, kadar abu 3,45%, lemak 19,4%, protein 8,55%, dan kadar serat kasar 1,49%. Tortilla C: kadar air 5,1%, kadar abu 4,15%, lemak 20,7%, protein 8,7%, % dan kadar serat kasar 1,63%. Tortilla D :  kadar air 5,6%, kadar abu 4,55%, lemak 23,15%, protein 9,05%, dan kadar serat kasar 1,75%. Perbedaan penambahan rumput laut berpengaruh nyata terhadap hasil uji kadar abu tortilla dan tidak berpengaruh nyata terhadap parameter lainnya', '-', 'D15'),
(16, 'buletin teknik litkayasa akuakultur', '13', '1', 'juni', '2015', 'TEKNIK BUDIDAYA RUMPUT LAUT Kappaphycus alvarezii DALAM POLA PENENTUAN KALENDER MUSIM TANAM DI PERAIRAN BOALEMO', 'Terbatasnya informasi ditingkat pembudidaya mengenai waktu tanam yang optimal sesuai spesifikasi lokasi dan perubahan musim menyebabkan produktivitas lahan yang dikelola kurang optimal. Penentuan kalender musim tanam dilakukan untuk optimalisasi pemanfaatan lahan secara produktif. Untuk memperoleh data dan informasi bagi penentuan pola musim tanam rumput laut Kappaphycus alvarezii di perairan Boalemo, maka lokasi budidaya dilakukan di perairan di Desa Tambe Kecamatan Tilamuta Kabupaten Boalemo Provinsi Gorontalo. Budidaya rumput laut menggunakan metode apung long line dengan bobot awal 50 g/rumpun dan jarak antar rumpun 15 cm. Rumput laut diikat dan digantung pada tali bentangan poli etilen sepanjang 35, dengan jarak antara tali bentangan 1 m. Pengukuran pertumbuhan rumput laut dan kualitas lingkungan perairan dilakukan setiap interval waktu 30 hari. Rumput laut ditimbang pada 10 titik rumpun yang diberi kode tertentu dalam setiap bentangan. Hasil penelitian menunjukkan bahwa musim tanam rumput laut K. alvarezii yang produktif di Perairan Tambe berlangsung sepanjang tahun.', 'pola musim tanam; kalender musim; Kappaphycus alvarezii', 'D16'),
(17, 'buletin teknik litkayasa akuakultur', '14', '2', 'desember', '2016', 'KONSTRUKSI WADAH VERTIKULTUR UNTUK BUDIDAYA RUMPUT LAUT KOTONI', 'Produksi rumput laut Indonesia pada tahun 2019 ditargetkan mencapai 19,5 juta ton, sedangkan pada tahun 2014 baru mencapai 10,2 juta ton. Untuk dapat mencapai nilai produksi yang ditargetkan perlu upaya peningkatan produksi hingga 91,2%; sehingga sangat dibutuhkan dukungan metode budidaya yang dapat meningkatkan produksi rumput laut. Saat ini metode yang umum digunakan adalah metode long line di mana hanya bagian permukaan perairan yang digunakan untuk kegiatan budidaya. Metode lain yang saat ini telah dikembangkan dan dapat meningkatkan produksi rumput laut lebih banyak dibandingkan metode long line adalah metode vertikultur. Kegiatan ini bertujuan untuk mengetahui konstruksi wadah vertikultur dalam menghasilkan rumput laut kotoni. Wadah vertikultur berukuran 10 m x 10 m terbuat dari balok kayu memuat 36 bingkai/jaring vertikal berukuran 5 m x 2 m yang memiliki 572 tali cincin pada setiap bingkainya dengan jarak tanam 20 cm. Wadah vertikultur hasil konstruksi dari kegiatan ini mampu meningkatkan kapasitas bibit secara signifikan mencapai 4.018% atau 20.592 titik rumpun rumput laut dibandingkan wadah long line yang hanya memuat 660 titik rumpun rumput laut', 'vertikultur; wadah budidaya; rumput laut', 'D17'),
(18, 'media akuakultur', '8', '2', 'desember', '2013', 'OPTIMALISASI SUMBERDAYA LAHAN UNTUK BUDIDAYA TAMBAK DI KABUPATEN LUWU UTARA PROVINSI SULAWESI SELATAN', 'Kabupaten Luwu Utara (Lutra) memiliki lahan potensial untuk tambak dan perubahan luas lahan tambak yang cukup besar, tetapi produktivitas tambak untuk budidaya udang dan ikan yang rendah. Oleh karena itu, Balai Penelitian dan Pengembangan Budidaya Air Payau, Maros telah melakukan serangkaian penelitian yang bertujuan untuk mengetahui luas potensi lahan, kesesuaian lahan, dan kebutuhan faktor lingkungan untuk budidaya rumput laut di tambak Kabupaten Lutra yang hasilnya dirangkum dalam makalah ini. Tambak di Kabupaten Lutra meningkat dari 4.938,84 ha pada tahun 2002 menjadi 7.838,94 ha pada tahun 2005. Potensi lahan tambak di Kabupaten Lutra mencapai 11.299,00 ha yang terdiri atas lahan tambak yang ada seluas 7.838,94 ha dan potensial lahan tambak seluas 3.460,06 ha. Dari luas potensi lahan tambak di Kabupaten Lutra, ternyata 3.527,3 ha tergolong sangat sesuai (kelas S1); 490,9 ha tergolong cukup sesuai (kelas S2); dan 7.280,8 ha tergolong kurang sesuai (kelas S3). Produksi rumput laut yang tinggi dapat diperoleh di tambak Kabupaten Lutra pada tanah dengan pHF lebih besar 6,5; pHFOX lebih besar 4,0; pHF -pHFOX kurang dari 2,5; dan SPOS kurang dari 1,00%. Kandungan Fe tanah yang melebihi 5.000 mg/L dan Al yang melebihi 490 mg/L menyebabkan penurunan produksi rumput laut. Peningkatan kandungan PO4 tanah lebih besar dari 6,0 mg/L dapat meningkatkan produksi rumput laut secara signifikan. Produksi rumput laut tertinggi didapatkan pada salinitas air 25,6 ppt dan rumput laut tumbuh baik pada kisaran pH antara 6,00 dan 9,32; fosfat lebih besar 0,1000 mg/L; dan besi kurang dari 0,1000 mg/L.', 'optimalisasi; lahan; tambak; Luwu Utara', 'D18'),
(19, 'buletin teknik litkayasa akuakultur', '18', '1', 'juni', '2020', 'EKSTRAKSI DNA RUMPUT LAUT Kappaphycus alvarezii DENGAN METODE Cetyl trimetyl ammonium BromideC (CTAB)', 'Ekstraksi DNA pada rumput laut masih mengalami banyak kendala dikarenakan rumput laut adalah jenis tumbuhan yang memiliki jaringan selulosa. Metode ekstraksi dengan Cetyl Trimetyl Ammonium Bromidec (CTAB) menjadi salah satu teknik untuk mempermudah dalam mendapatkan DNA makroalga khususnya untuk spesies Kappaphycus alvarezii. Tujuan dari kegiatan ini adalah penerapan teknik preservasi sampel dan ektraksi DNA K. alvarezii dengan metode CTAB. Sampel K. alvarezii diambil dari 17 (tujuh belas) sentra budidaya rumput laut yang tersebar di perairan yaitu Bantaeng, Pangkep, Palopo (Sulawesi Selatan), Gorontalo, Manado (Sulawesi Utara), Lombok dan Sumbawa (NTB), Banten, Nunukan dan Bontang (Kalimantan Utara), Buton Tengah (Sulawesi Tengah), Saumlaki, Tual (Maluku Tenggara), Maumere (NTT), Halmahera Barat (Maluku Utara), Mamuju (Sulawesi Barat), dan Lampung. Tahap awal ekstraksi adalah melakukan preservasi sampel dengan mengambil bagian ujung talus muda K. alvarezii dan disimpan dengan silica gel dalam ziplock. Tahap selanjutnya sampel diekstraksi dengan Cetyl Trimetyl Ammonium Bromidec (CTAB) dengan inkubasi 55-60oC selama 60 menit. Indikator keberhasilan hasil ekstraksi adalah terdapatnya pelet DNA K. alvarezii yang berwarna putih dan bersih dari kontaminan. Hasil yang diperoleh menunjukkan bahwa penggunaan silica gel dalam tahap preservasi rumput laut K. alvarezii mampu menjaga kualitas sampel uji, Metode CTAB dapat diterapkan untuk ekstraksi DNA tumbuhan tingkat rendah seperti pada rumput laut K. alvarezii dengan hasil pelet DNA yang berwarna putih, bersih, dan lebih murni', 'ekstraksi DNA; CTAB; preservasi; Kappaphycus alvarezii', 'D19'),
(20, 'jurnal segara', '12', '1', 'april', '2016', 'Kesesuaian Kawasan Budidaya Rumput Laut di Teluk Saleh, Kabupaten Sumbawa, Nusa Tenggara Barat', 'Rumput laut merupakan salah satu komoditas sumber daya pesisir dan laut yang memilki nilai ekonomis yang tinggi. Kabupaten Sumbawa memiliki potensi kawasan yang sangat menunjang untuk budidaya rumput laut dengan luas perairan pesisir   3.831,72 Km . Masyarakat pesisir di sekitar Teluk Saleh melakukan usaha budidaya rumput laut jenis Eucheuma Cottonii. Penelitian ini bertujuan untuk menentukan kesesuaian kawasan untuk budidaya rumput laut menggunakan SIG. Metode yang digunakan dalam penelitian ini adalah metode analisis spasial (keruangan) dan analisa tabular terhadap kesesuaian kawasan dalam SIG. Hasil analisis spasial dan tabular terhadap kesesuaian kawasan untuk budidaya rumput laut berhasil ditentukan kawasan yang sesuai untuk budidaya rumput laut, menunjukkan bahwa lokasi yang sesuai adalah di perairan Kecamatan Plampang dengan luas sekitar 36.061,17 hektar atau 60,34 % dari luas total wilayah kawasan pengembangan.', 'Sistem Informasi Geografis (SIG), budidaya rumput laut,Teluk Saleh, Kabupaten Sumbawa', 'D20'),
(21, 'jurnal segara', '12', '1', 'april', '2016', 'Kesesuaian Kawasan Budidaya Rumput Laut di Teluk Saleh, Kabupaten Sumbawa, Nusa Tenggara Barat', 'Rumput laut merupakan salah satu komoditas sumber daya pesisir dan laut yang memilki nilai ekonomis yang tinggi. Kabupaten Sumbawa memiliki potensi kawasan yang sangat menunjang untuk budidaya rumput laut dengan luas perairan pesisir   3.831,72 Km . Masyarakat pesisir di sekitar Teluk Saleh melakukan usaha budidaya rumput laut jenis Eucheuma Cottonii. Penelitian ini bertujuan untuk menentukan kesesuaian kawasan untuk budidaya rumput laut menggunakan SIG. Metode yang digunakan dalam penelitian ini adalah metode analisis spasial (keruangan) dan analisa tabular terhadap kesesuaian kawasan dalam SIG. Hasil analisis spasial dan tabular terhadap kesesuaian kawasan untuk budidaya rumput laut berhasil ditentukan kawasan yang sesuai untuk budidaya rumput laut, menunjukkan bahwa lokasi yang sesuai adalah di perairan Kecamatan Plampang dengan luas sekitar 36.061,17 hektar atau 60,34 % dari luas total wilayah kawasan pengembangan.', 'Sistem Informasi Geografis (SIG), budidaya rumput laut,Teluk Saleh, Kabupaten Sumbawa', 'D21'),
(22, 'prosiding FORUM INOVASI TEKNOLOGI AKUAKULTUR', '-', '-', '-', '2015', 'REGENERASI RUMPUT LAUT HASIL INTRODUKSI GEN KARAGINAN PADA RUMPUT LAUT Kappaphycus alvarezii MENGGUNAKAN MEDIA KULTUR YANG BERBEDA DENGAN KONDISI OPTIMAL', 'Transformasi gen karaginan pada rumput laut Kappaphycus alvarezii telah berhasil dilakukan melalui beberapa tahapan antara lain konstruksi gen karaginan pada plasmid pHSH sebagai vektor menjadi menjadi pMSHkar (PPSHB-IPB), kemudian insersi konstruksi Gen K-karagenase (pMSH-kar) pada Agrobacterium, serta transformasi gen K-raginase pada rumput laut K.alvarezii maka penelitian diarahkan pada regenerasi serta perbanyakan rumput laut hasil transformasi gen karaginan pada rumput laut K.alvarezii menggunakan media kultur yang diperkaya dengan pupuk yang berbeda serta kondisi lingkungan yang optimal antara lain salinitas, pH, penetrasi cahaya, ratio gelap dan terang, serta komposisi zat perangsang tumbuh yang berbeda. Hasil penelitian memperlihatkan kelangsungan hidup yang paling baik pada media PES, dengan salinitas 30 ppt, pH = 6, penetrasi cahaya 1500 lux, ratio gelap terang =16:8, dan komposisi ZPT adalah campuran IAA dan BAP dengan perbandingan 2:1.', 'regenerasi; gen K-karaginan; rumput laut; Kappaphycus alvarezii; transformasi gen', 'D22'),
(23, 'prosiding FORUM INOVASI TEKNOLOGI AKUAKULTUR', '-', '-', '-', '2012', 'UPAYA PENINGKATAN PRODUKTIVITAS RUMPUT LAUT DENGAN MENGETAHUI FAKTOR PENGELOLAAN Kappaphycus alvarezii DI KABUPATEN POHUWATO PROVINSI GORONTALO', 'Kondisi geografis Kabupaten Pohuwato Provinsi Gorontalo dinilai sangat cocok untuk pengembangan budidaya rumput laut dan ditetapkan sebagai kawasan minapolitan. Metode budidaya rumput laut di daerah tersebut adalah metode apung atau tali panjang (long line), karena mempunyai keunggulan dibandingkan metode lain dan dianggap fleksibel serta relatif lebih murah. Penelitian dilakukan untuk mengetahui upaya peningkatan produktivitas rumput laut dengan memperhatikan faktor pengelolaan dalam budidaya rumput laut tersebut. Metode penelitian yang digunakan adalah metode survai yang dilakukan dengan mengajukan kuesioner kepada 42 responden secara terstruktur. Sebagai peubah tidak bebas dalam penelitian ini adalah produksi rumput laut, sedangkan peubah bebas adalah faktor pengelolaan budidaya. Analisis regresi berganda dengan peubah boneka digunakan untuk memprediksi produksi rumput laut. Hasil penelitian menunjukkan bahwa produksi rumput laut di Kabupaten Pohuwato Provinsi Gorontalo berkisar antara 266-16.000 dengan rata-rata 2.580 kg kering/3.000 m2. Upaya peningkatan produksi yang dilakukan dengan mengetahui faktor pengelolaan adalah jumlah tali ris per 3.000 m2, jarak antar rumpun dalam tali ris, kedalaman tali bentang, bahan pelampung, asal bibit, pengontrolan rumput laut, dan umur rumput laut kering saat panen. Untuk meningkatkan produksi rumput laut di Kabupaten Pohuwato Provinsi Gorontalo dilakukan dengan penambahan jumlah tali ris, penambahan jarak antar rumpun dalam tali ris, kedalaman tali bentang tidak melebihi 30 cm, penggunaan bahan pelampung yang tidak terlalu banyak, menggunakan bibit yang berkualitas, melakukan pengontrolan rumput laut sesering mungkin dan waktu panen rumput laut tidak melebihi 1,5 bulan.', 'pengelolaan budidaya; rumput laut; Kabupaten Gorontalo', 'D23'),
(24, 'media akuakultur', '8', '1', 'juni', '2013', 'MODEL PENERAPAN IPTEK PENGEMBANGAN KEBUN BIBIT RUMPUT LAUT, Kappaphycus alvarezii, DI KABUPATEN MINAHASA UTARA, SULAWESI UTARA', 'Kabupaten Minahasa Utara dengan luas laut sekitar 295.000 km  dan panjang garis pantai sekitar 229,2 km memiliki potensi kelautan dan perikanan yang sangat besar. Kabupaten ini telah ditetapkan sebagai kawasan minapolitan rumput laut sesuai dengan Keputusan Menteri Kelautan dan Perikanan Nomor KEP.39/MEN/2011. Kebutuhan bibit merupakan faktor utama dalam pengembangan rumput laut. Ketersediaan bibit yang memadai, berkualitas, dan berkesinambung merupakan faktor penentu keberhasilan budidaya rumput laut. Model penerapan IPTEK dari program IPTEKMAS (ilmu pengetahuan dan teknologi untuk masyarakat), merupakan langkah efektif yang ditempuh oleh Pusat Penelitian dan Pengembangan Perikanan Budidaya dengan tujuan penyebar luasan hasil penelitian dan pengembangan berupa teknologi pengembangan kebun bibit di Kabupaten Minahasa Utara Provinsi Sulawesi Utara. Pelaksanaan IPTEKMAS di kabupaten ini melibatkan lima kelompok pembudidaya rumput laut dari dua desa yang berdampingan yaitu Desa Kema II dan Desa Kema III Kecamatan Kema. Pengembangan kebun bibit model IPTEKMAS ini diterapkan dengan sistem rawai (long line) berukuran 50 m x 35 m. Hasil kegiatan menunjukkan pertumbuhan rumput laut yang dibudidayakan di lokasi kegiatan sangat baik dengan rata-rata pertumbuhan setiap siklus pemeliharaan bibit adalah 200 g (bibit awal 50 g). Model penerapan IPTEK ini mendapat respons positif dari masyarakat pembudidaya.', 'penerapan IPTEK; kebun bibit rumput laut; IPTEKMAS; Minahasa Utara', 'D24'),
(25, 'buletin teknik litkayasa akuakultur', '14', '2', 'desember', '2016', 'KONSTRUKSI WADAH BUDIDAYA RUMPUT LAUT Sargassum sp. DENGAN METODE LEPAS DASAR', 'Rumput laut Sargassum sp. merupakan penghasil alginat yang diperoleh dari alam, tumbuh secara alami, dan bergantung pada kondisi alam, sehingga kontinuitas produksinya tidak terjamin. Penelitian untuk meningkatkan kontinuitas produksi rumput laut jenis ini telah dilakukan di Loka Penelitian dan Pengembangan Budidaya Rumput Laut, Gorontalo; dengan cara melakukan budidaya metode lepas dasar. Tujuan dilaksanakan kegiatan ini adalah untuk mengkaji teknik konstruksi wadah budidaya rumput laut Sargassum sp. metode lepas dasar, sebagai upaya peningkatan produksinya. Kegiatan dilaksanakan di Desa Kramat Kecamatan Mananggu Kabupaten Boalemo. Pada bulan Maret 2015 di perairan Teluk Tomini Provinsi Gorontalo. Hasil yang diperoleh menunjukkan bahwa pemasangan konstruksi wadah budidaya metode lepas dasar dapat dilakukan saat air pasang terendah, pada kedalaman 1-1,5 m; sebaiknya ditempatkan pada dasar laut yang memiliki pasir berlumpur', 'Sargassum sp.; konstruksi wadah; metode lepas dasar', 'D25'),
(26, 'prosiding FORUM INOVASI TEKNOLOGI AKUAKULTUR', '-', '-', '-', '2012', 'STRATEGI DAN KEBIJAKAN PENGEMBANGAN RUMPUT LAUT DI KABUPATEN BREBES, JAWA TENGAH', 'Kabupaten Brebes merupakan salah satu daerah penghasil rumput laut jenis Gracilaria sp. yang sangat besar dan potensial menjadi sentra budidaya rumput laut. Kebutuhan industri  terhadap rumput laut jenis ini cukup besar sekitar 1.700 ton per bulan. Terdapat kecenderungan harga rumput laut terus menurun dan dikhawatirkan akan menurunkan minat pembudidaya untuk menghasilkan rumput laut. Untuk itu, telah dilakukan penelitian mengenai analisis kebijakan terhadap pengembangan budidaya rumput laut di Kabupaten Brebes. Tujuan dari penelitian ini adalah untuk merumuskan strategi dan kebijakan dalam rangka peningkatan produksi rumput laut secara kuantitas dan kualitasnya untuk mendukung industrialisasi yang telah dicanangkan oleh pemerintah. Hasil yang diperoleh adalah opsi-opsi kebijakan yang nantinya dapat digunakan sebagai acuan untuk pengembangan budidaya rumput laut dimasa mendatang. Adapun opsiopsi tersebut adalah perlu dilakukan penyusunan pengembangan rumput laut yang jelas dan terarah; perlu dilakukan penataan kelembagaan kelompok yang mengarah pada pembentukan koperasi; perlu dibuat regulasi yang jelas terhadap perijinan pendirian unit-unit produksi rumput laut; dan perlu dibuat MoU antara produsen rumput laut dengan pabrikan agar terdapat jaminan harga di tingkat pembudidaya.', 'rumput laut; Gracilaria sp.; kebijakan; pengembangan; industrialisasi', 'D26'),
(27, 'prosiding FORUM INOVASI TEKNOLOGI AKUAKULTUR', '-', '-', '-', '2015', 'PERBANYAKAN RUMPUT LAUT Gracilaria sp. HASIL KULTUR JARINGAN DI TAMBAK', 'Kementerian Kelautan dan Perikanan mempunyai visi untuk menjadikan Indonesia sebagai produsen perikanan terbesar pada tahun 2015. Satu di antara komoditas yang diharapkan menjadi penyumbang terbesar untuk mencapai visi tersebut adalah rumput laut dengan target 12,25 juta ton. Rumput laut menjadi komoditas utama karena bisa cepat dipanen, teknologi budidayanya mudah diadopsi oleh masyarakat, dan input produksi yang relatif kecil. Upaya peningkatan produksi rumput laut juga tidak terlepas dari permasalahan, seperti tersedianya bibit unggul dalam jumlah yang  memadai pada waktu tertentu. Untuk memenuhi ketersediaan bibit rumput laut yang bermutu maka telah dilakukan perbanyakan rumput laut Gracilaria sp. hasil kultur jaringan di tambak. Hasil kultur jaringan eksplan rumput laut di laboratorium selama dua bulan, kemudian dilanjutkan dengan aklimatisasi di tambak selama dua bulan hingga mencapai tanaman muda rumput laut yang siap diperbanyak untuk dijadikan bibit unggul rumput laut. Penelitian dilakukan di tambak Kabupaten Pangkep. Bibit rumput laut hasil kultur jaringan seberat 5.000 g dipelihara dalam hapa yang terbuat dari waring berukuran 5 m x 4 m x 1,2 m. Dalam pemeliharan selama 30 hari mencapai bobot 29.500 g dengan LPH 5,61. Perbanyakan rumput laut dengan metode long line pada bobot awal 800 g/bentangan (5 m), dalam waktu 30 hari dapat mencapai bobot 2.900 g dengan LPH 5,29. Hasil penelitian ini diharapkan sebagai informasi untuk dapat menggunakan bibit rumput laut Gracilaria sp. hasil kultur jaringan agar target produksi dapat dicapai.', 'perbanyakan rumput laut; kultur jaringan; tambak', 'D27'),
(28, 'prosiding FORUM INOVASI TEKNOLOGI AKUAKULTUR', '-', '-', '-', '2013', 'UPAYA PENINGKATAN PRODUKTIVITAS RUMPUT LAUT, Kappaphycus alvarezii DENGAN MENGETAHUI FAKTOR PENGELOLAAN DI KABUPATEN KONAWE SELATAN PROVINSI SULAWESI TENGGARA', 'Berdasarkan analisis Location Quotient (LQ), rumput laut di Kabupaten Konawe Selatan Provinsi Sulawesi Tenggara merupakan salah satu komoditas unggulan. Metode budidaya yang digunakan adalah metode apung atau tali panjang (long line), yang dapat diterapkan di perairan yang relatif dalam dan perairan\r\ndangkal. Penelitian ini bertujuan untuk mengetahui produktivitas rumput laut pada beberapa faktor pengelolaan yang dilakukan dalam budidaya rumput laut. Metode survai digunakan dalam penelitian dengan mengajukan kuisioner kepada responden secara terstruktur. Peubah tidak bebas dalam penelitian ini adalah\r\nproduksi rumput laut, sedangkan faktor pengelolaan budidaya adalah peubah bebas. Untuk memprediksi produksi rumput laut digunakan analisis regresi berganda dengan peubah boneka. Hasil penelitian menunjukkan bahwa produksi rumput laut di Kabupaten Konawe Selatan Provinsi Sulawesi Tenggara berkisar\r\nantara 540-2160 kg dengan rata-rata 942 kg kering/3.000 m2. Upaya peningkatan produktivitas rumput laut yang dilakukan dengan mengetahui faktor pengelolaan adalah panjang tali ris, jarak antar rumpun dalam tali ris, sistem budidaya, kedalaman tali bentang, asal bibit, berat bibit, masalah yang didapatkan selama budidaya rumput laut, umur rumput laut saat panen dan tempat pengeringan rumput laut. Untuk meningkatkan produksi rumput laut di Kabupaten Konawe Selatan Provinsi Sulawesi Tenggara dilakukan dengan penambahan panjang tali ris, penambahan jarak antar rumpun dalam tali ris, sistem budidaya yang tepat, kedalaman tali bentang tidak melebihi 50 cm, asal bibit yang bagus, penggunaan berat bibit sesuai dengan metode budidaya, memperhatikan cuaca dan pola tanam untuk meminimalkan masalah selama\r\nbudidaya, waktu panen tidak melebihi 1,5 bulan dan cara penanganan pasca panen dalam hal tempat\r\npengeringan harus diperhatikan.', 'pengelolaan budidaya, rumput laut, Konawe Selatan', 'D28'),
(29, 'prosiding FORUM INOVASI TEKNOLOGI AKUAKULTUR', '-', '-', '-', '2012', 'KARAKTERISASI MUTU RUMPUT LAUT MERAH Gracilaria sp. DARI BEBERAPA DAERAH DI INDONESIA', 'Penelitian tentang karakterisasi mutu rumput laut merah Gracilaria sp. dari beberapa daerah di Indonesia telah dilakukan. Penelitian ini mempunyai tujuan untuk mendapatkan informasi dan data mengenai jenis dan karakteristik mutu rumput laut merah alam dan budidaya. Bahan baku yang digunakan adalah rumput laut merah dari alam dan budidaya, yang potensial sebagai bahan baku ekspor. Dalam inventarisasi jenis rumput laut ini dilakukan pengamatan meliputi jenis rumput laut, kondisi lingkungan, umur panen, teknik pemanenan, teknik penanganan, teknik pengeringan, dan teknik penyimpanan yang diamati di lokasi. Sampel rumput laut yang diperoleh dari lapangan kemudian dilakukan karakterisasi mutu rumput laut yang meliputi kadar air, CAW, kadar pengotor, kadar garam, dan rendemen agar. Berdasarkan hasil karakteristik mutu tersebut, mutu rumput laut yang diperoleh dari daerah Medan tersebut berdasarkan standar mutu SNI 01-2690-2009 (SNI rumput laut kering) belum cukup memenuhi beberapa persyaratannya yaitu kadar air 15%-20%, dan kadar benda asing/pengotor maksimal 5%. Mutu rumput laut yang diperoleh dari daerah Bekasi, Brebes, Yogyakarta, dan Makassar sudah cukup memenuhi persyaratan kadar air dan kadar pengotor berdasarkan standar mutu SNI 01-2690-2009 (SNI rumput laut kering).', 'karakterisasi; rumput laut merah; Gracilaria sp.; Indonesia', 'D29'),
(30, 'jurnal kelautan nasional', '13', '3', 'desember', '2018', 'PENGARUH LOKASI DAN KONDISI PARAMETER FISIKA-KIMIA OSEANOGRAFI UNTUK PRODUKSI RUMPUT LAUT DI WILAYAH PESISIR KABUPATEN TAKALAR, SULAWESI SELATAN', 'Pertumbuhan rumput laut jenis Eucheuma sp. dipengaruhi oleh faktor oseanografi meliputi parameter fisika, kimia dan biologi.Penelitian ini bertujuan untuk mengetahui distribusi spasial parameter fisika-kimia oseanografi dan pengaruhnya terhadap produksi rumput laut Eucheuma cottonii. Distribusi spasial parameter fisika-kimia perairan dianalisis menggunakan Analisis Komponen Utama (Principal Component Analysis, PCA).Hubungan antara parameter fisika-kimia dengan produksi rumput laut dianalisis menggunakan regresi linear berganda. Analisis distribusi spasial parameter fisika-kimia menghasilkan 3 kelompok utama, dimana pengaruh stasiun sangat dominan dalam pengelompokan tersebut. Parameter fisika-kimia memberikan karakteristik yang berbeda antara kedua lokasi pengamatan (Kecamatan Sanrobone dan Mangarabombang). Adapun produksi rumput laut di Kecamatan Sanrobone dapat diramalkan menggunakan persamaan ini (R = 98,6%.): Produksi = - 2343 + 331 suhu - 48.6 salinitas   41,6 DO - 708 pH   3,33 TSS + 48,5 BOT + 458 kecepatan. arus   8,6 kecerahan + 46,5 kedalaman - 159 nitrogen - 615 fosfat + 1,625 silikat. Sedangkan untuk produksi rumput laut di Kecamatan Mangarabombang dapat diramalkan menggunakan persamaan ini (R = 76,9%.): Produksi = - 385 + 448 suhu - 499 salinitas + 940 DO + 220 pH   12.4 TSS + 12.2 BOT + 5.997 kecepatan arus - 311 kecerahan + 60 kedalaman - 726 nitrogen - 106 fosfat - 8,577 silikat.', 'Fisika-kimia oseanografi, distribusi spasial, rumput laut, PCA, regresi linear berganda, Takalar.', 'D30');
INSERT INTO `tbjurnal` (`Id`, `sumber`, `volume`, `nomor`, `bulan`, `tahun`, `judul`, `abstrak`, `katakunci`, `nm_dk`) VALUES
(31, 'prosiding FORUM INOVASI TEKNOLOGI AKUAKULTUR', '-', '-', '-', '2009', 'TINGKAT PENYERAPAN NITRAT OLEH RUMPUT LAUT Kappaphycusalvarezii (Doty', 'Konsentrasi nitrat sangat berperan terhadap tingkat penyerapan nutrien oleh rumput laut K. alvarezii baik pada varitas coklat maupun hijau. Penelitian dilaksanakan di Balai Riset Perikanan Budidaya Air Payau pada bulan Juli 2008, dan sumber rumput laut dari Kabupaten Takalar. Penelitian menggunakan Rancangan Acak Lengkap pola faktorial. Konsentrasi nitrat yang dicobakan adalah 0,3; 0,6; dan 0,9 dengan masa inkubasi 4, 8, 12, dan 24 jam. Sampel rumput laut diinkubasi dalam wadah 3.000 mL dengan volume air 2.000 mL sebanyak 20-30 g, sumber cahaya lampu fluorescen dengan periode terang 24 jam. Hasil penelitian menunjukkan bahwa pada pada konsentrasi nitrat 0,9 mg/L, laju penyerapan tertinggi oleh rumput laut adalah 21.3234-24.7684 ?g/g bobot kering/jam. Nilai ini bisa digunakan untuk melakukan estimasi luas hamparan budidaya rumput laut yang mampu menyerap beban limbah budidaya tambak.', 'laju penyerapan, nitrat, Kappaphycusalvarezii', 'D31'),
(32, 'jurnal riset akuakultur', '5', '2', 'agustus', '2010', 'ANALISIS KESESUAIAN LAHAN UNTUK PENGEMBANGAN BUDIDAYA RUMPUT LAUT DI GUSUNG BATUA, PULAU BADI KABUPATEN PANGKEP, SULAWESI SELATAN', 'Seaweed cultures were very prospective for alternative job by community in coastal and small Island. Site selection of culture by inventory and mapping activity of waters resource make up initial stage of important done. This research aimed to determine of waters suitable for development of seaweed culture in Batua Reef, Badi Island, Pangkep Regency, South Sulawesi. Research conduct by survey method to obtain primary data with Geographical Information System (GIS) and secondary data. Data were analysis with PATTERN (Planning Assisstance Through Technical Evaluation of Relevant Numbers) method based on scoring of key variables to determine of suitable level of waters for development of seaweed culture. Result of research showed that Batua Reef waters have area potential for seaweed culture with most suitable were 42,1 ha (4.2%) as wide, moderately suitable were 660.3 ha (66.6%) as wide, and low suitable were 156.8 ha (15,8%) as wide.', 'lahan budidaya; rumput laut; gusung; Kabupaten Pangkep', 'D32'),
(33, 'jurnal segara', '16', '1', 'april', '2020', 'Analisis Kesesuaian Perairan untuk Budi daya Rumput Laut Menggunakan Multidimensional Scaling (MDS)', 'Penilaian kesesuaian perairan dalam mendukung kegiatan budidaya rumput laut salah satunya dipengaruhi oleh parameter kualitas perairan. Penelitian ini bertujuan untuk membuktikan kesesuaian perairan dalam mendukung kegiatan budidaya rumput laut dengan pendekatan Multidimensional Scaling. Hal ini diharapkan akan diperoleh tingkat kesesuaian perairan serta parameter kualitas perairan yang paling dominan. Hasil penelitian ini menunjukkan bahwa kualitas perairan di Pulau Panjang dalam mendukung kegiatan budidaya rumput laut yaitu cukup sesuai dengan nilai berkisar antara 58-68. Parameter kualitas perairan yang paling dominan yaitu fosfat dengan nilai perubahan RMS 6,376. Penelitian ini menunjukkan bahwa dominannya kandungan fosfat di wilayah perairan Pulau Panjang merupakan indikator terjadinya pencemaran yang bersumber dari limbah domestik yang diduga berasal dari kegiatan pertanian, peternakan serta limbah rumah tangga. Namun demikian tingkat kesesuaian perairan di Pulau Panjang apabila dikelola dengan baik atau mendapatkan perhatian yang lebih dari pihak-pihak yang berkepentingan dengan budidaya rumput laut, maka dapat berpengaruh terhadap tingkat kesesuaian perairan. Sehingga kualitas perairan di Pulau Panjang dapat mengalami pergeseran kearah sesuai.', 'kesesuaian; kualitas air; Pulau Panjang; rumput laut', 'D33'),
(34, 'buletin teknik litkayasa akuakultur', '12', '1', 'juni', '2014', 'Penentuan Pola Musim Tanam Budidaya Rumput Laut kappahycus alvarezii di perairan Parigi Mountong, Sulawesi Tengah', 'Abstrak lengkap dapat dilihat pada full. pdf\r\n\r\nMakalah ini menyajikan pola musim tanam rumput laut kappaphycus alvarezii di Perairan Parigi Mountong, Sulawesi Tengah', 'musim tanam; budidaya; rumput laut; Parigi Mountong', 'D34'),
(35, 'buletin ilmiah marina sosial ekonomi kelautan dan perikanan', '8', '2', '-', '2013', 'Assesment Blue Economy: Implementasi Integrated Multi-Tropic Aquaculture (IMTA) pada Kawasan KIMBis Cakradonya di Banda Aceh', 'Salah satu prinsip dari ekonomi biru (blue economy) adalah memanfaatkan limbah berbagai usaha kelautan dan perikanan pada masyarakat menuju zero waste. Tiga prinsip lain yang mendukung pencapaian zero waste adalah teknologi yang digunakan harus inovatif dan adaptif, usaha tersebut harus memiliki inklusi sosial dan mampu mendorong multiplier effect yang luas dalam perekonomian. Dengan empat prinsip tersebut pada tahun 2013, KIMBis Cakradonya di Banda Aceh melakukan implementasi ekonomi biru dengan menggunakan teknologi Integrated Multitropic Aquaculture (IMTA). Teknologi ini mengutamakan budidaya kepiting soka sebagai komoditas target, diintegrasikan dengan komoditas bandeng dan rumput laut sebagai komoditas non-target. Tulisan ini bertujuan untuk memberi gambaran hasil pelaksanaan implementasi prinsip ekonomi biru dengan menggunakan teknologi IMTA. Hasil implementasi menunjukkan bahwa kondisi perairan kawasan implementasi IMTA sangat baik untuk dikembangkan budidaya kepiting soka, rumput laut dan bandeng secara terpadu. Sementara itu, data pertambahan berat kepiting soka selama 45 hari adalah: 11 gram per ekor dengan tingkat kematian 10%. Pertambahan berat rumput laut menunjukkan hasil yang sangat baik karena mengalami pertambahan 100% dibandingkan dengan berat awal penanaman. Namun, ikan bandeng tidak mengalami pertumbuhan yang cukup baik bila dibandingkan dengan pertumbuhan nener bandeng dibesarkan di kolam pada umumnya. Penerapan prinsip Blue Economy pada budidaya kepiting soka berpotensi menghasilkan limbah cangkang kepiting sekitar 1 kuintal per hektar per hari, sehingga jika usaha ini berkembang sekitar 100 hektar akan terdapat potensi limbah yang dapat dimanfaatkan sebanyak 100 kuintal per hari (10 ton). Implementasi Blue Economy ini sangat bergantung pada tingkat partisipasi para pemangku kepentingan di luar satker litbang. Oleh sebab itu, hasil kegiatan ini mengusulkan perlu dilakukan sosialisasi lanjutan kepada SKPD dan masyarakat, termasuk enterpreneur agar level partisipasi mereka dalam kegiatan KIMBis berada pada level involvement. Dengan level partisipasi tersebut maka implementasi blue economy dapat memenuhi prinsip-prinsip minimize waste, inklusi sosial, teknologi inovatif dan adaptif serta memiliki multiplier effect yang luas.', 'ekonomi biru; teknologi budidaya; multitropik terintegrasi; KIMBis; Banda Aceh', 'D35'),
(36, 'prosiding FORUM INOVASI TEKNOLOGI AKUAKULTUR', '-', '-', '-', '2016', 'PENENTUAN POLA MUSIM TANAM OPTIMAL RUMPUT LAUT Eucheuma striatum DI PERAIRAN KABUPATEN POHUWATO, GORONTALO', 'Kabupaten Pohuwato merupakan salah satu wilayah di Provinsi Gorontalo yang telah di tetapkan sebagai wilayah minapolitan dengan komoditas rumput laut. Rumput laut Eucheuma striatum adalah jenis rumput laut penghasil karaginan yang telah dibudidayakan secara luas di hampir seluruh wilayah perairan Indonesia. Walaupun demikian, para pembudidaya masih memiliki informasi yang terbatas mengenai waktu tanam yang tepat sehingga menyebabkan produktivitas rumput laut masih kurang optimal. Penelitian ini bertujuan untuk menentukan waktu tanam yang optimal bagi rumput laut Eucheuma striatum di perairan Kabupaten Pohuwato Provinsi Gorontalo. Penelitian ini dilakukan pada bulan Januari-Desember 2015. Parameter utama yang diamati adalah pertumbuhan, performansi talus dan kualitas perairan sebagai parameter pendukung. Metode budidaya rumput laut yang digunakan dalam penelitian ini adalah metode long line (tali panjang) dengan luas konstruksi 35 x10 m dan bobot awal bibit 50 g. Budidaya rumput laut dilakukan selama tujuh siklus tanam dengan lama pemeliharaan 45 hari per siklus tanam. Hasil penelitian menunjukkan bahwa pertumbuhan optimal rumput laut E. striatum terjadi pada siklus ke-3 yaitu antara bulan Mei Juni dengan nilai laju pertumbuhan harian (LPH) 4,16%. Musim tanam optimal untuk budidaya E. striatum di perairan Kabupaten Pohuwato adalah pada bulan Mei Juni.', 'budidaya; Eucheuma striatum; musim tanam optimal; Kabupaten Pohuwato', 'D36'),
(37, 'prosiding FORUM INOVASI TEKNOLOGI AKUAKULTUR', '-', '-', '-', '2015', 'PERFORMANSI PERTUMBUHAN DAN KANDUNGAN KARAGINAN RUMPUT LAUT Kappaphycus alvarezii YANG DIBUDIDAYAKAN PADA LOKASI YANG BERBEDA DI PERAIRAN TELUK TOMINI, GORONTALO', 'Kandungan karaginan yang dimiliki rumput laut Kappaphycus alvarezii merupakan komponen penting dalam pemanfaatannya di dunia industri rumput laut. Rumput laut berperan dalam beberapa bidang industri di antaranya industri makanan, kecantikan, farmasi, tekstil, dan pertanian. Tujuan penelitian ini adalah untuk mengetahui performansi pertumbuhan dan kandungan karaginan rumput laut Kappaphycus alvarezii yang dibudidayakan pada tiga lokasi berbeda di perairan Teluk Tomini Gorontalo, yakni di perairan Dusun Tambe dan Dusun Keramat (Kabupaten Boalemo), serta Dusun Banjara (Kabupaten Pohuwato). Penelitian dilaksanakan dari bulan Maret-November 2014. Budidaya rumput laut menggunakan metode long line dengan ukuran konstruksi 35 m x 10 m. Bibit ditanam dengan bobot awal 50 g dengan jarak rumpun 15 cm dan 10 kali ulangan di tiap lokasi budidaya. Pengamatan dilakukan setiap 30 hari. Berdasarkan hasil pengamatan pertumbuhan diperoleh bahwa pertambahan bobot basah rumput laut paling besar terjadi pada rumput laut yang dibudidaya di perairan Dusun Tambe dengan bobot terbesar 252,20 g dari bobot awalnya 50 g. Hal ini tidak sejalan dengan kandungan karaginan pada setiap lokasi budidaya. Berdasarkan hasil analisis data diperoleh bahwa kandungan karaginan tidak berbeda nyata pada ketiga lokasi budidaya di perairan Teluk Tomini, Gorontalo. Rumput laut yang dipelihara di perairan Dusun Banjara memiliki kandungan karaginan tertinggi dengan rerata sebesar 35,89   2,64%; dan kandungan karaginan tertinggi yang diperoleh yakni sebesar 48,45%.', 'karaginan; Kappaphycus alvarezii; Teluk Tomini', 'D37'),
(38, 'prosiding FORUM INOVASI TEKNOLOGI AKUAKULTUR', '-', '-', '-', '2015', 'PERTUMBUHAN RUMPUT LAUT Kappaphycus alvarezii, Eucheuma denticulatum, DAN Eucheuma striatum PADA BUDIDAYA LAUT BERBASIS INTEGRATED MULTI TROPHIC AQUACULTURE (IMTA) DI TELUK TOMINI, GORONTALO', 'Integrated Multi-Trophic Aquaculture (IMTA) adalah salah satu bentuk dari budidaya laut dengan memanfaatkan penyediaan pelayanan ekosistem oleh organisme trofik rendah yang disesuaikan sebagai mitigasi terhadap limbah dari organisme tingkat trofik tinggi. Kegiatan penelitian budidaya laut berbasis IMTA dilakukan di perairan Teluk Tomini, Kabupaten Boalemo Provinsi Gorontalo dengan mengintegrasikan budidaya ikan kerapu sebagai organisme tingkat trofik tinggi dengan budidaya kerang dan rumput laut sebagai organisme tingkat trofik rendah di dalam satu kawasan budidaya laut. Ada tiga jenis rumput laut yang digunakan yakni Kappaphycus alvarezii, Eucheuma denticulatum, dan Eucheuma striatum. Ketiga jenis rumput laut dipelihara dengan sistem long-line dengan menggunakan tali bentangan sepanjang 35 m dan jarak antar rumpun 30 cm. Pemeliharaan rumput laut dilakukan selama satu siklus (45 hari) dengan sampling pertumbuhan setiap 15 hari untuk kemudian dilakukan perbandingan nilai laju pertumbuhan hariannya. Berdasarkan hasil sampling yang telah dilakukan, dua jenis rumput laut yakni E. denticulatum dan E. striatum mengalami peningkatan nilai laju pertumbuhan hariannya pada sampling hari ke-30 pemeliharaan, akan tetapi kemudian menurun setelahnya hingga sampling terakhir pada hari ke-45 pemeliharaan. E. denticulatum memiliki nilai laju pertumbuhan harian tertinggi sebesar 3,29   0,50% sedangkan E. striatum memiliki nilai laju pertumbuhan harian tertinggi sebesar 2,82   0,32%. Rumput laut jenis K. alvarezii menunjukkan laju pertumbuhan yang lebih rendah dibandingkan kedua jenis lainnya. Laju pertumbuhan harian tertinggi K. alvarezii selama penelitian ini tertinggi hanya sebesar 0,91   0,40%. Dari hasil penelitian ini menunjukkan bahwa kawasan budidaya laut berbasis IMTA di perairan Teluk Tomini, Gorontalo sangat cocok untuk pertumbuhan rumput laut jenis E. denticulatum.', 'IMTA; pertumbuhan rumput laut; budidaya laut; Gorontalo', 'D38'),
(39, 'prosiding FORUM INOVASI TEKNOLOGI AKUAKULTUR', '-', '-', '-', '2013', 'PRIORITAS KEBIJAKAN DALAM PENGEMBANGAN BUDIDAYA RUMPUT LAUT DI KABUPATEN MINAHASA UTARA, PROVINSI SULAWESI UTARA', 'Rumput laut menjadi komoditas primadona untuk dikembangkan di seluruh kawasan pesisir Indonesia sejak ditetapkan sebagai salah satu komoditas unggulan pada tahun 2005. Berdasarkan hal tersebut telah ditargetkan produksi rumput laut nasional tahun 2014 mencapai 10.000.000 ton dari 2.574.000 ton tahun 2009 atau peningkatannya setara 389%. Keberhasilan usaha budidaya rumput laut sangat tergantung pada beberapa faktor yang saling terkait antara lain pengetahuan mengenai jenis rumput laut, pemilihan lokasi yang sesuai, penyiapan sarana dan prasarana yang memadai, pemilihan bibit yang berkualitas, penanaman bibit yang tepat, penentuan teknik budidaya yang tepat, perawatan yang rutin, pengendalian hama dan penyakit yang akurat serta panen dan penanganan pasca panen yang benar. Selain itu perlu dilakukan\r\npengembangan dan perluasan kawasan budidaya. Dalam pengembangan kawasan budidaya rumput laut mutlak dibutuhkan strategi kebijakan yang tepat sehingga melahirkan program indikatif yang memiliki indikator keberhasilan baik secara ekonomi, ekologi maupun sosial. Berdasarkan hal tersebut maka telah dilakukan penelitian bertujuan untuk menentukan prioritas kebijakan dalam pengembangan kawasan budidaya rumput laut di Kabupaten Minahasa Utara. Penelitian ini dilakukan pada bulan Mei 2012 di Kabupaten Minahasa Utara. Data dikumpulkan dengan metode wawancara. Penelitian ini dilakukan dengan menggunakan pendekatan analisis hirarki proses (AHP) yaitu suatu bentuk analisis yang menghasilkan dan menyajikan informasi sedemikian rupa sehingga dapat memberi landasan ilmiah yang kuat bagi pembuat \r\nkebijakan. Responden kunci atau dalam penelitian ini disebut sebagai aktor berjumlah empat belas orang masing-masing berasal dari instansi yang berbeda yang memiliki hubungan langsung dan tidak langsung dengan pengembangan kawasan budidaya rumput laut di Kabupaten Minahasa Utara. Hasil penelitian\r\nmenunjukkan bahwa dalam rangka mengembangkan kawasan budidaya rumput laut di Kabupaten Minahasa Utara maka prioritas kebijakan yang harus dilakukan adalah (1) peningkatan kualitas sumberdaya manusia, (2) peningkatan persepsi masyarakat, (3) membuat zona kesesuaian lahan rumput laut, (4) pembangunan infrastruktur, (5) perluasan akses pasar, (6) penyediaan sarana budidaya, (7) penguatan modal, (8) penyediaan teknologi budidaya, dan (9) dukungan peraturan pemerintah dan birokra', 'kebijakan; pengembangan; rumput laut; Minahasa Utara', 'D39'),
(40, 'jurnal riset akuakultur', '9', '3', 'desember', '2014', 'UPAYA PENINGKATAN PRODUKTIVITAS RUMPUT LAUT Kappaphycus alvarezii DENGAN MENGETAHUI FAKTOR PENGELOLAAN DI KABUPATEN KONAWE SELATAN PROVINSI SULAWESI TENGGARA', 'Rumput laut di Kabupaten Konawe Selatan Provinsi Sulawesi Tenggara merupakan salah satu komoditas unggulan. Metode budidaya yang digunakan adalah metode apung atau tali panjang (long line). Penelitian dilakukan untuk mengetahui produktivitas rumput laut pada beberapa faktor pengelolaan yang dilakukan dalam budidaya rumput laut. Metode survai digunakan dalam penelitian dengan mengajukan kuisioner kepada responden secara terstruktur. Peubah tidak bebas dalam penelitian ini adalah produksi rumput laut, sedangkan faktor pengelolaan budidaya adalah peubah bebas. Untuk memprediksi produksi rumput laut digunakan analisis regresi berganda. Hasil penelitian menunjukkan bahwa produksi rumput laut di Kabupaten Konawe Selatan Provinsi Sulawesi Tenggara berkisar antara 540-2.160 kg/3.000 m2 dengan rata-rata 942 kg kering/3.000 m2. Upaya peningkatan produktivitas rumput laut dapat dilakukan melalui (1) penambahan jumlah tali ris dengan memperhatikan aspek ketersediaan bibit, arus, kondisi dasar perairan, kedalaman, salinitas, kecerahan, pencemaran, dan tenaga kerja; (2) penggunaan bibit rumput laut yang berkualitas baik dan berumur antara 25-35 hari; (3) penambahan jarak antar rumpun dalam tali ris maksimal 30 cm; dan (4) pengontrolan rumput laut secara rutin agar dapat meminimalkan masalah selama budidaya.', 'pengelolaan budidaya; rumput laut; Kabupaten Konawe Selatan', 'D40'),
(41, 'prosiding FORUM INOVASI TEKNOLOGI AKUAKULTUR', '-', '-', '-', '2015', 'PERTUMBUHAN DAN PERKEMBANGAN EKSPLAN RUMPUT LAUT Gracilaria verrucosa DAN G. gigas PADA AKLIMATISASI DI TAMBAK', 'Aklimatisasi eksplan rumput laut hasil kultur jaringan merupakan proses adaptasi eksplan dengan lingkungan budidaya. Penelitian ini bertujuan untuk mengevaluasi performa pertumbuhan dan perkembangan eksplan rumput laut G. verrucosa dan G. gigas yang diaklimatisasi di tambak dan mendapatkan informasi awal mengenai prospek pengembangan budidaya rumput laut G. gigas di tambak. Eksplan rumput laut G. verrucosa dan G. gigas hasil kultur jaringan dipelihara dalam hapa berukuran 50 cm x 50 cm x 50 cm dengan bobot awal 15 g/hapa dan dipelihara di tambak. Desain penelitian adalah rancangan acak lengkap (RAL) dengan enam unit penelitian terdiri atas tiga ulangan untuk masing-masing spesies. Pemeliharaan eksplan dilakukan selama 60 hari dan setiap 15 hari dilakukan pengukuran bobot, panjang, dan perkembangan eksplan, serta pemantauan terhadap kualitas air. Pengamatan histologi sel rumput laut G. verrucosa dan G. gigas dilakukan di bawah mikroskop. Analisis data pertumbuhan dilakukan dengan uji komparatif independent t-test sedangkan data perkembangan eksplan dan histologi sel rumput laut dianalisis secara deskritif. Pada pemeliharaan di tambak kedua jenis rumput laut memiliki pertumbuhan yang berbeda nyata (P<0,05). Rumput laut G. verrucosa memiliki bobot mutlak lebih tinggi (221,82 g) dariG. gigas (51,94 g) dan LPH bobot lebih tinggi (3,27%/hari) dari G. gigas (2%/hari). Rumput laut G. verrucosa juga memiliki pertambahan panjang yang lebih tinggi (5,28 cm) dari G. gigas (2,71 cm) dengan LPH panjang masing-masing sebesar 3,06%/hari dan 2,18%/ hari. Perkembangan eksplan rumput laut G. verrucosa lebih cepat daripada G. gigas, sehingga pengembangan budidaya G. gigas lebih baik tidak dilakukan di tambak.', 'pertumbuhan; perkembangan; G. verrucosa; G. gigas; eksplan; tambak', 'D41'),
(42, 'prosiding FORUM INOVASI TEKNOLOGI AKUAKULTUR', '-', '-', '-', '2013', 'SINTASAN MIKROPROPAGULE RUMPUT LAUT Kappaphycus alvarezii HASIL INDUKSI KALUS PADA MEDIA KULTUR YANG DIPERKAYA DENGAN COLCHISIN', 'Regenerasi embrio rumput laut Kappaphycus alvarezii hasil induksi kalus menjadi mikropropagule dan anakan rumput laut, masih memerlukan optimasi media yang sesuai untuk pertumbuhannya. Hormon perangsang tumbuh yang digunakan pada induksi kalus tidak cukup untuk memacu perkembangan mikropropagule menjadi anakan rumput laut. Salah satu senyawa kimia yang dapat memacu pertumbuhan rumput laut K. alvarezii antara lain colchisin, namun konsentrasi dan pengaruhnya terhadap perkembangan rumput laut belum diketahui, sehingga perlu dicari konsentrasi yang optimal, serta kondisi jaringan rumput laut setelah diaplikasikan dengan senyawa tersebut. Konsentrasi colchisin yang digunakan yaitu 0; 0,025; 0,050; 0,075 mg/L dan 0,10 mg/L; lama pemberian colchisin pada media 2, 4, 6, dan 8 minggu. Hasil penelitian memperlihatkan sintasan mikropropagule yang paling baik pada 0,025 mg/L. Sedangkan lama pemaparan yang paling optimal yaitu 2 minggu pada pemaparan dengan colchisin dalam media PES, dan 3 minggu pada media Grund. Penelitian ditujukan untuk memacu pertumbuhan embrio dan mikropropagule yang dihasilkan dari induksi kalus agar diperoleh bibit rumput laut yang berkualitas tinggi', 'colchisin; sintasan; mokropropagule Kappaphycus alvarezii', 'D42'),
(43, 'prosiding FORUM INOVASI TEKNOLOGI AKUAKULTUR', '-', '-', '-', '2016', 'IDENTIFIKASI KUALITAS BERBAGAI JENIS RUMPUT LAUT DAN NILAI KECERNAANNYA PADA IKAN GURAMI, Osphronemus gouramy', 'Pakan ikan mewakili lebih dari 50% biaya produksi dalam usaha akuakultur secara intensif, dengan protein sebagai bahan baku terpenting dan termahal di dalam pakan. Beberapa penelitian telah diarahkan untuk menggantikan peran tepung ikan dalam pakan salah satunya menggunakan bahan nabati. Salah satu bahan alternatif bahan pakan adalah rumput laut. Penelitian ini bertujuan untuk mengetahui nilai kecernaan rumput laut baik hasil budidaya maupun rumput laut dari alam pada ikan gurami Osphronemus gouramy. Rumput laut hasil budidaya yang diamati antara lain Euchema cottoni, Euchema spinosum, E. cottoni, dan E. spinosum diperoleh dari Kabupaten Sumbawa (NTB), Boalemo (Gorontalo), Brebes (Jawa Tengah) dan Nusa Pedida (Bali). Sargassum sp.. dan Caulerpa sp. diperoleh dari Kabupaten Pandeglang, sedangkan Ulva sp. diperoleh dari Kabupaten Gunung Kidul. Pakan acuan dibuat berdasarkan kebutuhan nutrisi ikan nila dan ikan gurami. Kromium oksida (Cr2O3) dengan tingkat 0,5% digunakan sebagai marker dalam pakan. Hasil penelitian menunjukkan bahwa komposisi proksimat rumput laut bervariasi antar jenis rumput laut. Protein tertinggi diperoleh pada rumput laut Caulerpa asal Pandeglang dengan kandungan protein 13,77%. gurami diperoleh pada rumput laut Ulva lactuca dengan nilai berturut-turut 72,74% dan 74,23%. Berdasarkan parameter yang ada Ulva lactuca dan Caulerpa dapat digunakan dalam pakan ikan air tawar.', 'kualitas rumput laut; bahan pakan ikan; ikan gurami', 'D43'),
(44, 'prosiding FORUM INOVASI TEKNOLOGI AKUAKULTUR', '-', '-', '-', '2014', 'PENGAMATAN PERTUMBUHAN RUMPUT LAUT Kappaphycus alvarezii DENGAN METODE LONG LINE DI PERAIRAN PARIGI MOUTONG PROVINSI SULAWESI TENGAH', 'Kappaphycus alvarezii merupakan salah satu jenis rumput laut yang mempunyai nilai ekonomis dan tersebar luas di wilayah perairan Indonesia. Keberadaan komoditi ini sebagai bahan baku dalam dunia industri sangat diperlukan. Hal ini erat kaitannya dengan kandungan keraginan yang terdapat dalam rumput laut tersebut. Keraginan ini sangat dibutuhkan dalam indukstri makanan, industri kosmetik, industri farmasi, industri tekstil, dan industri pertanian. Tujuan penelitian ini adalah untuk mengetahui pertumbuhan rumput laut (Kappaphycus alvarezii) yang dibudidayakan dengan metode long line di Perairan Parigi Moutong, Sulawesi Tengah. Penelitian dilakukan pada tahun 2013 dengan menggunakan desain rancangan acak lengkap. Sebagai perlakuan adalah penempatan unit penelitian yang dilakukan dalam tiga wilayah berbeda meliputi Wilayah Timur (T), Wilayah Tengah (M) dan Wilayah Barat (B). Sedangkan pertumbuhan (pertumbuhan bobot dan laju pertumbuhan) rumput laut sebagai ulangan. Hasil penelitian menunjukkan bahwa waktu pengamatan berpengaruh nyata (P<0,05) terhadap pertumbuhan rumput laut Kappaphycus alvarezii. Pertumbuhan bobot tertinggi diperoleh pada bulan April sebesar 101 43,8g dan terendah pada bulan November sebesar 12 6,5 g. Sedangkan laju pertumbuhan harian tertinggi pada bulan April dan Agustus secara berurut sebesar 2,18 0,8% dan 2,13 0,2% dan terendah pada bulan November sebesar 0,4 0,2%.', 'pertumbuhan; rumput laut K.alvarezii; longline; Parigi Moutong', 'D44'),
(45, 'prosiding FORUM INOVASI TEKNOLOGI AKUAKULTUR', '-', '-', '-', '2013', 'POLIKULTUR UDANG WINDU, NILA, BANDENG, DAN RUMPUT LAUT DI TAMBAK IDLE KABUPATEN TANGERANG, BANTEN', 'Produktivitas tambak idle yang rendah dapat ditingkatkan melalui budidaya polikultur udang windu, ikan (nila atau bandeng) dan rumput laut. Kajian kegiatan polikultur dilakukan di tambak idle di Desa Kronjo Kecamatan Kronjo Kabupaten Tangerang Provinsi Banten. Tambak yang digunakan dalam studi ini\r\nmempunyai luasan 4.000 m2. Kegiatan budidaya yang diterapkan adalah: (A) polikultur udang windu, bandeng, dan rumput laut dan (B) polikultur udang windu, nila, dan rumput laut, masing-masing dengan 2 ulangan. Hewan uji adalah udang windu ditebar dengan kepadatan 4 ekor/m2 (40.000 ekor/ha), gelondongan bandeng berukuran panjang 5-10 cm, gelondongan ikan nila berukuran panjang 5-8 cm dengan kepadatan 1.500 ekor (3.750 ekor/ha) dan rumput laut basah 0,2 kg/m2 (2.000 kg/ha). Hasil studi diketahui bahwa\r\nproduksi yang dihasilkan belum maksimal disebabkan selain kondisi tanah tambak yang tidak bisa dikeringkan secara total dan udang windu terserang penyakit White Spot Syndrome Virus (WSSV). Pada studi ini, A (petak\r\nI dan III) memberikan produksi udang windu 87,5-125 kg/ha (rata-rata 106,25 kg/ha), nila 300-312,5 kg/ha (rata-rata 306,25 kg/ha) dan rumput laut 5-6 ton basah (atau 750 kg/ha kering). Sedangkan pada B (petak II dan IV) memberikan produksi udang windu 109-117,5 kg/ha (rata-rata 113,25 kg/ha), bandeng 480-507,5 kg/ha (rata-rata 493,5 kg/ha) dan rumput laut 6,1 ton basah (atau 687,5 kg/ha kering). Analisis ekonomi memberikan hasil bahwa polikultur udang windu, bandeng, dan rumput laut memberikan keuntungan Rp\r\n4.892.500-Rp 5.164.000 per 0,4 ha per siklus (Rp 14.677.500-Rp 15.492.000 per/ha per siklus) dan B/C rasio 2,12-2,18. Hasil tersebut lebih tinggi  ibandingkan polikultur udang windu, nila dan rumput laut yang\r\nmemberikan keuntungan sebesar Rp 2.792.500-Rp 3.902.500 per 0,4 ha per siklus atau Rp 8.377.500-Rp 11.707.500 per ha per siklus dan B/C rasio 1,64-1,89.', 'polikultur, udang windu, bandeng, nila, rumput laut, Banten', 'D45'),
(46, 'jurnal riset akuakultur', '9', '2', 'agustus', '2014', 'REGENERASI RUMPUT LAUT Kappaphycus alvarezii HASIL TRANSFORMASI GEN Sitrat Sintase MENGGUNAKAN Agrobacterium tumefaciens SECARA IN VITRO', 'Introduksi gen sitrat sintase pada rumput laut Kappaphycus alvarezii menggunakan Agrobacterium tumefaciens telah dilakukan secara in vitro. Introduksi gen sitrat sintase ke dalam genom rumput laut dapat mengurangi cekaman oksidatif terutama perubahan yang disebabkan oleh perubahan suhu, salinitas dan cemaran logam di perairan. Penelitian ini bertujuan dalam rangka perbanyakan rumput laut hasil introduksi gen sitrat sintase melalui teknik kultur jaringan pada media cair dan media semi solid. Regenerasi tunas dilakukan berdasarkan eksplan yang tahan pada media seleksi higromisin serta evaluasi transgenik dilakukan menggunakan teknik PCR, di bawah kendali promoter 35S CaMV. Hasil penelitian memperlihatkan efisiensi transformasi pada media selektif sebanyak 30%, efisiensi regenerasi thalus transgenik pada media\r\nseleksi 85%, dan efisiensi regenerasi thalus non transgenik sebesar 95% pada media non selektif. Media recovery dengan penambahan pupuk PES memperlihatkan sintasan yang paling baik pada regenerasi thalus transgenik. Hasil analisis PCR memperlihatkan K. alvarezii transgenik putatif mengandung transgen PaCS di bawah kendali promoter 35S CaMV.', 'Kappaphycus alvarezii; rumput laut; gen PaCs; transformasi', 'D46'),
(47, 'prosiding FORUM INOVASI TEKNOLOGI AKUAKULTUR', '-', '-', '-', '2015', 'PERTUMBUHAN Kappaphycus alvarezii DAN Eucheuma striatum DENGAN SUMBER BIBIT YANG BERBEDA DI PERAIRAN BOALEMO, GORONTALO', 'Penggunaan bibit K. alvarezii oleh pembudidaya di Gorontalo Utara masih diperoleh dari kegiatan budidaya itu sendiri. Sedangkan untuk jenis E. striatum diperoleh dari Kabupaten Parigi Moutong. Selain Kabupaten Gorontalo Utara juga akan dikembangkan lokasi budidaya rumput laut di Kabupaten Boalemo. Penelitian ini bertujuan untuk mengetahui pertumbuhan rumput laut Kappaphycus alvarezii dan Eucheuma striatum dengan asal bibit berbeda. Penelitian dilakukan pada bulan Februari-Maret 2015 di lokasi pengembangan budidaya rumput laut di perairan Tabulo Selatan, Kabupaten Boalemo Provinsi Gorontalo. Penelitian dilakukan dalam siklus 45 hari pemeliharaan yang diamati secara berkesinambungan. Unit-unit percobaan disusun dengan dua kali ulangan pada setiap jenis rumput laut dengan sumber bibit yang berbeda yaitu dari Kecamatan Malalang, Sulawesi Tengah dan Kecamatan Kwandang, Gorontalo. Budidaya menggunakan metode long line dengan luasan konstruksi setiap lokasi penelitian adalah 35 m x 10 m. Bobot awal bibit 50 g/rumpun kemudian diikat pada tali bentangan dengan jarak 15 cm antar rumpun. Hasil penelitian menunjukkan bahwa pertumbuhan rumput laut E. striatum (bobot akhir 110,7 g; LPH 1,63%) dan K. alvarezii (bobot akhir 55,8 g; LPH 0,08%) dari Kwandang lebih baik dibandingkan sumber bibit dari Malalang.', 'pertumbuhan; rumput laut; asal bibit berbeda', 'D47'),
(48, 'prosiding FORUM INOVASI TEKNOLOGI AKUAKULTUR', '-', '-', '-', '2016', 'PERFORMANSI PERTUMBUHAN BIBIT RUMPUT LAUT Gracilaria verrucosa INTRODUKSI DENGAN PEREMAJAAN PADA PANJANG STEK BERBEDA DI TAMBAK', 'Introduksi satu jenis rumput laut ke suatu lokasi baru akan mengalami respon ekofisiologi dalam bentuk performansi pertumbuhan. Hal tersebut sangat terkait dengan faktor eksternal dan internal rumput laut, antara lain kondisi lingkungan perairan maupun jaringan talusnya. Tujuan penelitian ini adalah untuk mengetahui respon pertumbuhan rumput laut jenis Gracilaria verrucosa melalui peremajaan bibit introduksi dengan metode stek ditambak. Rancangan percobaan yang digunakan dalam penelitian ini adalah Rancangan Acak Lengkap (RAL) dengan enam perlakuan yaitu: 1 cm (A), 3 cm (B), 5 cm (C), 7 cm (D), 9 cm (E) dan tidak dipotong sebagai kontrol (K) g. Wadah penelitian yang digunakan adalah satu petak tambak dan kotak perlakuan yang dilapisi waring berukuran 50x50x50 cm. Bibit rumput laut kemudian dipotong sesuai dengan perlakuan sebanyak 1000 g kemudian disebar secara merata ke dalam wadah pemeliharaan. Masingmasing perlakuan diulang sebanyak 3 kali dan dipelihara selama 60 hari. Pengambilan data pertumbuhan dan kualitas air dilakukan setiap 15 hari. Data hasil penelitian dianalisis dengan analisis ragam (ANOVA) apabila berbeda nyata akan diuji lanjut W-Tukey. Hasil penelitian menunjukkan bahwa perlakuan panjang stek 5 dan 9 cm memberikan pengaruh yang berbeda terhadap kontrol. Dengan demikian metode stek talus rumput laut Gracilaria verrucosa akan menjadi teknologi baru dalam penyediaan bibit rumput laut berkualitas\r\nbaik.', 'introduksi; peremajaan; panjang stek; Gracilaria verrucosa', 'D48'),
(49, 'prosiding FORUM INOVASI TEKNOLOGI AKUAKULTUR', '-', '-', '-', '2015', 'PENGEMBANGAN BIBIT RUMPUT LAUT, Kappaphycus alvarezii DENGAN METODE SELEKSI VARIETAS DI BOALEMO, GORONTALO', 'Seleksi benih rumput laut dari satu populasi merupakan salah satu cara untuk mendapatkan bibit unggul, baik pertumbuhan maupun performannya. Penerapan metode seleksi varietas telah terbukti mampu mempercepat peningkatan produksi rumput laut di beberapa sentra budidaya rumput laut Indonesia termasuk di Provinsi Gorontalo. Penelitian ini bertujuan untuk menyediakan informasi cara mendapatkan bibit unggul K. alvarezii melalui metode seleksi varietas dalam upaya peningkatan produksi dan pendapatan pembudidaya rumput laut di Provinsi Gorontalo. Bahan percobaan adalah populasi parents stock rumput laut K. alvarezii yang diperoleh dari hasil budidaya masyarakat lokal. Tahap seleksi dilakukan pada bibit nonseleksi (G-0) setiap 30 hari masa pemeliharaan, hingga didapatkan generasi ke-3 (G-3), dengan cut off 10%. Setelah didapatkan G-3 kemudian dilakukan perbanyakan bibit hasil seleksi sebanyak dua kali. Hasil penerapan teknologi budidaya dan kebun bibit dengan metode seleksi varietas menunjukkan bahwa bibit hasil seleksi memberikan respons pertumbuhan yang lebih tinggi 22,3% dibandingkan dengan kontrol internal, serta 23,6% dibandingkan dengan kontrol eksternalnya. Bibit hasil seleksi yang telah mengalami perbanyakan sebanyak dua kali juga memiliki nilai laju pertumbuhan harian yang lebih tinggi yaitu (5,81%) dibandingkan dengan kontrol internal (3,87%), serta kontrol eksternal (3,89%). Namun di samping itu, budidaya rumput laut termasuk produksi bibit dengan metode seleksi varietas harus tetap memperhatikan kelayakan dan dukungan lingkungan perairan yang optimal bagi sintasan dan pertumbuhan rumput laut.', 'seleksi varietas; perbanyakan hasil seleksi; K. alvarezii; Gorontalo', 'D49'),
(50, 'prosiding FORUM INOVASI TEKNOLOGI AKUAKULTUR', '-', '-', '-', '2010', 'BUDIDAYA MULTITROPIK UDANG WINDU (Penaeus monodon), RUMPUT LAUT (Gracilaria sp.), DAN IKAN BANDENG (Chanos chanos) DI TAMBAK', 'Tujuan penelitian ini adalah untuk mendapatkan data dan informasi tentang sintasan dan produksi udang windu, rumput laut, dan ikan bandeng yang dipelihara secara multitropik di tambak. Penelitian ini dilaksanakan di Instalasi tambak percobaan Balai Riset Perikanan Budidaya Air Payau Marana, Maros selama 90 hari. Delapan tambak yang digunakan masing-masing berukuran 25 m x 100 m/2.500 m2 dengan kedalaman 80 cm. Sebagai perlakuan adalah A: udang windu + rumput laut (1 ton/ha) + bandeng (500 ekor/ha), B: udang windu + rumput laut (1 ton/ha) + bandeng (1.000 ekor/ha), C: udang windu + rumput laut (2 ton/ha) + bandeng (500 ekor/ha), D: udang windu + rumput laut (2 ton/ha) + bandeng (1.000 ekor/ ha), masing-masing dengan dua kali ulangan. Tokolan udang windu (PL-31) yang ditebar pada masing-masing tambak adalah 10.000 ekor/ha (1 ekor/m2). Selama pemeliharan tidak diberi pakan. Sampling dilakukan 30 hari sekali selama 90 hari. Data yang diperoleh dihitung dan diuji menggunakan analisis ragam. Hasil penelitian menunjukkan bahwa budidaya multitropik yang optimal antara udang windu, rumput laut, dan ikan bandeng adalah perlakuan B (2.500 ek/ha udang windu + 1 ton/ha rumput laut + 1.000 ekor/ha bandeng) menunjukkan hasil yang terbaik. Sintasan dan produksi udang windu dan ikan bandeng masing-masing adalah 66,9%; 33,7 kg, dan 99,8%; 63,9 kg; dan secara finansial memberikan keuntungan sebesar Rp 11.572.000,-/ha/90 hari.', 'multitropik, udang windu, rumput laut, ikan bandeng, sintasan, produksi', 'D50'),
(51, 'prosiding FORUM INOVASI TEKNOLOGI AKUAKULTUR', '-', '-', '-', '2015', 'SISTEM SELEKSI PADA KEBUN BIBIT RUMPUT LAUT SEBAGAI SOLUSI PENGEMBANGAN BUDIDAYA RUMPUT LAUT DI GORONTALO UTARA', 'Upaya peningkatan produksi rumput laut tidak terlepas dari permasalahan, yaitu ketersediaan bibit unggul dalam jumlah yang cukup, tahan terhadap  serangan hama dan penyakit, serta tidak dibatasi oleh musim tanam. Bibit rumput laut unggul dapat diperoleh dengan menggunakan metode seleksi klondalam suatu kawasan yang seragam. Tujuan kegiatan ini adalah untuk memproduksi bibit rumput laut Kappaphycus alvarezii yang cepat pertumbuhannya dan tahan terhadap hama dan penyakit serta kondisi lingkungan yang ekstrim. Metode penelitian yang dilakukan adalah seleksi klonyaitu melakukan seleksi terhadap populasi stok induk rumput laut yang telah dipisah menjadi rumpun dan telah dipelihara selama 30 hari dari penanaman awal.Setiap rumpun bibit yang terpilih masing-masing menjadi varietas yang akan dipisahkan/dipotong menjadi rumpun baru yang diikat pada bentangan baru dan dipelihara dengan metode dan proses yang sama dengan siklus sebelumnya,yaitu selama 30 hari.Begitu seterusnya dilakukan seleksi ke-2 dan seterusnya sampai Laju Pertumbuhan Harian (LPH) telah memperlihatkan nilai yang stabil. Hasil penelitian menunjukkan bahwa, dalam satu bentangan longline menghasilkan performasi varietas yang memiliki LPH tinggi dan stabil, yaitu Generasi 1 (G1) memiliki LPH 4,96%-5,99%; sementara bibit G2 memiliki memiliki LPH 3,77%3,93% dan bibit G3 memiliki LPH 3,92%-6,39%.Hal ini menunjukkan bahwa bibit rumput laut tersebut dapat digolongkan sebagai  Varietas Unggul  dan menjadi kandidat bibit unggul yang dikembangkan lebih lanjut.', 'seleksi klon; Kappaphyicus alvarezii; Laju Pertumbuhan Harian (LPH); bibit rumput laut unggul', 'D51'),
(52, 'media akuakultur', '5', '1', 'juni', '2010', 'HUBUNGAN ANTARA FAKTOR LINGKUNGAN DENGAN PRODUKTIVITAS TAMBAK UNTUK RUMPUT LAUT (Gracilaria verrucosa) DI PANTAI TIMUR PROVINSI SULAWESI SELATAN', 'Di pantai Timur Provinsi Sulawesi Selatan dijumpai tambak yang lebih luas dibandingkan dengan tambak di pantai Barat dan pantai Selatan. Tambak di pantai timur Sulawesi Selatan umumnya digunakan untuk budidaya rumput laut (Gracilaria verrucosa) dengan kualitas dan kuantitas produksi yang tergolong tinggi. Informasi mengenai hubungan antara faktor lingkungan tambak (kualitas tanah dan kualitas air) dengan produktivitas tambak untuk budidaya rumput laut di pantai Timur Sulawesi Selatan menjadi pokok bahasan dalam tulisan ini. Produktivitas tambak untuk rumput laut di pantai Timur Sulawesi Selatan berkisar antara 150 dan 40.909 dengan rata-rata 7.187 kg kering/ha/tahun. Produktivitas tambak untuk rumput laut yang lebih tinggi di pantai Timur Sulawesi Selatan didapatkan pada tanah dengan pHF lebih besar 6,5; pHFOX lebih besar 4,0; pHF-pHFOX kurang dari 2,5; dan SPOS kurang dari 1,00%. Kandungan Fe tanah yang melebihi 5.000 mg/L dan Al yang melebihi 490 mg/L menyebabkan penurunan produktivitas tambak untuk rumput laut. Peningkatan kandungan PO4 tanah lebih besar dari 6,0 mg/L dapat meningkatkan produktivitas tambak untuk rumput laut secara nyata. Produktivitas tambak untuk rumput laut tertinggi didapatkan pada salinitas 25,6 ppt dan oksigen terlarut 8,39 mg/L dan tumbuh baik pada kisaran pH antara 6,00 dan 9,32; suhu antara 26,00 C dan 37,86 C; fosfat lebih besar 0,1000 mg/L; dan besi kurang dari 0,1000 mg/L di pantai Timur Sulawesi Selatan.', 'faktor lingkungan; tambak; rumput laut; Sulawesi Selatan', 'D52'),
(53, 'jurnal riset akuakultur', '9', '2', 'agustus', '2014', 'PERBEDAAN MUSIM TANAM TERHADAP PERFORMA BUDIDAYA EMPAT VARIAN RUMPUT LAUT EUCHEUMATOIDS DI TELUK GERUPUK, NUSA TENGGARA BARAT', 'Musim tanam rumput laut di perairan Teluk Gerupuk dikelompokkan menjadi musim produktif dan non-produktif. Penelitian ini bertujuan untuk menganalisis perbedaan performa budidaya dari empat varian rumput laut: Kappaphycus alvarezii varian Tambalang dan Maumere, Eucheuma denticulatum, dan K. striatum yang dibudidayakan di perairan Teluk Gerupuk dengan metode long line pada musim tanam yang berbeda. Pengamatan terhadap parameter performa budidaya meliputi laju pertumbuhan harian, pertambahan biomassa, dan produksi rumput laut, yang dilakukan setiap 15 hari sekali selama masa budidaya yaitu 45 hari per siklus. Pengamatan dilakukan selama tiga siklus tanam dari bulan Juli-Desember. Analisis ragam (ANOVA) dengan rancangan acak lengkap faktorial dan uji lanjut Tukey Test dilakukan untuk mengetahui pengaruh perbedaan varian rumput laut dan periode musim tanam terhadap parameter yang diamati. Hasil penelitian menunjukkan bahwa musim tanam (produktif dan non-produktif) merupakan salah satu aspek penting yang berpengaruh nyata terhadap performa budidaya rumput laut (P<0,05). Dari keempat varian yang dibudidayakan, E. denticulatum merupakan varian yang memiliki performa terbaik yang berbeda nyata dengan ketiga varian lainnya (P<0,05), baik pada musim produktif maupun musim non-produktif. Pemilihan varian rumput laut yang tepat dengan tingkat pertumbuhan dan daya adaptasi yang lebih baik terhadap perbedaan kondisi lingkungan merupakan salah satu kunci keberhasilan dan keberlanjutan budidaya rumput laut.', 'musim tanam; pertumbuhan; rumput laut; eucheumatoids; Teluk Gerupuk', 'D53'),
(54, 'jurnal riset akuakultur', '10', '2', 'juni', '2015', 'KONDISI RUMPUT LAUT ALAM DI PERAIRAN PANTAI UJUNG GENTENG, SUKABUMI DAN LABUHANBUA, SUMBAWA: POTENSI KARBON BIRU DAN PENGEMBANGAN BUDIDAYA', 'Sumberdaya rumput laut alam yang berlimpah di perairan Indonesia merefleksikan besarnya potensi penyerapan karbon oleh rumput laut untuk mengurangi gas rumah kaca, CO2, yang merupakan salah satu faktor penyebab terjadinya fenomena perubahan iklim. Penelitian ini bertujuan untuk menganalisis potensi serapan karbon oleh rumput laut alam di kawasan pesisir Labuhanbua, Kabupaten Sumbawa, NTB dan Ujung Genteng, Kabupaten Sukabumi, Jawa Barat. Pengumpulan data lapangan berdasarkan titik-titik pengamatan yang disebar pada transek garis yang tegak lurus terhadap garis pantai; meliputi data luas tutupan, jenis, dan kandungan karbon rumput laut alam yang dominan ditemukan pada kedua lokasi penelitian. Hasil penelitian menunjukkan bahwa jenis-jenis rumput laut yang ditemukan di kawasan pantai Ujung Genteng terdiri atas 36 spesies dan di Labuhanbua 28 spesies. Berdasarkan besarnya simpanan karbon dalam bentuk biomassa pada berbagai spesies rumput laut alam di kedua lokasi penelitian, maka Sargassum sp., Padina sp., Dictyota dichotoma, Hydroclathrus clatratus, Gracilaria sp., G. foliifera, G. salicornia, Gelidium sp., dan Turbinaria sp., merupakan spesies potensial yang berperan sebagai media penyimpanan karbon biru, dan semua jenis tersebut dapat dikembangkan melalui aktivitas budidaya.', 'karbon biru; rumput laut alam; simpanan karbon; mitigasi perubahan iklim; Sumbawa; Sukabumi', 'D54'),
(55, 'prosiding FORUM INOVASI TEKNOLOGI AKUAKULTUR', '-', '-', '-', '2015', 'PEMANFAATAN RUMPUT LAUT (Gracillaria verrucosa) UNTUK MENGONTROL KUALITAS AIR PADA BUDIDAYA UDANG WINDU (P. monodon) DI TAMBAK', 'Penelitian ini bertujuan untuk mengatahui pengaruh rumput laut Gracillaria sp. terhadap mutu air tambak yang mendukung pertumbuhan dan sintasan udang windu. Penelitian dilakukan di tambak pada tahun 2013 dengan menggunakan 2 petak tambak berukuran masing-masing 10.000 m2. 1 petak ditebari udang windu dan rumput laut jenis Gracillaria verrucosa (A) dan 1 petak hanya ditebari udang windu (B). Persiapan tambak dilakukan dengan perbaikan: pematang, pintu air, pengeringan, pemasangan saringan, dan pemberantasan hama. Pencucian tambak dilakukan dengan memasukkan air sebanyak-banyak kemudian dibuang kembali dan dilakukan sebanyak tiga kali. Pengisian air untuk persiapan penebaran dilakukan dengan memasukkan air setinggi 30-60 cm dan dan dilanjutkan dengan penebaran rumput laut. Setelah 30 hari kemudian ditebari benih udang windu masing 20.000,- ekor perpetak dan dipelihara selama 120 hari. Pengukuran bobot awal dan parameter kualitas air seperti suhu, oksigen terlarut, pH, alkalinitas, BOT, amonia, nitrat, PO4-P dilakukan sebelum penebaran rumput laut dan dilanjutkan setiap 15 hari sekali. Hasil penelitian menunjukkan bahwa tambak yang ditebari rumput laut pada perlakuan A memberikan pengaruh terhadap peningkatan mutu air tambak yang berdampak pada peningkatan pertumbuhan, sintasan dan produksi pada tambak (A) dibanding dengan tambak yang tidak ditanami rumput laut (B).', 'rumput laut; udang windu; laju pertumbuhan; produksi; kualitas air; pendapatan', 'D55'),
(56, 'jurnal riset akuakultur', '10', '4', 'desember', '2015', 'HUBUNGAN SUBSTRAT DASAR PERAIRAN DENGAN KEHADIRAN RUMPUT LAUT ALAM DI PERAIRAN UJUNG GENTENG, SUKABUMI, JAWA BARAT', 'Keberadaan jenis-jenis rumput laut alam sangat terkait dengan kondisi habitat tempat tumbuhnya. Penelitian ini bertujuan untuk menganalisis hubungan distribusi jenis rumput laut alam dengan tipe substrat dasar perairan. Pengumpulan data lapangan telah dilakukan pada 146 titik pengamatan, menggunakan transek kuadrat berukuran 1 m x 1 m, yang disebar vertikal mulai dari garis pantai hingga ke arah tubir dengan jarak antar titik sekitar 50 m. Lokasi pengamatan dikelompokkan menjadi tiga kawasan berdasarkan jarak\r\ndari garis pantai dengan perbedaan karakteristik antar masing-masing kawasan tersebut, yaitu kawasan 1, 2, dan 3 dengan jarak 0-100 m, 100-300 m, dan > 300 m dari garis pantai. Hasil penelitian menunjukkan bahwa sebanyak 24 genus dari 34 spesies rumput laut yang termasuk dalam kelompok alga coklat, merah, dan hijau ditemukan pada ketiga kawasan dengan persentase total tutupan masing-masing 25,88%; 27,72%; dan 46,40%. Tutupan rumput laut tertinggi ditemukan pada kawasan 1, yang dicirikan oleh substrat pasir yang berasosiasi dengan lamun, dan diikuti oleh kawasan 2 dan 3. Hasil analisis diskriminan menunjukkan hubungan yang signifikan antara distribusi alga merah dengan tipe substrat pasir; alga coklat dengan tipe substrat batu karang, pecahan karang, dan karang hidup; sedangkan alga hijau tersebar hampir di seluruh kawasan dengan tipe substrat yang berbeda. Informasi keterkaitan substrat dan keberadaan jenis rumput laut sangat penting dalam mendukung pengembangan teknologi budidaya rumput laut.', 'tipe substrat; rumput laut; perairan Ujung Genteng; Jawa Barat', 'D56'),
(57, 'prosiding FORUM INOVASI TEKNOLOGI AKUAKULTUR', '-', '-', '-', '2013', 'PENGEMBANGAN BUDIDAYA RUMPUT LAUT UNTUK MENINGKATKAN EFISIENSI TEKNIS USAHA DI DESA ARAKAN KABUPATEN MINAHASA SELATAN', 'Penelitian sebelumnya tentang pengelolaan budidaya rumput laut di wilayah Minahasa dengan menggunakan Data Envelopment Analysis (DEA) menunjukkan bahwa budidaya rumput laut di Desa Arakan secara teknis telah relatif efisien (ER = 1). Untuk meningkatkan produksi budidaya rumput laut di Desa Arakan maka perlu adanya pengembangan lahan usaha. Tujuan penelitian yaitu diperolehnya data dan informasi tentang luas lahan yang saat ini diusahakan, serta potensi luas lahan yang layak dikembangkan. Metode yang digunakan\r\nyaitu metode survai yang berbasis sistem informasi geografis (SIG). Data yang dibutuhkan yaitu parameter kualitas air perairan dan lingkungan di lahan budidaya saat ini, dan di luar lahan budidaya rumput laut Desa Arakan. Analisis kesesuaian lahan dilakukan dengan metode pembobotan. Hasil penelitian yaitu luas lahan budidaya rumput laut saat ini sebesar 19,77 ha. Sedangkan potensi pengembangan lahan budidaya rumput laut yang layak sebesar 134,64 ha; di mana untuk kategori lahan yang sangat sesuai sebesar 68,40 ha dan yang dikategorikan sesuai sebesar 66,23 ha.', 'rumput laut;kesesuaian lahan; SIG; kualitas air; Desa Arakan', 'D57'),
(58, 'prosiding FORUM INOVASI TEKNOLOGI AKUAKULTUR', '-', '-', '-', '2014', 'POLIKULTUR UDANG WINDU (Penaeus monodon), BANDENG (Chanos chanos), NILA SRIKANDI (Oreochromis aureus x O. niloticus), DAN RUMPUT LAUT (Gracilaria verrucosa) DI TAMBAK TANAH SULFAT MASAM (TSM)', 'Polikultur adalah merupakan budi daya bersama dari berbagai spesies ikan dengan tingkat tropik yang sama, di mana organisme tersebut secara bersama-sama melakukan proses biologi dan kimia dengan beberapa keuntungan yang bersinergi dalam ekosistem. Budidaya sistem polikultur sudah lama dikenal oleh pembudidaya tradisional, namun masih terbatas pada dua komoditas polikultur yaitu udang windu dan bandeng. Polikultur udang windu, bandeng, nila srikandi dan rumput laut di tambak merupakan kegiatan uji lapang hasil litbang perikanan budidaya air payau yang bertujuan mengubah pola pikir pembudidaya tradisional dalam memanfaatkan potensi sumberdaya secara optimal sehingga dapat meningkatkan produktivitas tambak tradisional (TSM dan tanah gambut), dan memberikan nilai tambah bagi pembudidaya tambak. Kegiatan ini dilakukan di tambak pembudidaya kabupaten Luwu Timur, Sulawesi Selatan, menggunakan 4 petak tambak dengan luasan 0,7-1,3 ha (total luasan   4,0 ha), dengan komoditas dan kepadatan masing masing yaitu udang windu : 30.000 ekor/ha, bandeng 1500 ekor/ha, nila srikandi : 1500 ekor/ha, dan rumput laut 1500 kg/ha. Wakitu pemeliharaan   14 minggu. Hasil kegiatan diperoleh produksi udang windu 118-280,6 kg/ha/musim, produksi bandeng 153,8-210 kg/ha/musim, produksi nila srikandi 200-310 kg/ha/musim, dan produksi rumput laut 100-3.372 kg kering/ha. Profitabilitas polikultur udang windu, bandeng, nila srikandi, dan rumput laut di Kabupaten Luwu Timur mencapai Rp 14.373.400 ha/musim (1 tahun = 2 musim) atau Rp 28.747.600/ha/tahun, dengan R/C ratio mencapai 1,55, dengan asumsi apabila pembudidaya mengerjakan sendiri lahannya. Polikultur udang windu, bandeng, nila srikandi, dan rumput laut di kabupaten Luwu Timur dapat meningkatkan produktivitas tambak tradisional (TSM) kabupaten Luwu Timur, dan memberikan nilai tambah pembudidaya dari produksi bandeng, nila srikandi dan rumput laut.', 'polikultur, udang windu, bandeng, nila srikandi, rumput laut, TSM', 'D58'),
(59, 'jurnal penelitian perikanan indonesia', '9', '5', '-', '2003', 'PENGARUH PERLAKUAN ALKALI DANVOLUME LARUTAN PENGEKSTRAK TERHADAP MUTU KARAGINAN DARI RUMPUT LAUT Eucheuma cottonii', 'Penelitian ekstraksi rumput laul Eucheuma cottonii menjadi karaginan kertas telah dilakukan. Penelitian dilaksanakan dengan rancangan acak lengkap dengan variasi perlakuan bahan baku yaitu rumput laut yang diberi perlakukan KOH 6% dan 8% dan volume larutan pengekstrak 60 kali dan 50 kali dari bobot rumput laut kering', 'Eucheuma cottonii; physico-chemical characteristics of carrageenan', 'D59');
INSERT INTO `tbjurnal` (`Id`, `sumber`, `volume`, `nomor`, `bulan`, `tahun`, `judul`, `abstrak`, `katakunci`, `nm_dk`) VALUES
(60, 'prosiding FORUM INOVASI TEKNOLOGI AKUAKULTUR', '-', '-', '-', '2015', 'KARAKTERISASI METODE BUDIDAYA TERHADAP RESPONS PERTUMBUHAN RUMPUT LAUT Sargassum sp.', 'Sargassum sp. merupakan salah satu jenis rumput laut yang banyak digunakan sebagai bahan baku sandang, pangan, dan obat-obatan. Tujuan penelitian ini adalah untuk mengetahui karakterisasi metode budidaya terhadap respons pertumbuhan rumput laut Sargassum sp. Penelitian ini dilakukan selama10 bulan (FebruariOktober 2014) di perairan Desa Kupa Kabupaten Barru Provinsi Sulawesi Selatan. Penelitian didesain dengan rancangan acak lengkap (RAL) dengan tiga perlakuan, di mana masing-masing perlakuan diulang 10 kali pada tiap tali bentangan. Jenis rumput laut yang digunakan dalam penelitian ini adalah Sargassum sp. Untuk mendukung karakterisasi lingkungan dan mengetahui respons pertumbuhan rumput laut Sargasssum sp., maka perlu dilakukan kegiatan budidaya. Adapun metode budidaya yang diujicobakan dalam penelitian ini adalah A) metode long line; B) metode kantong; dan C) metode lepas dasar. Ukuran konstruksi budidaya Sargassum sp. yang digunakan dalam penelitian ini adalah 35 m x 10 m, di mana panjang tali bentangan 35 m dan jumlah tali bentangan dalam setiap konstruksi sebanyak 10 tali. Hasil penelitian menunjukkan bahwa perlakuan metode budidaya berpengaruh nyata (P<0,05) terhadap pertumbuhan bobot rumput laut Sargassum sp. Pertumbuhan bobot tertinggi pada perlakuan C sebesar 94,78   2,4 g dan pertumbuhan bobot terendah pada perlakuan B dan A secara berurut sebesar 36,23   6,7 g; 35,04   3,4 g.', 'karakterisasi metode budidaya; Sargassum sp.; pertumbuhan', 'D60'),
(61, 'prosiding FORUM INOVASI TEKNOLOGI AKUAKULTUR', '-', '-', '-', '2015', 'PEMBERIAN TEPUNG RUMPUT LAUT, GRACILLARIA DALAM PAKAN IKAN BERONANG, Siganus guttatus', 'Penelitian ini bertujuan untuk melihat pengaruh pemberian tepung rumput laut jenis Gracilaria dalam pakan ikan beronang. Ikan beronang termasuk jenis ikan herbivora yang dapat mengkonsumsi rumput laut yang banyak tumbuh di perairan. Gracilaria sp. adalah jenis rumput laut yang dibudidayakan oleh petani pada perairan payau. Penelitian dilakukan dalam keramba jaring apung laut dengan menggunakan jaring berukuran 1x1x2 m3. Ikan uji yang digunakan adalah ikan beronang ukuran rata-rata 20,21g  dengan padat tebar 15 ekor/jaring. Ikan uji diberi pakan uji berupa pelet kering dengan dua perlakuan pakan (A. Pakan tanpa tepung rumput laut Gracilaria dan B. Pakan dengan tepung rumput laut Gracilaria), masing-masing diulang tiga kali dan didesain dengan rancangan acak lengkap. Setelah 20 minggu pemeliharaan diperoleh hasil pemberian tepung rumput laut, Gracilaria dapat dilakukan sampai 50% dengan memberikan pertambahan bobot, laju pertumbuhan spesifik, efisiensi pakan, rasio efisiensi protein dan sintasan masingmasing sebesar 50,25g; 0,87%/hari; 35%; 0,87 dan 97,78%.', 'tepung rumput laut; substitusi; beronang; Siganus guttatus', 'D61'),
(62, 'prosiding FORUM INOVASI TEKNOLOGI AKUAKULTUR', '-', '-', '-', '2015', 'KONDISI KUALITAS AIR PADA PEMELIHARAAN KEPITING BAKAU (Scylla paramamosain) SECARA RESIRKULASI DENGAN KEPADATAN YANG BERBEDA', 'Penelitian ini bertujuan untuk mengetahui pengaruh perbedaan kepadatan kepiting bakau yang dipelihara secara resirkulasi terhadap kondisi kualitas air. Penelitian ini didesain dengan rancangan acak lengkap dengan empat perlakuan dan dua ulangan. Kepadatan kepiting yang diujicobakan yaitu kepadatan 1 ekor/ bak, 2 ekor/bak, 3 ekor/bak, dan 4 ekor/bak. Jenis filter dalam sistem resirkulasi yang diamati pada penelitian ini ada tiga yaitu: 1) filter arang + rumput laut (Gracilaria sp.), 2) rumput laut (Gracilaria sp.), 3) arang dan satu perlakuan tanpa filter sebagai kontrol. Penelitian berlangsung kurang lebih satu bulan. Pada minggu pertama digunakan filter rumput laut dan arang, minggu kedua digunakan filter rumput laut, minggu ketiga digunakan filter arang dan minggu keempat tanpa filter. Kualitas air yang diamati meliputi suhu, salinitas, pH, alkalinitas, DO, nitrit, nitrat, TAN (total amoniak nitrogen), dan fosfat. Kualitas air media yang diamati pada berbagai kepadatan kepiting bakau menunjukkan tidak berbeda nyata (P>0,05) antar kepadatan pada setiap jenis filter yang diujicobakan. Filter arang dengan volume berat yang lebih besar dari rumput laut dengan perbandingan sekitar 8:1 memiliki kemampuan yang lebih baik dalam menurunkan kadar nitrit dan TAN dibandingkan dengan menggunakan filter rumput laut. Pemeliharaan kepiting bakau secara resirkulasi pada kondisi indoor sampai dengan kepadatan 4 ekor/m2 dapat mengunakan filter arang saja dan bisa juga dikombinasikan dengan filter rumput laut dengan memperhatikan jumlah organisme yang dipelihara, volume air dan berat filter arang, dan rumput laut yang digunakan.', 'kualitas air; kepiting bakau; kepadatan; resirkulasi; jenis filter', 'D62'),
(63, 'jurnal riset akuakultur', '9', '1', 'april', '2014', 'PERBEDAAN SIKLUS TANAM BUDIDAYA RUMPUT LAUT, Kappaphycus alvarezii, TERHADAP VARIABILITAS TINGKAT SERAPAN KARBON', 'Rumput laut merupakan komoditas penting kelautan dan perikanan. Komoditas ini selain berperan untuk peningkatan ekonomi masyarakat pesisir juga mempunyai fungsi sebagai penyerap karbon. Penelitian ini telah dilaksanakan untuk menganalisis pengaruh perbedaan waktu siklus tanam terhadap tingkat serapan karbon oleh rumput laut, Kappaphycus alvarezii, terkait fluktuasi kondisi lingkungan perairan. Rumput laut dibudidayakan dengan sistem long line di Perairan Teluk Gerupuk selama tiga siklus tanam pada bulan Juli-November 2012. Pengamatan dan analisis sampel rumput laut dilakukan pada hari ke-0, 15, 30, dan 45 untuk masing-masing siklus tanam, dengan parameter yang dianalisis adalah laju serapan karbon, laju pertumbuhan harian, dan produktivitas budidaya. Pengukuran parameter kualitas air dilakukan secara in situ untuk mengetahui fluktuasi kondisi perairan Teluk Gerupuk. Data yang terkumpul dianalisis menggunakan metode statistik deskriptif dan inferensia. Hasil penelitian menunjukkan bahwa siklus tanam rumput laut yang berlangsung pada musim tanam berbeda memberikan pengaruh pada perbedaan pola serapan karbon oleh rumput laut hasil budidaya. Tingkat serapan karbon tertinggi dari tiap siklus diperoleh pada waktu yang sama yaitu pada periode awal budidaya, dengan nilai berturut-turut 33,13; 88,73; dan 18,16 ton C/ha/tahun. Budidaya yang berlangsung pada saat musim tanam produktif memberikan serapan karbon yang optimum, dan sebaliknya saat musim tanam kurang produktif serapan karbon yang dihasilkan juga minimum.', 'siklus tanam; rumput laut; Kappaphycus alvarezii; serapan karbon; Teluk Gerupuk', 'D63'),
(64, 'prosiding FORUM INOVASI TEKNOLOGI AKUAKULTUR', '-', '-', '-', '2015', 'DAMPAK PERUBAHAN USAHA PEMBUATAN GARAMAN KE BUDIDAYA RUMPUT LAUT MASYARAKAT PESISIR DI KABUPATEN MAROS DAN JENEPONTO, SULAWESI SELATAN (Studi Kasus Perubahan Usaha Penggaraman ke Budidaya Rumput Laut di Kabupaten Maros dan Jeneponto, Sulawesi Selatan)', 'Visi Kementerian Kelautan dan Perikanan pada tahun 2015 dalam mencapai target Indonesia sebagai produsen terbesar dunia, dengan menargetkan produksi rumput laut hingga 10 juta ton tahun 2014. Produksi garam Indonesia tahun 2014 sebanyak 1,4 juta ton dan impor sekitar 1,4 juta ton; meskipun produksi garam Indonesia melebihi kebutuhan dalam negeri akan tetapi impor garam tetap dilakukan, dan ini membuat harga garam rakyat turun bahkan sebagaian produksi garam rakyat tidak terjual. Keterpurukan kehidupan petani garam mendodrong mencari alternatif lain untuk berusaha. Usaha budidaya rumput laut yang berkembang dengan pesat, menarik minat petani garam untuk mencoba membudidayakan rumput laut di lokasinya, perubahan usaha ini, menjadi tujuan dari penelitian ini untuk memberikan gambaran tentang dinamika perkembangan aspek usaha, konsumsi, dan pendapatan rumah tangga. Penelitian ini menggunakan metode survai monitoring dan observasi lapang dengan responden petani garam, lokasi penelitian dilakukan di Kabupaten Maros dan Kabupaten Jeneponto, Sulawesi Selatan, jumlah responden masing-masing lokasi adalah 20 orang. Hasil penelitian menunjukkan peningkatan pendapatan dan pola konsumsi yang disetarakan dengan kebutuhan minimum rumah tangga petani garam dengan total biaya pengeluaran penggarap, pemilik di Jeneponto antara Rp 1.265.000,- Rp 2.250.000,-; sedangkan untuk Maros antara Rp 1.750.000,00Rp 3.425.000,00. Pendapatan dari usaha budidaya rumput laut per siklus antara Rp 4.361.500,- dan Rp 8.469.000,- rata-rata keuntungan per siklus Rp 3.200.635,-. Peningkatan pendapatan rata-rata setelah beralih ke rumput laut untuk Kabupaten Maros adalah Rp 613.135,- dan Jeneponto Rp 1.443.135,-. Sedangkan tingkat konsumsi dan pengeluaran yang mengalami peningkatan yaitu di Jeneponto meningkat 102,62% sedangkan di Maros meningkat sebesar 36,09%. Ini menunjukkan bahwa tingkat konsumerisme pada masyarakat petambak garam cukup tinggi.', 'dampak; usaha penggaraman; budidaya rumput laut; Kabupaten Maros; Kabupaten Jeneponto', 'D64'),
(65, 'jurnal riset akuakultur', '10', '3', 'september', '2015', 'DISTRIBUSI RUMPUT LAUT ALAM BERDASARKAN KARAKTERISTIK DASAR PERAIRAN DI KAWASAN RATAAN TERUMBU LABUHANBUA, NUSA TENGGARA BARAT: STRATEGI PENGELOLAAN UNTUK PENGEMBANGAN BUDIDAYA', 'Keberadaan rumput laut di alam sangat dipengaruhi oleh karakteristik substrat dasar perairan. Penelitian ini bertujuan untuk menganalisis distribusi dan hubungan tutupan rumput laut alam dengan komponen substrat dasar perairan di sepanjang pantai Labuhanbua, Kabupaten Sumbawa. Pengumpulan data lapangan pada 46 titik pengamatan menggunakan transek kuadrat ukuran 1 m x 1 m yang ditempatkan sepanjang transek garis yang disebar tegak lurus terhadap garis pantai dengan jarak masing-masing sekitar 50 m. Parameter yang diamati adalah: persentase tutupan dasar perairan yang terdiri atas tutupan pasir, karang hidup, pecahan karang, lumpur, batu karang, lamun, dan rumput laut (total tutupan 100%). Pengambilan sampel substrat dasar perairan juga dilakukan pada beberapa titik pengamatan untuk analisa parameter P2O5, N total, C organik total, dan tekstur substrat 3-fraksi: pasir, liat, dan debu. Analisis data dilakukan secara spasial dan statistik (analisis klaster dan deskriptif). Hasil penelitian memperlihatkan bahwa jenis Rhodophyta banyak ditemukan di kawasan dengan substrat dominan berlumpur; Chlorophyta pada substrat dengan asosiasi antara pasir, karang hidup, dan batu karang; sedangkan Phaeophyta lebih banyak ditemukan pada substrat dasar yang didominasi oleh pecahan karang. Secara keseluruhan, jenis-jenis dari kelompok Phaeophyta memiliki tutupan yang relatif jauh lebih tinggi dibandingkan Chlorophyta dan Rhodophyta. Strategi pengelolaan sumberdaya rumput laut alam dan pengembangan budidayanya dapat diimplementasikan melalui beberapa langkah penting, yaitu pengaturan pemanenan rumput laut alam, identifikasi jenis prospektif dan potensinya, pengembangan teknologi budidaya adaptif dan spesifik, serta studi kesesuaian lahan untuk pengembangan budidaya rumput laut potensial.', 'distribusi spasial; rumput laut; substrat dasar; Sumbawa', 'D65'),
(66, 'prosiding FORUM INOVASI TEKNOLOGI AKUAKULTUR', '-', '-', '-', '2013', 'PERTUMBUHAN BIBIT RUMPUT LAUT Gracilaria verrucosa DENGAN SUMBER VARIETAS BERBEDA DI KABUPATEN TAKALAR, SULAWESI SELATAN', 'Rumput laut, Gracilaria spp. yang dibudidayakan di tambak memiliki performansi talus yang berbeda. Perbedaan performansi talus diduga akan memberikan respons pertumbuhan apabilla diintroduksikan\r\npada lokasi budidaya yang berbeda. Penelitian ini bertujuan untuk mengetahui respons pertumbuhan bibit rumput laut Gracilaria verrucosa dalam tambak dengan sumber varietas berbeda di Kabupaten Takalar, Sulawesi Selatan. Penelitian ini dilaksanakan pada bulan Maret sampai dengan Mei 2011 di Desa Taipa, Kecamatan Mappakasunggu, Kabupaten Takalar, Provinsi Sulawesi Selatan. Penelitian ini menggunakan rancangan  (RAL) dengan tiga perlakuan, dan setiap perlakuan masing-masing mempunyai tiga ulangan. Ketiga perlakuan tersebut adalah A (bibit yang berasal dari Takalar), B (bibit yang berasal dari Luwu), dan C\r\n(bibit yang berasal dari Bone). Data yang diperoleh dianalisis dengan menggunakan uji t (Steel & Torrie, 1993) yang diolah dengan menggunakan program SPSS versi 15.0. Hasil penelitian memperlihatkan bahwa pertumbuhan bibit rumput laut Gracilaria verrucosa menunjukkan hasil berbeda nyata (P<0,05), di mana pertumbuhan bibit rumput laut Gracilaria verrucosa varietas Luwu lebih tinggi dibanding varietas Takalar dan Bone, hal ini dapat dilihat dari laju pertumbuhan harian (LPH) yakni Luwu 5,69%; Bone 5,05%; dan Takalar 4,57%. Bibit yang bersumber dari varietas Luwu memberikan respons pertumbuhan terbaik sehingga dapat dijadikan kandidat pengembangan bibit untuk budidaya yang produktif di tambak.', 'pertumbuhan, Gracilaria verrucosa, varietas berbeda, tambak, Takalar', 'D66'),
(67, 'prosiding FORUM INOVASI TEKNOLOGI AKUAKULTUR', '-', '-', '-', '2015', 'PENERAPAN SELEKSI VARIETAS UNTUK PRODUKSI BIBIT UNGGUL PADA KAWASAN BUDIDAYA RUMPUT LAUT Kappaphycus alvarezii DI TELUK SEREWE, LOMBOK TIMUR, NUSA TENGGARA BARAT', 'Rumput Laut Kappaphycus alvarezii merupakan salah satu komoditas perikanan yang mempunyai nilai ekonomis tinggi. Tujuan penelitian ini adalah menyajikan informasi tentang peningkatan produktivitas dan keuntungan budidaya rumput laut Kappaphycus alvarezii dengan menggunakan bibit unggul hasil seleksi varietas di Teluk Serewe, Kabupaten Lombok Timur, Nusa Tenggara Barat. Tahapan kegiatan budidaya meliputi: pemilihan lokasi, persiapan sarana, penyediaan dan pemilihan stok induk, pengikatan bibit, pemeliharaan, perawatan, dan teknis seleksi bibit berkualitas unggul. Parameter yang diamati adalah pertumbuhan rumput laut dan produksi bibit unggul hasil seleksi di setiap siklus pemeliharaan. Berdasarkan pengamatan bahwa bibit hasil seleksi memperlihatkan respons pertumbuhan pada kisaran LPH 6,9%-8,8% dengan kriteria  unggul  yaitu LPH di atas 5% dan produksi bibit unggul hasil seleksi (G-4) untuk siap diperbanyak mencapai 2.418 kg. Hasil analisis usaha menunjukkan bahwa setiap pembudidaya memiliki keuntungan sebesar Rp 9.889.702,-/tahun dan BEP dapat dicapai pada tahun pertama, artinya pada tahun berikutnya memiliki keuntungan yang cukup besar. Dengan demikian, penerapan metode seleksi varietas sangat prospektif bagi peningkatan produksi hasil panen dan produksi bibit rumput laut unggul untuk pengembangan usaha budidaya yang berkelanjutan. Untuk pencapaian sasaran kegiatan ini perlu adanya pendampingan lanjut terhadap pembudidaya oleh instansi terkait untuk terus menggalakkan pengembangan kebun bibit rumput laut yang berkualitas/unggul.', 'rumput Laut; budidaya; seleksi varietas; produksi bibit; Lombok Timur', 'D67'),
(68, 'prosiding FORUM INOVASI TEKNOLOGI AKUAKULTUR', '-', '-', '-', '2014', 'REGENERASI ANAKAN RUMPUT LAUT HASIL TRANSFORMASI GEN Metallothionin TYPE II PADA RUMPUT LAUT Kappaphycus alvarezii MENGGUNAKAN MEDIA YANG BERBEDA', 'Transformasi gen metallothionin (Mamt) type II pada rumput laut Kappaphycus alvarezii telah berhasil dilakukan melalui mediasi Agrobacterium tumefacien, diinokulasi dengan bakteri yang mengandung plasmid PlG6 yang membawa gen MaMt2 melalui seleksi bertingkat menggunakan hygromisin 10 dan 20 ppm, dengan efisiensi transformasi dalam K. alvarezii pada media seleksi I adalah 82,07%, dan pada media seleksi II adalah 84,21%, dengan efisiensi regenerasi tunas transgenik pada K. alvarezii adalah 98,43%. Evaluasi gen MaMt2 pada anakan rumput laut dilakukan melalui analisis PCR di bawah kendali promotor ubiquitin dan nos terminator. Regenerasi anakan rumput laut hasil transformasi gen MaMt2 dilakukan pada media cair yang diperkaya dengan pupuk PES, Conwy,Grund dan SSW (kontrol), pada salinitas 30 ppt, dengan pH berkisar 6-8, untuk memacu pertumbuhan tunas, media diperkaya dengan IAA dan BAP dengan perbandingan 1:1, 1:2, dan 2:1. Tujuan dari penelitian ini adalah untuk melihat potensi regenerasi anakan hasil transformasi gen MaMt2 menggunakan media yang berbeda serta keberadaan gen MaMt2 pada anakan rumput laut hasil transformasi. Hasil analisis memperlihatkan media yang paling baik digunakan adalah media PES dengan sintasan mencapai 94%, walaupun tidak berbeda dengan media Grund (82%), berbeda dengan SSW dan Conwy. pH optimal untuk regenerasi anakan rumput laut adalah pada pH 6, dan laju pertumbuhan harian yang paling tinggi pada media yang diperkaya dengan campuran IAA dan BAP dengan perbandingan 1:2. Hasil analisis PCR memperlihatkan band pada 500 kb menunjukkan keberadaan gen MaMt2 pada anakaan rumput laut hasil transformasi.', 'regenerasi; transformasi gen MaMt2; Kappaphycus alvarezii', 'D68'),
(69, 'prosiding FORUM INOVASI TEKNOLOGI AKUAKULTUR', '-', '-', '-', '2016', 'PENENTUAN BOBOT BIBIT, JARAK RUMPUN, DAN JARAK TALI BENTANGAN UNTUK OPTIMALISASI BUDIDAYA RUMPUT LAUT Sargassum duplicatum DENGAN METODE LEPAS DASAR DI PERAIRAN MANANGGU KABUPATEN BOALEMO,', 'Sargassum duplicatum merupakan salah satu jenis rumput laut penghasil alginat yang berperan di berbagai bidang industri. Rumput laut jenis ini melimpah di perairan tropis, termasuk di pantai Indonesia, namun pada bulan tertentu keberadaanya sulit ditemukan di alam. Oleh karena itu, perlu dilakukan budidaya S. duplicatum untuk kelanjutan produksinya. Penelitian ini bertujuan untuk menentukan bobot awal bibit, jarak antar rumpun bibit, dan jarak antar tali bentanganan untuk budidaya S. duplicatum dengan metode lepas dasar. Penelitian dilakukan dengan menerapkan rancangan acak lengkap melalui empat tahapan yang dilakukan secara berkesinambungan yakni (1) penentuan bobot bibit optimal; (2) penentuan jarak rumpun optimal; (3) penentuan jarak tali bentangan optimal; dan (4) penerapan bobot bibit, jarak rumpun, dan jarak tali bentangan optimal pada budidaya rumput laut S. duplicatum dengan metode lepas dasar. Parameter utama yang diamati dalam penelitian ini adalah laju pertumbuhan harian dan parameter pendukung yakni kualitas perairan. Data akan dianalisis secara statistik dengan uji varians (ANOVA) dan diuji lanjut jika terdapat pengaruh terhadap respons pertumbuhan dengan menggunakan perangkat lunak SPSS ver. 19. Hasil penelitian menunjukkan bahwa bobot awal bibit, jarak antar rumpun, dan jarak antar tali bentanganan berpengaruh nyata terhadap pertumbuhan S. duplicatum yang dibudidaya dengan metode lepas dasar. Bobot awal bibit 100 g memberikan hasil optimal dengan laju pertumbuhan harian tertinggi 1,29   0,13%/hari; jarak antar rumpun bibit 15 cm optimal dengan LPH tertinggi 0,88   0,18%/hari; dan jarak antar tali bentanganan 60 cm menunjukkan hasil optimal dengan LPH tertinggi 1,49   0,07%/hari.', 'budidaya; metode lepas dasar; Sargassum duplicatum; rumput laut', 'D69'),
(70, 'prosiding FORUM INOVASI TEKNOLOGI AKUAKULTUR', '-', '-', '-', '2014', 'FLUKTUASI OKSIGEN TERLARUT HARIAN PADA TAMBAK POLIKULTUR UDANG WINDU (Penaeus monodon), RUMPUT LAUT (Gracilaria sp.), DAN IKAN BANDENG (Chanos chanos', 'Oksigen terlarut (DO), merupakan salah satu parameter penting yang biasa digunakan untuk mengukur kualitas suatu perairan karena diperlukan oleh semua organisme untuk pernapasan. Oksigen terlarut yang rendah dapat menyebabkan kematian organisme yang dibudidayakan, oleh karena itu oksigen terlarut dalam petak tambak harus selalu dipantau agar dapat dilakukan pengelolaan air bila kondisi kualitas air tidak layak. Penelitian ini dilaksanakan di Instalasi Tambak Percobaan Marana, Balai Penelitian dan Pengembangan Budidaya Air Payau, Maros menggunakan 8 petak tambak masing-masing ukuran 2.500 m2. Tujuan dari penelitian ini adalah untuk melihat fluktuasi oksigen terlarut harian di tambak polikultur udang windu (Penaeus monodon), rumput laut (Gracillaria sp.) dan ikan bandeng (Chanos chanos). Pengamatan oksigen terlarut dilakukan pada petak tambak yang ditebari A: Udang windu + rumput laut (1 ton/ha) + Bandeng (500 ekor/ha), B: Udang windu + rumput laut (1 ton/ha) + Bandeng (1.000 ekor/ha), C: Udang windu + rumput laut (2 ton/ha) + Bandeng (500 ekor/ha) dan D: Udang windu + rumput laut (2 ton/ha) + Bandeng (1.000 ekor/ha), masing-masing dengan dua kali ulangan. Padat penebaran udang windu di tambak pembesaran adalah 2.500 ekor/petak (1 ekor/m2). Pengukuran oksigen terlarut dan suhu harian menggunakan DO meter digital dilakukan setiap 2 minggu mulai dari minggu ke-IV sampai minggu ke-XII secara insitu pada jam 08.00, 11.00, 14.00, 17.00, 20.00, 23.00, 02.00 dan jam 05.00. Data hasil pengamatan oksigen terlarut dianalisis secara deskriptif dengan bantuan grafik. Hasil penelitian menunjukkan bahwa oksigen terlarut pada perlakuan A berkisar 1,9-12 mg/L, perlakuan B berkisar 1,1-11,8 mg/L, perlakuan C berkisar 2,4-10 mg/L dan perlakuan D berkisar 2-10,6 mg/L. Kisaran tersebut masih dapat ditolerir oleh udang windu dan ikan bandeng. Oksigen terlarut yang rendah (1,1 mg/L) hanya terjadi pada minggu ke-X yaitu pada pukul 05.00 dan berlangsung tidak lama sehingga belum membahayakan udang dan ikan yang dipelihara.  Oksigen terlarut cenderung mengalami penurunan pada semua perlakuan seiring dengan bertambahnya masa pemeliharaan.', 'oksigen terlarut; polikultur; udang windu; rumput laut; ikan bandeng', 'D70'),
(71, 'jurnal riset akuakultur', '8', '3', 'desember', '2013', 'ANALISIS KESESUAIAN LAHAN BUDIDAYA RUMPUT LAUT (Kappaphycus alvarezii) DI KABUPATEN PARIGI MOUTONG PROVINSI SULAWESI TENGAH', 'Budidaya rumput laut Kappaphycus alvarezii merupakan aktivitas dominan budidaya laut di Kabupaten Parigi Moutong. Namun demikian belum ada data dan informasi mengenai kesesuaian lahan maupun sarana penunjangnya. Untuk itu dilaksanakan penelitian yang bertujuan untuk mengetahui kesesuaian lahan untuk budidaya rumput laut, serta sarana penunjangnya di Kabupaten Parigi Moutong. Metode survai diaplikasikan dalam pengambilan data terutama data primer. Model kesesuaian lahan untuk budidaya rumput laut di Kabupaten Parigi Moutong disusun berdasarkan model hirarki. Analisis kesesuaian lahan dilakukan secara spasial dengan memadukan antara SIG dan multicriteria analysis. Hasil penelitian menunjukkan bahwa secara umum, kondisi perairan pesisir Kabupaten Parigi Moutong dapat mendukung usaha budidaya rumput laut Kappaphycus alvarezii dengan metode tali panjang. Perairan pesisir Parigi Moutong dicirikan dengan kisaran pasang surut 1,38 m dan rata-rata kecepatan arus 0,11 m/detik; kecerahan 12,51 m; kedalaman 24,06 m; suhu 29,47oC; salinitas 32,95 ppt; pH 8,14; dan oksigen terlarut 6,77 mg/L. Substrat dasar perairan didominasi oleh karang yaitu 27% dari total titik pengamatan. Kondisi masyarakat di kawasan Minapolitan sangat mendukung dalam pengembangan usaha budidaya rumput laut. Dari hasil analisis dapat ditentukan bahwa sepanjang pesisir pantai layak untuk dikembangkan budidaya rumput laut dengan total luas 61.804 ha, mulai dari Kecamatan Ampibabo, Kasimbar, dan Tinombo. Lokasi yang memiliki tingkat sangat sesuai (S1) seluas 9.350 ha (15,13%), sesuai (S2) seluas 52.265 ha (84,57%), dan cukup sesuai (S3) seluas 189 ha (0,31%). ', 'kesesuaian lahan; budidaya; Kappaphycus alvarezii; Parigi Moutong', 'D71'),
(72, 'media akuakultur', '6', '1', 'desember', '2011', 'JENIS DAN DOSIS AKTIVATOR PADA PEMBUATAN KOMPOS BERBAHAN BAKU MAKROALGA', 'Kompos (pupuk organik) merupakan salah satu bahan yang dapat digunakan untuk meningkatkan kesuburan tanah karena dapat meningkatkan retensi/ketersediaan hara di dalam tanah sebagai upaya untuk memperbaiki sifat kimia, fisika, dan biologi tanah. Salah satu material organik yang dapat dijadikan sebagai bahan baku pembuatan kompos adalah makroalga dari jenis rumput laut terutama dari jenis yang kurang memiliki nilai ekonomis (fluktuasi harga) dan dari jenis yang pertumbuhannya cepat karena dapat menjadi limbah dalam perairan. Teknologi pengomposan sangat beragam, di antaranya dengan penggunaan aktivator yang bertujuan untuk mempercepat proses pengomposan. Beberapa aktivator komersil telah banyak beredar di pasaran sesuai dengan peruntukan dan keunggulannya masing-masing. Akan tetapi aktivator yang diperoleh dari bahan baku yang akan dijadikan kompos atau pupuk organik belum banyak dilakukan begitu pula mengenai dosis penggunaannya. Oleh karena itu, penelitian ini bertujuan untuk mengetahui jenis dan dosis aktivator komersil dan aktivator hasil isolasi yang sesuai dan dapat digunakan untuk pembuatan kompos berbahan baku makroalga. Sebanyak 3 jenis makroalga yang digunakan sebagai bahan baku yaitu: Sargassum sp., E. spinosum, dan Gracilaria sp., menggunakan 2 (dua) jenis aktivator yaitu aktivator hasil isolasi dari bahan baku dan EM 4 sebagai aktivator pembanding dengan 3 tingkatan dosis aktivator 104, 106, dan 108 CFU/mL. Peubah yang diamati meliputi perubahan kompos yang terjadi secara morfologi pada akhir penelitian, suhu, kadar C-organik, N-total, P, dan K. Hasil penelitian menunjukkan bahwa penggunaan Sargassum dengan aktivator hasil isolasi pada dosis 108 CFU/mL menghasilkan kompos dengan mutu yang lebih baik.', 'jenis; dosis; aktivator; kompos; makroalga', 'D72'),
(73, 'prosiding FORUM INOVASI TEKNOLOGI AKUAKULTUR', '-', '-', '-', '2009', 'PENENTUAN LUAS DAN DISTRIBUSI SPASIAL BUDIDAYA RUMPUT LAUT DIPERAIRANKABUPATENTAKALARPROVINSISULAWESISELATAN DENGANMEMANFAATKANSISTEMINFORMASIG', 'Kabupaten Takalar merupakan salah satu kabupaten di Sulawesi Selatan yang 5 tahun terakhir menjadi sentra produksi rumput laut terutama jenis Kappaphycus alvarezii atau Eucheuma cottonii. Pemanfaatan ruang pesisir termasuk untuk budidaya rumput laut di Kabupaten Takalar perlu pengaturan ruang sehingga dapat menekan konflik yang mungkin terjadi di masa mendatang. Untuk mendukung hal tersebut dibutuhkan data spasial yang menggambarkan kondisi penggunaan lahan pesisir untuk budidaya rumput laut, sehingga menjadi petunjuk penggunaan lahan lain dan memudahkan penentu kebijakan dalam mengambil langkahlangkah strategi dalam pengembangan wilayah pesisir Kabupaten Takalar. Tujuan penelitian adalah untuk menentukan luas aktual dan sebaran spasial lahan budidaya rumput laut di perairan Kabupaten Takalar\r\nProvinsi Sulawesi Selatan sebagai referensi pengelolaan dan pemanfaatan wilayah pesisir terpadu dan berkelanjutan. Penelitian dilakukan dengan metode survai di mana pada setiap hamparan budidaya rumput laut diekstrak data oseanografinya dan data spasial berupa posisi dalam format UTM. Data oseanografi yang diperoleh ditabulasi dan dianalisis secara deksriktif. Data posisi dianalisis dengan bantuan Sistem Informasi Geografis, menggunakan Sofware Arc-View 3.3. Peta dasar yang digunakan adalah peta digital\r\nskala 1:50.000 lembar 2010-54, 2010-52, 2010-24 wilayah Kabupaten Takalar. Hasil penelitian menunjukkan bahwa luas aktual areal budidaya rumput laut di perairan Kabupaten Takalar adalah sebesar 2.018 ha.', 'SistemInformasiGeografis, rumputlaut, SulawesiSelatan', 'D73'),
(74, 'prosiding FORUM INOVASI TEKNOLOGI AKUAKULTUR', '-', '-', '-', '2012', 'KOMPOSISI RAGAM BUDIDAYA MULTITROPIK KOMODITAS UDANG WINDU ( P. monodon ), NILA GIFT ( Oreochromis sp.), RUMPUT LAUT ( Gracilaria verrucosa ), DAN TIRAM BAKAU ( Crassostrea iredalei )', 'Penelitian komposisi ragam budidaya multi tropik komoditas udang windu ikan nila, kekerangan, dan rumput laut adalah suatu sistem budidaya yang menggabungkan beberapa spesies dalam satu lingkungan budidaya dengan memperhatikan pemanfaatan ruang dan nutrien dalam perairan. Penelitian ini bertujuan: (1) meningkatkan produktivitas tambak dengan pemanfaatan relung ekologi seoptimal mungkin, dan (2) untuk mengetahui komposisi organisme yang dapat dipadukan pada sistem budidaya. Penelitian dilaksanakan di Instalasi BRPBAP Marana Kabupaten Maros menggunakan 4 petak tambak berukuran 2.500 m2. Hewan uji adalah udang windu (PL-57): 12.500 ekor/petak, nila GIFT 200 ekor/hapa, rumput laut 375 kg basah/petak, dan tiram bakau 0,75 kg/m2, rak-bambu, dengan 2 komposisi ragam yaitu (A) udang windu, nila GIFT,dan rumput laut, dan (B) : udang windu, nila GIFT, rumput laut dan tiram bakau. Hasil penelitian memperlihatkan bahwa pertumbuhan, sintasan, produksi, dan RKP udang windu pada komposisi ragam B yaitu masingmasing 16,137 0,341 g; 56,83 11,158%; 114,4 20,082 kg/petak; dan 2,41 0,424 relatif tinggi, namun tidak berbeda dengan pertumbuhan, sintasan, produksi, dan RKP udang windu pada komposisi ragam A yaitu masing-masing 15,182 0,185 g; 57,11 5,501%; 108,3 8,91 kg/petak; dan 2,515 0,205. Demikian pula pertumbuhan dan sintasan nila GIFT komposisi ragam B yaitu masing-masing: 166 26,163 g dan 84,57 16,172% lebih tinggi dibanding dengan pertumbuhan dan sintasan nila GIFT pada komposisi ragam A yaitu masing-masing: 143 28,0 g dan 71,13 11,137%. Sedangkan produksi dan RKP nila GIFT lebih tinggi pada komposisi ragam B yaitu masing masing : 109,54 4,646 kg/petak dan 1,37 0,057 dan dibandingkan dengan produksi dan RKP nila GIFT pada komposisi ragam A yaitu masing-masing 81,86 29,67 kg/petak dan 1,965 0,714. Laju pertumbuhan rumput laut sangat rendah pada ke-2 komposisi ragam yaitu A (0,30%) dan B (0,40%), akibat dari penebaran pada salinitas rendah. Begitupun dengan tiram tidak dapat beradaptasi dengan salinitas yang rendah. Produksi udang windu sebagai komoditas utama pada IMTA menghasilkan 408-514,4 kg/ha dengan pendapatan petambak Rp 13.043.750,-/ha/musim atau Rp. 26.087.500/ha/tahun.', 'budidaya terintegrasi; udang windu; nila GIFT; rumput laut; tiram bakau', 'D74'),
(75, 'prosiding FORUM INOVASI TEKNOLOGI AKUAKULTUR', '-', '-', '-', '2013', 'ANALISIS KESESUAIAN LAHAN BUDIDAYA RUMPUT LAUT DI KABUPATEN MINAHASA UTARA PROVINSI SULA', 'Kabupaten Minahasa Utara, Sulawesi Utara memiliki sumberdaya lahan pesisir yang cukup potensial untuk pengembangan budidaya rumput laut, namun sampai saat ini belum dievaluasi kesesuaiannya melalui survei lokasi. Untuk itu dilaksanakan penelitian yang bertujuan untuk mengetahui karakteristik perairan\r\ndan kesesuaian lahan untuk budidaya rumput laut di Kabupaten Minahasa Utara. Data primer diperoleh dengan metode survei di lokasi penelitian yaitu kondisi oseanografi dan kualitas perairan. Data sekunder yang diperoleh berupa data iklim, data produksi rumput laut, peta Rupabumi Indonesia dijital skala 1:50.000, citra satelit ALOS, dan peta bathimetri skala 1:200.000. Penentuan stasiun pengamatan dilakukan secara acak, dan representatif berdasarkan interpretasi citra satelit ALOS. SIG dan multicriteria analysis digunakan\r\nuntuk analisis kesesuaian lahan secara spasial. Hasil survei dan evaluasi menunjukkan bahwa secara umum, kondisi perairan pesisir Kabupaten Minahasa Utara dapat mendukung usaha budidaya rumput laut dengan metode tali panjang. Berdasarkan analisis kesesuaian lahan, dari luas perairan 4.794,2 ha yang dievaluasi di Kecamatan Wori, Likupang Barat dan Likupang Timur, maka tidak ada perairan yang tergolong sangat sesuai (kelas S1), 4.226,7 ha tergolong cukup sesuai (kelas S2), dan 567,5 ha tergolong kurang sesuai (S3)\r\nuntuk budidaya rumput laut.', 'kesesuaian lahan, budidaya, rumput laut, Kabupaten Minahasa Utara', 'D75'),
(76, 'buletin teknik litkayasa akuakultur', '9', '1', 'juni', '2011', 'Teknik pengukuran tingkat serapan fosfat pada rumput laut Kappaphycus alvarezii', 'Abstrak lengkap dapat dibaca pada full. PDF\r\n\r\nRumput laut eucheuma atau  Kappaphycus alvarezii adalah rumput laut merah tropis yang bernilai ekonomis karena merupakan sumber utama kappa-karagenan.', 'Kappahycus alvarezii, tingkat serapan fosfat', 'D76'),
(77, 'prosiding FORUM INOVASI TEKNOLOGI AKUAKULTUR', '-', '-', '-', '2016', 'MUSIM TANAM PRODUKTIF RUMPUT LAUT Eucheuma denticulatum DI PERAIRAN KABUPATEN POHUWATO, GORONT', 'Perairan Kabupaten Pohuwato pernah menjadi salah satu lokasi budidaya rumput laut, namun berdasarkan keterangan masyarakat beberapa tahun terakhir ini kegiatan budidaya telah dihentikan, salah satu penyebabnya karena informasi yang sangat terbatas ditingkat pembudidaya mengenai waktu tanam yang optimal sesuai spesifikasi lokasi dan perubahan musim sehingga produktifitas lahan yang dikelola kurang optimal. Penelitian ini bertujuan untuk mendapatkan data dan informasi bagi penentuan pola musim tanam rumput laut E. denticulatum di perairan Pohuwato, Provinsi Gorontalo. Penelitian dilaksanakan selama 7 siklus tanam dari bulan Januari-Desember 2015. Metode budidaya yang diterapkan adalah metode longline, dengan konstruksi budidaya berukuran 35 m x 10 m. Pemeliharaan dilakukan 45 hari per siklus tanam. Parameter utama yang diamati adalah laju pertumbuhan harian (LPH) dan kualitas perairan di lokasi budidaya selama penelitian. Pemeliharaan juga dilakukan dengan mengamati penempelan talus, suspensi, dan biofouling. Hasil penelitian menunjukkan bahwa rumput laut E. denticulatum memiliki pertumbuhan terbaik pada siklus tanam ke-5 yakni antara bulan Agustus-September dengan nilai tertinggi laju pertumbuhan harian 4,76%.', 'Eucheuma denticulatum; Gorontalo; musim tanam', 'D77'),
(78, 'prosiding FORUM INOVASI TEKNOLOGI AKUAKULTUR', '-', '-', '-', '2013', 'DAMPAK PERUBAHAN USAHA PENGGARAMAN KE BUDIDAYA RUMPUT LAUT MASYARAKAT PESISIR: STUDI KASUS DI KABUPATEN JENEPONTO DAN MAROS, SULAWE', 'Perkembangan usaha budidaya rumput laut dalam pencapaian visi Kementrian Kelautan dan Perikananpada tahun 2015 untukmencapai target Indonesia sebagai produsen terbesar dunia, dengan targetproduksi rumput laut mencapai10 juta ton di tahun 2014. Disamping swasembada garam, dimana pengolahan\r\ngaram sudah menjadi usaha utama untuk memenuhi kebutuhan hidup rumah tangga dan memberikan kontribusi yang cukup besar terhadap pendapatan keluarga. Penelitian ini menggunakan metoda survei, monitoring dan observasi lapang dengan responden petani garam di Kabupaten Maros dan Kabupaten Jeneponto Sulawesi Selatan. Jumlah responden masing masing lokasi adalah 20 orang. Hasil penelitian menunjukkan peningkatan pendapatan dan pola konsumsi yang disetarakan dengan kebutuhan minimum rumah tangga petani garam. Usia responden berada pada katageri usia produktif, dengan rata-rata tingkat\r\npendidikan sekolah dasar. Luas lahan tambak garam rata rata kurang dari 5.000 m2 (97,5%), dan kebanyakan responden (75%) hanya sebagai penggarap. Hasil analisis usaha di Kabupaten Jeneponto pendapatan penggaraman dan total biaya pengeluaran penggarap antara Rp 1.265.000 - Rp 2.250.000, sedangkan di KabupatenMaros antara Rp 1.750.000 - Rp 3.425.000. Sedangkan penerimaan usaha garam persiklus di Kabupaten Jeneponto antara Rp.750.000 Rp.1.100.000,sedangkan di Kabupaten Maros antara Rp. 450.000- Rp. 978.000. Usaha pegaraman mengalami kerugian yang cukup besar di Kabupaten Maros sebesar Rp. 28.034.306, sedangkan di Jeneponto sebesar Rp. 3.674.960.Total biaya usaha budidaya rumput laut adalah Rp. 7.638.500,- dan Rp.6.781.000.Pendapatan dari usaha budidaya rumput laut per siklus antara Rp\r\n4.361.500-Rp 8.469.000,dengan rata-rata keuntungan persiklus Rp. 3.200.635. Peningkatan pendapatan rata-rata setelah beralih ke rumput laut untuk Kabupaten Maros adalah Rp. 613.135dan Kabupaten Jeneponto Rp. 1.443.135.Sedangkan tingkat konsumsi dan pengeluaran yang mengalami peningkatan yaitu di Jeneponto meningkat 102,62% sedangkan di Maros meningkat sebesar 36,09%. Ini menunjukkan bahwa daya beli masyarakat petambak garam cukup tinggi.', 'usaha penggaraman; budidaya rumput laut; Maros; Jeneponto', 'D78'),
(79, 'buletin teknik litkayasa akuakultur', '18', '1', 'juni', '2020', 'KADAR PROKSIMAT PADA TEPUNG Sargassum sp. TERFERMENTASI', 'Alga coklat (Sargassum sp.) merupakan rumput laut yang tersebar di hampir seluruh perairan Indonesia dan berprospek sebagai bahan baku pakan. Penggunaan Sargassum sp. sebagai bahan alternatif dalam formulasi pembuatan pakan ikan memerlukan pengujian. Tujuan dari kegiatan ini adalah untuk menentukan kadar air, abu, protein, lemak, serat kasar, dan BETN dari bahan baku rumput laut Sargassum sp. tanpa fermentasi dan difermentasi oleh kapang Aspergillus niger dan Rhizopus oligosporus. Pengamatan dilakukan di Laboratorium Kimia dan Laboratorium Basah Nutrisi dan Teknologi Pakan, BRPBATPP, Bogor. Alat yang digunakan adalah cawan petri, cawan porselin, blender, sudip, batang pengaduk, corong Buchner, pipet tetes, pipet mohr, bulp, gelas ukur, erlenmeyer, oven, tanur, desikator, labu kjeldahl, wadah alumunium, microfibre thimble, kaca arloji, neraca analitik, gegep, SoxtecTM 2055, Kjeltec 2100, TecatorTM Digestion, dan Jencons Digirate Pro, sedangkan bahan yang dipakai adalah Sargasum sp. yang telah difermentasi oleh R. oligosporus dan A. niger; petroleum benzena; kapas; H2SO4 1,25 %b/b; NaOH 5 %b/v; aseton; kertas saring Whatman no. 1; reagen selenium; NaOH 40%; HCl 0,2 N; H2SO4 teknis pekat; Indikator BCG-MM; dan aquades. Tepung rumput laut Sargassum sp difermentasi dengan kapang dan diinkubasi selama 7 hari kemudian dianalisis proksimat. Hasil pengamatan menunjukkan bahwa fermentasi menggunakan kapang A. niger dan R. oligosporus dapat memperbaiki kandungan nutrisi Sargassum sp.', 'fermentasi; Aspergillus niger; Rhizopus oligosporus; Sargassum sp.', 'D79'),
(80, 'buletin teknik litkayasa akuakultur', '9', '1', 'juni', '2011', 'Isolasi agar rumput laur Gracilaria verrucosa menggunakan ekstraksi air panas', 'Abstrak lengkap dapat dibaca pada full.PDF\r\n\r\nGracilaria verrucosa adalah salah satu jenis rumput laut yang banyak di budidayakan di Indonesia. Jenis rumput laut ini banyak dibudidayakan di tambak karena tidak membutuhkan salinitas yang terlalu tinggi.', 'Gracilaria verrucosa; isolasi; agar kertas', 'D80'),
(81, 'jurnal riset akuakultur', '9', '2', 'agustus', '2014', 'ANALISIS POLA MUSIM TANAM RUMPUT LAUT, Kappaphycus alvarezii MELALUI PENDEKATAN KESESUAIAN LAHAN DI NUSA PENIDA, BALI', 'Usaha budidaya rumput laut sangat dipengaruhi oleh lokasi dan iklim. Penyusunan pola musim tanam rumput laut yang benar dapat membantu dalam keberlanjutan usaha budidaya. Tujuan penelitian ini adalah untuk menganalisis pola musim tanam rumput laut, Kappaphycus alvarezii, berdasarkan pendekatan kesesuaian lahan pengembangan budidaya rumput laut di Nusa Penida, Bali. Data dikumpulkan pada bulan Mei dan September 2013. Kesesuaian lahan dianalisis secara spasial berdasarkan sistem informasi geografis, dengan memadukan antara faktor kualitas perairan dan sosialinfrastruktur. Hasil analisis menunjukkan bahwa bulan Mei merupakan bulan yang sesuai untuk K. alvarezii dibandingkan dengan bulan September. Kawasan Pulau Nusa Lembongan dan Nusa Ceningan merupakan kawasan yang lebih sensitif terhadap perubahan kondisi perairan. Hasil penelitian ini dapat dijadikan acuan dalam penyusunan strategi musim tanam di Nusa Penida.', 'kesesuaian lahan; rumput laut; musim tanam; analisis spasial; Nusa Penida', 'D81'),
(82, 'jurnal penelitian perikanan indonesia', '11', '7', '-', '2005', 'POLIKULTUR RUMPUT LAUI Gracillaria sp. DAN IKAN BANDENG, Chanos chanos DENGAN PADAT PENEBARAN YAN', 'Penelitian bertujuan untuk menentukan kepadatan bandeng yang optimal untuk peningkatan produksi rumput laut, Gracillaria sp. di tambak. Penelitian diawali dengan melakukan persiapan tambak sebanyak 9 petak masing-masing berukuran luas 2.500 m2. Percobaan disusun dalam Rancangan Acak Lengkap (RAL) dengan ulangan sebanyak 3 kali. Benih rumput laut ditebar sebanyak 250 kg/petak, kemudian diberi perlakuan yaitu perbedaan padat penebaran ikan bandeng sebanyak: A) = 500, B) = 1.000, dan C) = 1.500 ekor/petak.', 'seaweed; milkfish; policulture; pond', 'D82'),
(83, 'prosiding FORUM INOVASI TEKNOLOGI AKUAKULTUR', '-', '-', '-', '2015', 'ANALISIS KESESUAIAN LAHAN BUDIDAYA RUMPUT LAUT DI KABUPATEN SUMBA TIMUR PROVINSI NUSA TENGGARA', 'Kabupaten Sumba Timur memiliki potensi budidaya laut yang cukup besar untuk dapat dikembangkan melalui program minapolitan. Penelitian ini bertujuan untuk melakukan analisis kesesuaian lahan budidaya rumput laut dengan sistem lepas dasar di Kabupaten Sumba Timur, Nusa Tenggara Timur (NTT). Pengumpulan data kualitas air dilakukan pada bulan Juli 2011. Seluruh data yang dikumpulkan kemudian dianalisis secara spasial dengan sistem informasi geografis. Hasil penelitian menunjukkan bahwa kondisi perairan mendukung untuk pengembangan budidaya rumput laut. Analisis spasial kesesuaian lahan menunjukkan bahwa sekitar 10% (55 ha) dari total luasan lahan potensial (569 ha) masuk dalam kategori sangat sesuai untuk pengembangan budidaya rumput laut sistem lepas dasar. Kawasan tersebut tersebar di sekitar perairan Hadakamali, Kaliuda, dan Mburukullu. Analisis spasial yang diperoleh dari penelitian ini menunjukkan hasil yang sangat revelan dengan penetapan Kecamatan Pahunga Lodu Kabupaten Sumba Timur sebagai sentra pengembangan minapolitan. Hasil analisis ini diharapkan dapat menjadi acuan bagi pengembangan budidaya rumput laut untuk mendukung program kelautan dan perikanan di Kabupaten Sumba Timur.', 'budidaya rumput laut; kesesuaian lahan; analisis spasial; Sumba Timur', 'D83'),
(84, 'prosiding FORUM INOVASI TEKNOLOGI AKUAKULTUR', '-', '-', '-', '2014', 'ANALISIS SPASIAL DAN TEMPORAL KESESUAIAN LAHAN BUDIDAYA RUMPUT LAUT, Kappaphycus alvarezii DI TELUK GERUPUK, LOMBOK TENGAH PROVINSI NUSA TENGGARA BARAT', 'Rumput laut merupakan komoditas penting perikanan Indonesia. Dukungan data potesial lahan pengembangan budidaya rumput laut sangat penting guna mendukung perencanaan pengembangannya. Penelitian ini bertujuan untuk menganalisis secara spasial dan temporal kesesuaian lahan pengembangan budidaya rumput laut, Kappaphycus alvarezii, di Teluk Gerupuk, Lombok Tengah berdasarkan parameter fisik perairan. Pengumpulan data dilakukan pada bulan April-Desember 2013. Data yang dikumpulkan kemudian dianalisis secara spasial dengan sistem informasi geografis. Hasil pemantauan kondisi fisik perairan di Teluk Gerupuk menunjukkan bahwa perairan sangat mendukung pengembangan budidaya rumput laut. Hasil analisis spasial dan temporal kesesuian lahan dari bulan April-Desember menunjukkan adanya variasi tingkat kesesuaian lahan dengan tiga pola sebaran kesesuaian lahan yaitu pola pertama bulan April, Juni dan Desember; pola kedua bulan mei, Juli dan Agustus; dan pola ketiga bulan September-November. Hasil akhir kesesuaian lahan dengan menggabungkan seluruh bulan menunjukkan bahwa kawasan tengah teluk merupakan kawasan ideal pengembangan dengan luasan mencapai 256 ha. Kawasan pengembanagn budidaya rumput laut ini dapat dikembangkan dengan sistem monokultur ataupun terintegrasi. Model terintegrasi dengan ikan laut sangat disarankan karena dapat meningkatkan produksi dan mengurangi dampak lingkungan.', 'kesesuaian lahan; analisis spasial; Kappaphycus alvarezii; SIG; Teluk Gerupuk', 'D84'),
(85, 'jurnal penelitian perikanan indonesia', '11', '7', '-', '2005', 'FAKTOR PENGELOLAAN YANG BERPENGARUH TERHADAP PRODUKSI RUMPUT LAUT (Gracitaria verrucosa) DI TAMBAK TANAH SULFAT MASAM (STUDI KASUS DI KABUPATEN LUWU, PROVINSI SULAWEST SELATAN)', 'Studi ini dilakukan untuk mengetahui faktor pengelolaan yang mempengaruhi produksi rumput laut di tambak tanah sulfat masam. Studi diawali dengan melihat kondisi tambak secara umum\r\ndan dilanjutkan dengan pengumpulan data secara acak dan berstruktur terhadap 30 petambak rumput laut di tambak tanah sulfat masam yang berlokasi di Desa Lamasi Pantai, Kecamatan\r\nWalenrang, Kabupaten Luwu. Pengumpulan data dilakukan pada bulan April 2002 dan November 2003. Data yang diperoleh dianalisis dengan statistik deskriptif dan regresi berganda dengan\r\nprosedur eleminasi langkah mundur.', 'management; acid sulfate soils; brackishwater pond; Gracilaria verrucosa; South Sulawesi', 'D85'),
(86, 'prosiding FORUM INOVASI TEKNOLOGI AKUAKULTUR', '-', '-', '-', '2010', 'PERBANYAKAN RUMPUT LAUT (Gracilaria verrucosa) DENGAN KULTUR JARINGAN MENGGUNAKAN WADAH YANG BERBEDA', 'Perbanyakan rumput laut (Gracilaria verrucosa) dengan kultur jaringan telah dilakukan. Tetapi belum ada informasi mengenai penggunaan wadah yang berbeda dalam kultur jaringan rumput laut. Penelitian ini bertujuan untuk mengetahui pengaruh penggunaan wadah yang berbeda dalam kultur jaringan rumput laut G. verrucosa. Rumput laut dikumpulkan dari Kabupaten Brebes, Jawa Tengah. Talus rumput laut yang berukuran 1 cm disterilisasi dengan Betadine 1% dan campuran antibiotik 0,1%. Eksplan diinokulasi ke dalam medium cair yang diperkaya PES. Botol diisi eksplan dengan kepadatan 100/200 mL dan diletakkan di atas shaker, sedangkan stoples diisi eksplan dengan kepadatan 500/1.000 mL dan diberi aerasi. Medium diganti setiap minggu selama 8 minggu dan sintasan diamati setiap minggu. Pengamatan panjang tunas, jumlah tunas, dan jumlah cabang dilakukan pada akhir penelitian. Hasil penelitian menunjukkan bahwa sintasan eksplan pada stoples lebih rendah (81,70%) daripada botol (90,75%). Panjang tunas pada kedua wadah tidak berbeda jauh yaitu 2,40 mm pada stoples dan 2,42 mm pada botol. Sedangkan jumlah tunas dalam stoples (7,50) lebih banyak dibandingkan dalam botol (7,03). Jumlah cabang lebih banyak dalam stoples yaitu mencapai 26,70 dibandingkan dalam botol yang hanya 6,20.', 'Gracilaria verrucosa, kultur jaringan, wadah', 'D86'),
(87, 'buletin teknik litkayasa akuakultur', '7', '2', 'desember', '2008', 'VERIFIKASI RENDEMEN KARAGINAN DENGAN EKSTRAK PERLAKUAN ALKALI', 'Untuk mengikuti persiapan akreditasi maka laboratorium kimia lingkup Balai Besar Riset Pengolahan Produk dan Bioteknologi telah melakukan persiapan kelengkapan persyaratan seperti melakukan verifikasi metode, salah satu yang diverifikasi adalah ekstraksi rumput Laut Euchema cottonii. Verifikasi rendemen rumput laut E. cottonii dilakukan dengan perlakuan ekstrak alkali. Dari hasil verifikasi yang dilakukan ternyata diperoleh hasil simpangan sebesar 7,64% yang melebihi dari simpangan baku relatif (RSD) 5%. Dari ketidakpastian yang dapat dihitung hasil ekstraksinya ini diperoleh nilai 22,17 0,90 sehingga hasilnya kurang valid. Hal ini kemungkinan karena peralatan seperti vacum pump, oven vakum, dan yang lain, bekerjanya belum maksimal, sehingga untuk sementara analisis rendemen rumput laut E. cottonii tidak diajukan untuk di akreditasi tahun 2008.', '-', 'D87'),
(88, 'jurnal riset akuakultur', '9', '1', 'april', '2014', 'BUDIDAYA RUMPUT LAUT, Kappaphycus alvarezii SECARA TERINTEGRASI DENGAN IKAN KERAPU DI TELUK GERUPUK KABUPATEN LOMBOK TENGAH, NUSA TENGGARA BARAT', 'Budidaya ikan laut dalam keramba jaring apung menghasilkan banyak sisa pakan dan feses yang dapat meningkatkan kandungan nutrien berupa nitrogen dan fosfat perairan. Pemanfaatan nutrien tersebut dapat dilakukan melalui budidaya rumput laut di sekitar keramba ikan laut. Pengamatan pertumbuhan dan laju pertumbuhan spesifik terhadap dua varietas rumput laut (Kappaphycus alvarezii var. Maumere dan Tambalang) telah dilakukan di Teluk Gerupuk, Lombok Tengah untuk satu siklus musim tanam pada bulan September-Oktober 2013. Hasil penelitian ini menunjukkan bahwa performansi pertumbuhan rumput laut yang terintegrasi dengan keramba ikan laut sangat baik. Laju pertumbuhan spesifik terbesar ditemukan pada varian Maumere yaitu berkisar antara 4,26%-4,68%/hari dibandingkan dengan varian Tambalang yaitu berkisar antara 3,90%-4,20%/hari. Secara umum melalui sistem budidaya multi-tropik terintegrasi (IMTA) ini, peningkatan produksi rumput laut dapat mencapai 74% dibandingkan dengan sistem monokultur. Model IMTA sangat relevan dengan program ekonomi biru Kementerian Kelautan dan Perikanan dalam mendukung pengembangan perikanan budidaya yang berkelanjutan.', 'rumput laut; budidaya multi-tropik terintegrasi; nutrien; Teluk Gerupuk', 'D88'),
(89, 'prosiding FORUM INOVASI TEKNOLOGI AKUAKULTUR', '-', '-', '-', '2009', 'PERTUMBUHANBENIHBERONANG, Siganusguttatus DENGANPEMBERIAN PAKAN ALAMI YANGBERBEDA DALAMKERAMBA JARING APUNG', 'Penelitian ini bertujuan untuk mengetahui pengaruh pemberian pakan alami yang berbeda terhadap sintasan dan pertumbuhan benih ikan beronang. Penelitian ini dilaksanakan pada April-Juli 2008 di Keramba Jaring Apung, Balai Riset Perikanan Budidaya Air Payau, Dusun Lawallu Kecamatan Mangkoso Kabupaten Barru, Sulawesi Selatan. Penelitian ini dirancang dengan menggunakan rancangan acak lengkap. Ikan uji yang digunakan berasal dari hasil penetasan panti pembenihan BRPBAP Maros, dengan ukuran panjang 12,1 0,9 cm dan bobot 36,6 8,3 g. Perlakuan yang diujicobakan adalah jenis pakan yang berbeda meliputi perlakuan A. Pakan komersial (komersil); B. lumut sutra (Chaetomorfa sp.); dan C. rumput laut (Gracilaria sp.), di mana\r\nmasing-masing perlakuan diulang 3 kali. Penelitian dilakukan di Keramba Jaring Apung (KJA) dengan ukuran keramba 8 m x 8 m, sedangkan wadah penelitian yang digunakan berupa jaring terbuat dari bahan poliethylene ukuran 1 m x 1 m x 2 m dengan mesh size 0,5 cm dengan kepadatan benih 15 ekor/jaring. Pemberian pakan dilakukan 2 kali sehari (pagi pukul 08.00 dan sore pukul 16.00) dengan dosis 5% 15% dari total biomassa. Pengambilan sampel dilakukan setiap 2 (dua) minggu sekali. Data pertumbuhan dan sintasan\r\ndihitung dan diuji dengan analisis ragam dengan pola rancangan acak lengkap. Variabel yang diamati dalam penelitian ini adalah laju pertumbuhan bobot dan sintasan serta parameter kualitas air. Hasil penelitian menunjukkan bahwa perbedaan pemberian pakan alami berpengaruh nyata (P>0,05) terhadap laju\r\npertumbuhan bobot dan panjang harian dan sintasan benih ikan beronang. Laju pertumbuhan bobot dan panjang harian tertinggi didapatkan pada pemberian pakan komersil 99,2 26,7 dan 17,0 3,6 cm. Sementara pada ikan yang diberi pakan lumut sutra berturut-turut 79,7 26,5 dan 15,4 1,9 cm, dan yang diberi pakan rumput laut 78,4 5,5, dan 15,6 0,3 cm. Sintasan ikan terendah terdapat pada ikan yang diberi pakan rumput laut yaitu 68,8%', 'pakanalami, benihberonang, sintasan, danpertumbuhan', 'D89');
