(90, 'prosiding FORUM INOVASI TEKNOLOGI AKUAKULTUR', '-', '-', '-', '2009', 'PENGAMATAN KONDISI PLANKTON PADA POLIKULTUR UDANG WINDU (Penaeusmonodon) DANBANDENG(Chanoschanos) DENGAN RUMPUT LAUT (Gracilaria verrucosa) DI TAMBAK', 'Suatu penelitian yang bertujuan untuk mengetahui kondisi plankton pada polikultur udang windu (Penaeus monodon) dan ikan bandeng (Chanos chanos) dengan rumput laut (Gracilaria verrucosa) di tambak telah dilakukan.\r\nPenelitian menggunakan 6 petak tambak masing-masing ukuran 800 m2. Hewan uji yang digunakan adalah udang windu dengan bobot awal 3,3 g dan bandeng 100 g per ekor. Perlakuan yang dicobakan adalah\r\npolikultur rumput laut dengan udang windu dan bandeng, yakni perlakuan A= 240 kg rumput laut + 0,48 kg udang windu per petak, perlakuan B= 240 kg rumput laut + 10 kg bandeng per petak, dan perlakuan C= 240 kg rumput laut + 0,48 kg udang windu + 10 kg bandeng per petak. Masing-masing perlakuan\r\ndiulang dua kali. Pengamatan plankton dilakukan dengan menyaring air tambak sebanyak 100 L kemudian dipadatkan menjadi 100 mL dengan menggunakan plankton net No. 25. Analisis dan identifikasi plankton dilakukan dengan bantuan alat SRC (Sedwick Rafter Counting Cell) yang dilihat di bawah mikroskop. Hasil\r\npengamatan menunjukkan kepadatan plankton pada perlakuan A, B dan C masing-masing 455, 380, dan 390 ind./L. Jumlah genera yang diperoleh pada perlakuan A, B, dan C masing-masing 9, 7, dan 6 genera. Fitoplankton yang diperoleh diwakili oleh 3 kelas yaitu Bacillariophyceae, Dinoflagellata dan Cyanophyceae. Sedangkan zooplankton diwakili oleh Kelas Crustacea, Rotifera, Polychaeta, dan Larva Molluska. Indeks keragaman plankton yang diperoleh untuk semua perlakuan berkisar 1,477-1,664. Tingkat kesuburan plankton yang diperoleh untuk semua perlakuan adalah 0,5 (termasuk kondisi eutrofik).', 'kondisi, plankton, polikultur, tambak', 'D90'),
(91, 'buletin teknik litkayasa akuakultur', '13', '2', 'desember', '2015', 'BUDIDAYA RUMPUT LAUT Sargassum sp. MENGGUNAKAN METODE LEPAS DASAR DENGAN JARAK TANAM YANG BERBEDA', 'Rumput laut Sargassum sp. sebagai bahan baku industri alginat dan pangsa pasar terbesar khususnya datang dari Cina, yaitu sebesar 200 ton/bulan. Permintaan pasar tersebut sampai sekarang belum dapat dipenuhi mengingat produksinya saat ini masih bergantung dari alam. Produksi yang bisa dihasilkan selama ini baru sekitar 25 ton per bulan. Teknik budidaya ini bertujuan untuk mengetahui jarak tanam yang optimal pada pertumbuhan Sargassum sp. Teknik budidaya ini menggunakan lima perlakuan dengan dua kali ulangan pada masing-masing perlakuan. Lima perlakuan jarak tanam yang digunakan yaitu 30 cm, 45 cm, 75 cm, 90 cm, dan 120 cm dengan bobot bibit awal 100 g/rumpun. Hasil budidaya rumput laut Sargassum sp. menggunakan metode lepas dasar dengan jarak tanam yang berbeda menunjukkan bahwa perlakuan jarak tanam berpengaruh terhadap pertumbuhan mutlak dan laju pertumbuhan harian rumput laut Sargassum sp. Pertumbuhan mutlak tertinggi pada jarak tanam 120 cm yaitu 362,50   13,44 g, dan laju pertumbuhan harian tertinggi pada jarak tanam 120 cm yaitu berkisar antara 2,27% 2,87%.', 'Sargassum sp.; jarak tanam; pertumbuhan', 'D91'),
(92, 'media akuakultur', '9', '1', 'juni', '2014', 'PENGEMBANGAN BIBIT RUMPUT LAUT Gracilaria sp. HASIL KULTUR JARINGAN', 'Abstrak lengkap dapat dilihat pada Full PDF Ketersediaan bibit rumput laut untuk menunjang kegiatan budidaya yang berkelanjutan merupakan hal yang tidak dapat diabaikan. Dengan kultur jaringan, penyediaan bibit rumput laut unggul untuk kegiatan budidaya diharapkan dapat dilakukan secara kontinu. Balai Penelitian dan Pengembangan Budidaya Air Payau (BBPBAP) Maros telah mengembangkan bibit rumput laut hasil kultur jaringan. Penelitian ini bertujuan untuk memberikan informasi mengenai potensi pengembangan bibit rumput laut hasil kultur jaringan sehingga dapat digunakan dalam kegiatan budidaya.', 'kultur jaringan; Gracilaria sp.; bibit rumput laut; budidaya', 'D92'),
(93, 'jurnal riset akuakultur', '7', '1', 'april', '2012', 'PEMETAAN KELAYAKAN LAHAN BUDIDAYA RUMPUT LAUT (Kappaphycus alvarezii)DI KABUPATEN BINTAN PROVINSI KEPULAUAN RIAU DENGAN PENDEKATAN SISTEM INFORMASI GEOGRAFIS DAN PENGINDERAAN JAUH', 'Rumput laut merupakan komoditas unggulan ekspor perikanan budidaya di Indonesia. Untuk mempertahankan ataupun meningkatkan produksinya dapat dilakukan melalui perluasan areal budidaya. Pemilihan lokasi yang sesuai merupakan tahapan awal untuk mendukung keberhasilan usaha budidaya rumput laut. Penelitian ini bertujuan untuk melakukan analisis kelayakan lahan untuk budidaya rumput laut dengan metode apung di kawasan minapolitan Kabupaten Bintan. Data kualitas perairan telah dikumpulkan saat survai lapangan bulan Juli 2010. ALOS AVNIR-2 digunakan untuk mengekstrak data sosial infrastruktur. Data kualitas perairan dan sosial infrastruktur kemudian dianalisis secara spasial dengan sistem informasi geografis dan multi criteria analysis. Hasil analisis spasial menunjukkan bahwa dari total potensial pengembangan (904 km2), sekitar 13% tergolong sangat layak untuk pengembangan budidaya rumput laut. Lokasi dengan kategori sangat layak terkonsentrasi di Pulau Mantang, Telang Kecil, Gin Besar, Numbing, Gin Kecil, Buton, Poto, dan Kelong. Hasil penelitian ini sangat relevan dengan penetapan Kabupaten Bintan, meliputi: Kecamatan Bintan Timur, Mantang, dan Bintan Pesisir, sebagai kawasan sentra pengembangan minapolitan.', 'budidaya rumput laut; pemilihan lokasi; SIG; penginderaan jauh; Bintan', 'D93'),
(94, 'jurnal riset akuakultur', '9', '1', 'april', '2014', 'ANALISIS KUALITAS RUMPUT LAUT Gracilaria gigas YANG DIBUDIDAYA PADA HABITAT LAUT DAN TAMBAK, NUSA TENGGARA BARAT', 'Gracilaria gigas merupakan tumbuhan tingkat rendah yang berasal dari laut dan\r\numumnya dibudidaya di tambak. Pengembangan budidaya rumput laut di tambak bertujuan memperluas kawasan produksi dengan produktivitas yang tinggi, kualitas rumput laut dan agar yang berbeda dengan di laut. Budidaya Gracilaria gigas di tambak dilakukan di Sekotong, Lombok Barat, Nusa Tenggara Barat dengan menggunakan metode broadcast dengan luas area budidaya 1.500 m2. Sedangkan budidaya di laut dilakukan di Teluk Gerupuk, Lombok Tengah dengan metode long line dengan luas area budidaya 1.250 m2. Parameter yang diukur meliputi performa dan kualitas rumput laut, serta kualitas air. Parameter kualitas air yang diukur adalah: suhu, salinitas, pH, NO3-N, NO2-N, NH3-N, PO4-P, dan kecerahan yang diambil pada hari ke-0, 10, 20, dan 30. Rata-rata produktivitas Gracilaria gigas di laut lebih tinggi 12,72% daripada di tambak. Sebaliknya rendemen agar dan kekuatan gel Gracilaria gigas hasil budidaya di tambak hampir tiga kali lipat lebih tinggi daripada di laut dan berkorelasi positif\r\ndengan kandungan N perairan dan indeks percabangan. Kualitas rumput laut berhubungan erat dengan suhu, DO, PO4-P, dan NH3-N terlarut dalam air. Tingginya rendemen agar dan kekuatan gel di tambak disebabkan oleh banyaknya kandungan nutrien dan unsur hara, sedangkan tingginya produktivitas hasil budidaya Gracilaria gigas di laut disebabkan oleh adanya respons struktural dan tekanan turgor pada rumput laut.', 'budidaya; kualitas; produktivitas; Gracilaria gigas', 'D94'),
(95, 'jurnal riset akuakultur', '8', '2', 'agustus', '2013', 'PENYERAPAN KARBON PADA BUDIDAYA RUMPUT LAUT Kappaphycus alvarezii dan Gracilaria gigas DI PERAIRAN TELUK GERUPUK, LOMBOK TENGAH, NUSA TENGGARA BARAT', 'Pengikatan karbon oleh algae fotoautotrofik berpotensi untuk mengurangi pelepasan CO2 ke atmosfer dan dapat membantu mencegah percepatan terjadinya pemanasan global. Penelitian ini bertujuan untuk menganalisis tingkat penyerapan karbon pada budidaya rumput laut Kappaphycus alvarezii dan Gracilaria gigas berdasarkan aktivitas fotosintesis serta variabel-variabel yang mempengaruhinya. Budidaya rumput laut dilakukan dengan metode long-line di perairan Teluk Gerupuk, Lombok Tengah pada satu unit long-line dengan luas area 1.250 m2. Selama penelitian, dilakukan pengujian terhadap sampel rumput laut dan sampel air laut dari lokasi budidaya yang diambil pada hari ke-0, 10, 20, 30, dan 45 pemeliharaan. Laju penyerapan karbon total berdasarkan biomassa panen pada G. gigas hampir 300% lebih tinggi dibandingkan K. alvarezii. Selain itu, laju pertumbuhan dan produksi karbohidrat pada G. gigas juga lebih tinggi, yang mengindikasikan laju fotosintesis yang lebih tinggi, dan didukung oleh indeks percabangan yang juga lebih tinggi. Potensi penyerapan karbon di perairan Teluk Gerupuk mencapai 6.656,51 ton C/tahun untuk budidaya K. Alvarezii dan 19.339,02 ton C/tahun untuk budidaya G. gigas. Penyerapan karbon berhubungan dengan kandungan pigmen dan laju pertumbuhan rumput laut, serta konsentrasi CO2 dan kecerahan perairan.', 'penyerapan karbon; budidaya rumput laut; Kappaphycus alvarezii; Gracilaria gigas; Teluk Gerupuk', 'D95'),
(96, 'jurnal riset akuakultur', '8', '2', 'agustus', '2013', 'INTRODUKSI GEN Sitrat Sintase KE DALAM RUMPUT LAUT Kappaphycus alvarezii MENGGUNAKAN Agrobacterium tumefaciens', 'Kappaphycus alvarezii merupakan salah satu rumput laut merah yang bernilai\r\nekonomis penting. Ice-ice merupakan penyakit yang paling umum menyerang rumput laut dan menyebabkan menurunnya produksi rumput laut. Penyakit ini disebabkan oleh perubahan salinitas, suhu, dan pencemaran logam berat. Asam sitrat digunakan sebagai pengkelat logam berat. Introduksi gen sitrat sintase ke dalam genom tanaman diketahui dapat mengurangi cekaman oksidatif. Penelitian ini bertujuan untuk mengintroduksi gen sitrat sintase ke dalam genom K. alvarezii menggunakan perantara Agrobacterium tumefaciens. Berdasarkan eksplan yang tahan pada media seleksi higromisin, efisiensi transformasi pada K. alvarezii sebesar 7,5%. Efisiensi regenerasi tunas transgenik putatif sebesar 100%, efisiensi tunas non transgenik sebesar 100%. Analisis molekular menggunakan teknik PCR, satu dari lima K. alvarezii transgenik putatif mengandung transgen PaCS di bawah kendali promoter 35S CaMV.', 'Kappaphycus alvarezii; rumput laut; gen PaCs; transformasi', 'D96'),
(97, 'prosiding FORUM INOVASI TEKNOLOGI AKUAKULTUR', '-', '-', '-', '2014', 'ANALISIS KUALITAS AIR YANG BERPENGARUH TERHADAP PERTUMBUHAN RUMPUT LAUT Gracilaria verrucosa HASIL KULTUR JARINGAN DI TAMBAK', 'Kultur jaringan rumput laut Gracillaria verucosa telah diaklimatisasi di tambak dan ternyata dapat tumbuh baik. Untuk itu dilakukan  penelitian pertumbuhan rumput laut hasil kultur jaringan di tambak Takalar, Bone dan Pangkep dengan metode long-line dan sebar dalam hapa sebagai uji multi lokasi. Penelitian bertujuan untuk mengetahui faktor lingkungan kualitas air yang paling berpengaruh terhadap pertumbuhan bibit rumput laut hasil kultur jaringan di tambak. Peubah tidak bebas adalah laju pertumbuhan harian dan peubah bebas adalah factor kualitas air yang terdiri dari 5 peubah. Analisis regresi berganda digunakan untuk meprediksi laju pertumbuhan harian. Hasil penelitian menunjukkan bahwa laju pertumbuhan harian di tambak Takalar dipengaruhi oleh kandungan Nitrat dengan nilai R2 80,4%, di Pangkep dipengaruhi oleh Posfat dan Nitrat dengan R2 65,6% dan di Bone dipengaruhi oleh kadar Amoniak dengan nilai R2 99,6%.', 'kualitas air; kultur jaringan; rumput laut; Gracilaria verrucosa', 'D97'),
(98, 'jurnal riset akuakultur', '8', '1', 'april', '2013', 'APLIKASI ANALISIS SPASIAL DAN STATISTIK MULTIVARIAT TERHADAP KONDISI KUALITAS PERAIRAN DI SELAT ALAS, KABUPATEN SUMBAWA, NUSA TENGGARA TIMUR: ASPEK PENTING UNTUK PENGEMBANGAN BUDIDAYA RUMPUT LAUT', 'Untuk mendukung pengembangan budidaya rumput laut, pemantauan kualitas perairan secara berkala dan berkelanjutan merupakan satu syarat penting. Analisis spasial dan statistik multivariat telah digunakan dalam penelitian ini untuk mengkaji kondisi kualitas perairan di Selat Alas Kabupaten Sumbawa. Parameter penting kualitas perairan meliputi fisik, kimia, dan biologi perairan telah dikumpulkan dari 32 stasiun. Stasiun pengamatan disebar secara acak sederhana sehingga dapat mewakili lokasi yang disurvai. Hasil analisis menunjukkan bahwa kondisi kualitas perairan masih dalam kategori ideal untuk pengembangan budidaya rumput laut. Analisis statistik multivariat dengan analisis klaster telah membagi kawasan penelitian di Selat Alas menjadi dua kelompok yang berbeda yaitu klaster 1 dan klaster 2. Klaster 1 merupakan kawasan yang cukup terbuka dan relatif kurang subur. Sedangkan klaster 2 merupakan kawasan yang cukup terlindung dan relatif subur. Klaster 2 ini sangat ideal dimanfaatkan untuk pengembangan budidaya rumput laut. Dengan pendekatan spasial dan analisis klaster ini dapat digunakan untuk merancang pengambilan titik pengamatan di masa yang akan datang sehingga lebih efektif dan efisien.', 'kualitas air; budidaya rumput laut; analisis spasial; Selat Alas; Sumbawa', 'D98'),
(99, 'jurnal segara', '14', '1', 'april', '2018', 'ANALISIS KESESUAIAN DAN DAYA DUKUNG PERAIRAN UNTUK PENGEMBANGAN BUDIDAYA RUMPUT LAUT DI KABUPATEN SIMEULUE, ACEH', 'Rumput laut merupakan salah satu primadona produksi perikanan budi daya di Indonesia. Ektensifikasi lokasi budi daya rumput laut telah menyebar sampai ke pulau-pulau terdepan Indonesia. Perluasan kawasan ini harus didukung oleh ketersediaan data dan informasi yang akurat tentang kesesuaian perairan lokasi budi daya. Penelitian ini bertujuan untuk melakukan analisis spasial kesesuaian dan daya dukung perairan untuk pengembangan budi daya rumput laut di Kabupaten Simeulue, Aceh. Penelitian dilaksanakan pada Agustus 2015, dan berlokasi di tiga teluk besar yaitu Teluk Sibigo, Teluk Dalam, dan Teluk Sinabang. Analisis spasial kesesuaian lahan dilakukan dengan sistem informasi geografis berdasarkan multi criteria evaluation dengan menggabungkan tiga submodel yaitu fisik dan geografi, kualitas air, dan sosial infrastruktur. Daya dukung kawasan dihitung dengan pendekatan kapasitas unit budi daya di perairan tersebut. Hasil analisis menunjukkan bahwa ketiga teluk memiliki potensi pengembangan dengan luasan yang bervariasi: 159 ha (Teluk Sibigo), 808 ha (Teluk Dalam), dan 684 ha (Teluk Sinabang). Perhitungan daya dukung menunjukkan bahwa Teluk Dalam mempunyai kapasitas yang terluas yaitu 494,7 ha. Pemanfaatan kawasan secara maksimal dapat mencapai produksi berkisar antara 723-3030 ton/siklus tanam. Kesesuaian lahan (zonasi) dan daya dukung perairan yang dihasilkan dalam penelitian ini dapat dijadikan landasan penting mendukung penerapan budi daya perikanan yang berbasis ekosistem', 'Analisis spasial, rumput laut, kesesuaian perairan, daya dukung, Kabupaten Simeulue', 'D99'),
(100, 'prosiding FORUM INOVASI TEKNOLOGI AKUAKULTUR', '-', '-', '-', '2015', 'PERTUMBUHAN KULTUR TALUS DAN AKLIMATISASI RUMPUT LAUT Gracilaria gigas', 'Gracilaria gigas adalah salah satu jenis rumput laut agarophyta yang berpotensi untuk dibudidayakan. Perbanyakan bibit rumput laut berkualitas baik dapat diupayakan dengan melakukan kultur dengan pengayaan media dan dilanjutkan dengan tahap aklimatisasi. Tujuan penelitian ini adalah mengevaluasi pertumbuhan rumput laut G. gigas selama tahap kultur dan aklimatisasi. Eksplan G. gigas berukuran   1 cm dikultur dalam media 2 L air laut yang diperkaya dengan Provasoli s Enriched Solution (PES) 20 mL/L. Perlakuan kepadatan eksplan yang diberikan adalah 1.000, 1.500, dan 2.000 eksplan per wadah. Kultur dipelihara selama delapan minggu. Setiap minggu dilakukan pengamatan sintasan dan penggantian media. Selanjutnya tahap aklimatisasi dilakukan secara outdoor dan indoor selama enam minggu. Hasil penelitian menunjukkan bahwa sintasan eksplan setelah delapan minggu kultur adalah > 95% pada semua perlakuan. Selama enam minggu aklimatisasi, LPH tunas, jumlah tunas, dan panjang tunas aklimatisasi outdoor lebih tinggi berturutturut 54,24%; 7,56%; dan 71,59% dibandingkan dengan indoor.', 'kultur; aklimatisasi; Gracilaria gigas', 'D100'),
(101, 'media akuakultur', '3', '2', 'desember', '2008', 'POTENSI DAN PROSPEK SERTA PERMASALAHAN PENGEMBANGAN BUDIDAYA RUMPUT LAUT DI PROVINSI SULAWESI SELATAN', 'Provinsi Sulawesi Selatan cukup strategis, menyebabkan pembangunan perikanannya berkembang pesat termasuk di sektor budidaya rumput laut. Menonjolnya budidaya rumput laut di daerah ini disebabkan selain tempatnya yang strategis juga didukung oleh fasilitas budidaya yang cukup memadai seperti tersedianya lahan untuk budidaya Eucheuma sp. sekitar 193.700 ha dan untuk budidaya Gracilaria sp. di tambak tersedia lahan sekitar 50.201 ha. Di Sulawesi Selatan budidaya Gracilaria sp. di tambak dan Euchema sp. di laut telah berkembang yang cukup pesat. Di Sulawesi Selatan kedua jenis rumput laut ini telah dinobatkan sebagai komoditas unggulan. Produksi rumput laut di Sulawesi Selatan pada tahun 2006 yaitu jenis Gracilaria sp. sebesar 15.144,8 ton dengan nilai sebesar Rp213.946,6,00 dan jenis Eucheuma sp. sebesar 403.201 ton dengan nilai sebesar Rp604.801.500.000,00. Sistem budidaya Gracilaria sp. di tambak dilakukan dengan pola budidaya polikultur dengan bandeng dan udang windu, sedangkan sistem budidaya Eucheuma sp. di laut dilakukan dengan sistem rakit apung. Lama pemeliharaan Gracilaria sp. di tambak 45--60 hari/siklus, sedangkan Eucheuma sp. di laut sekitar 45 hari/siklus, sehingga panen dapat dilakukan enam kali per tahun. Produksi Gracilaria sp. basah di tambak sekitar 7--12 ton/ha/siklus atau setara sekitar 700--1.200 kg Gracilaria sp. kering. Sedangkan produksi Eucheuma sp. basah hasil budidaya di laut sekitar 8--10 ton/unit rakit apung/siklus, atau setara dengan 800--1.000 kg Eucheuma sp. kering.', 'potensi; prospek; budidaya; Gracilaria sp.; Eucheuma sp.', 'D101'),
(102, 'jurnal sosial ekonomi kelautan dan perikanan', '9', '1', 'juni', '2014', 'ETOS KERJA PEREMPUAN DI SEKTOR PERIKANAN PADA KAWASAN MASTERPLAN PERCEPATAN DAN PERLUASAN PEMBANGUNAN EKONOMI INDONESIA (MP3EI) DAN STRATEGI PEMBERDAYAAN DAN PENGEMBANGAN EKONOMI (Studi Kasus Perempuan Pembudidaya Rumput Laut di Nusa Penida, Bali)', 'Tulisan ini bertujuan untuk menggambarkan etos kerja perempuan pembudidaya rumput laut di Nusa Penida dan dikaitkan dengan strategi pemberdayaan dan pengembangan ekonomi dalam konsep Masterplan Percepatan dan Perluasan Pembangunan Ekonomi Indonesia (MP3EI). Penelitian dilakukan pada tahun 2013 dengan fokus pada kawasan minapolitan Nusa Penida di 3 (tiga) gugusan pulau: Nusa Besar atau Nusa Penida, Nusa Lembongan, dan Nusa Ceningan. Metode penelitian menggunakan pendekatan kualitatif. Teknik pengumpulan data wawancara mendalam (depth interview) dan pengamatan (observasi). Analisis data menggunakan deskriptif eksplanatoris dimana data-data yang dikumpulkan digambarkan secara rinci kemudian digunakan untuk menjelaskan strategi pemberdayaan dan pengembangan ekonomi yang ada. Hasil penelitian menunjukkan bahwa perempuan pembudidaya rumput laut di Nusa Penida memiliki etos kerja yang tinggi, rajin, memiliki kesungguhan serta kemauan bekerja keras membantu suami dalam mencari nafkah. Pandangan perempuan pembudidaya rumput laut di Nusa Penida tentang pekerjaan yaitu bahwa tidak ada pekerjaan yang berat, sudah ada pembagian kerja dan saling membantu antara laki-laki dengan perempuan sesuai dengan keyakinan yang mereka anut. Strategi pemberdayaan dan pengembangan perempuan pembudidaya rumput laut dalam mendukung percepatan dan perluasan pembangunan ekonomi yaitu dengan membuat kebijakan\r\nyang memihak melalui pengakuan peran dan partisipasi mereka serta melakukan pendampingan dan pelatihan-pelatihan yang sesuai dengan kebutuhan mereka.', 'etos kerja; strategi pemberdayaan; pengembangan ekonomi; MP3EI', 'D102'),
(103, 'media akuakultur', '3', '2', 'desember', '2008', 'POLIKULTUR RAJUNGAN (Portunus pelagicus), UDANG VANAME (Litopenaeus vannamei ), IKAN BANDENG (Chanos chanos), DAN RUMPUT LAUT (Gracilaria sp.) DI TAMBAK', 'Tujuan penelitian ini adalah untuk mendapatkan data dan informasi tentang sintasan dan produksi rajungan, udang vaname, ikan bandeng, dan rumput laut yang dipelihara secara polikultur di tambak. Penelitian ini dilaksanakan di Instalasi Tambak Percobaan Balai Riset Perikanan Budidaya Air Payau, Marana-Maros selama 105 hari. Tambak yang digunakan berukuran 25 m x 10 m/250 m2 dengan kedalaman 100 cm. Rajungan yang ditebar berukuran bobot 0,05 g sebanyak 500 ind., udang vaname dengan bobot 0,009 g sebanyak 1.000 ind., ikan bandeng berbobot 25 g sebanyak 50 ind., sedangkan rumput laut sebanyak 25 kg. Selama pemeliharaan diberikan pakan ikan rucah (Clupea sp.) dengan dosis 15% dari total biomass per hari. Sampling dilakukan pada awal dan akhir percobaan. Data yang diperoleh dibahas secara deskriptif. Hasil pengamatan menunjukkan bahwa sintasan dan produksi rajungan masing-masing adalah 32,6% (18 kg), udang vaname 70% (10 kg), ikan bandeng 100% (30 kg), dan rumput laut 125% (36,25 kg).', 'polikultur; rajungan; udang vaname; ikan bandeng; rumput laut; tambak; pertumbuhan; sintasan; produksi', 'D103'),
(104, 'buletin teknik litkayasa akuakultur', '8', '2', 'desember', '2009', 'PENGAMATAN KANDUNGAN NITRAT DI SEKITAR PERAIRAN LAHAN BUDIDAYA RUMPUT LAUT (Kappaphycus alvarezii) DI TONYAMAN, POLEWALI, SULAWESI BARAT', 'Pengamatan kandungan nitrat di perairan Tonyaman, Polewali, Sulawesi Barat bertujuan untuk mengetahui ketersediaan kandungan nitrat dalam menunjang budidaya rumput laut. Pengamatan kandungan nitrat di perairan dilakukan setiap 15 hari selama 75 hari pemeliharaan rumput laut analisis kandungan nitrat menggunakan metode reduksi kadmium. Hasil analisis menunjukkan bahwa kandungan nitrat tertinggi diperoleh pada hari ke-15 (0,3748 mg/L) dan terendah pada hari ke-30 (0,0120 mg/L). Kandungan nitrat selama penelitian masih dalam kondisi yang masih layak untuk pertumbuhan rumput laut.', 'nitrat, rumput laut, pertumbuhan', 'D104'),
(105, 'prosiding FORUM INOVASI TEKNOLOGI AKUAKULTUR', '-', '-', '-', '2010', 'PERBAIKAN MUTU GENETIKA RUMPUT LAUT Kappaphycus alvarezii MELALUI HIBRIDISASI DAN FUSI PROTOPLAS SECARA IN VITRO', 'Upaya perbaikan mutu genetika rumput laut dilakukan dalam rangka menunjang program pemerintah untuk meningkatkan kualitas dan produksi rumput laut pada umumnya. Hibridisasi merupakan salah satu cara yang dapat digunakan untuk menggabungkan dua varietas rumput laut yang berbeda dapat dilakukan melalui fusi protoplas. Isolasi protoplas dilakukan dengan cara kimia yaitu dengan melisis jaringan rumput laut dengan campuran enzim selulase dan macerozym dengan perbandingan 2:1. Larutan pencuci dan media kultur yang digunakan yaitu media conwy yang diperkaya dengan senyawa kalsium, zat perangsang tumbuh dan sumber karbon yang berbeda. Fusi protoplas dilakukan dengan cara kimia yaitu melalui mediasi dengan PEG 6000 dalton yang dipelihara pada media kultur cair dan semi solid. Fusan yang diperoleh memperlihatkan pertumbuhan yang optimum pada media yang diperkaya dengan IAA dengan konsentrasi 0,4 mg/L, dengan perbandingan penetrasi cahaya L:D = 12:12', 'mutu genetik, Kappaphycus alvarezii, hibridisasi, fusi protoplas', 'D105'),
(106, 'jurnal kelautan nasional', '14', '1', 'april', '2019', 'Analisis Karakteristik Dimensi Ekologi Pulau-Pulau Kecil Kabupaten Nunukan, Kalimantan Utara', 'Sebagai salah satu pulau terluar Nunukan termasuk dalam jalur Alur Laut Kepulauan Indonesia (ALKI), terletak pada wilayah Segi Tiga Karang (Coral Triangle) serta wilayah perairan yang dilewati jalur Arus Lintas Indonesia (Arlindo). Berdasarkan potensi-potensi yang ada, serta berdasarkan PP No 62 tahun 2010, maka perlu diakukan kajian mengenai kerakteristik dimensi ekologi yang menyangkut Hidro-oseanografi, Aspek tata guna lahan menyangkut karakteristik Kualitas Air serta ekosistem utama. Metode yang digunakan dalam penelitian ini adalah dengan melakukan pengukuran in situ dan analisis laboratorium.. Secara umum parameter yang terukur di perairan Pulau Nunukan masih dalam kondisi baik, hanya terlihat nilai suhu 27-30 oC dan kekeruhan rata-rata 32,08   26,49 ntu yang berada di luar ambang batas baku yang ditetapkan pemerintah. Hasil analisis karakteristik dimensi ekologi menyimpulkan perairan nunukan sangat cocok untuk area budidaya rumput laut khusus untuk jenis Eucheuma sp. Sebaran indeks vegetasi pada tahun 2016 menunjukkan data kepadatan vegetasi mangrove yang sangat rendah.', 'Dimensi ekologi; pulau-pulau kecil; nunukan; budi daya rumput laut; euchema sp', 'D106'),
(107, 'prosiding FORUM INOVASI TEKNOLOGI AKUAKULTUR', '-', '-', '-', '2012', 'UJI ALAT FILTRASI EKSTRAK RUMPUT LAUT PADA PEMBUATAN REFINED CARRAGEENAN', 'Rancang bangun dan ujicoba alat filtrasi ekstrak rumput laut Eucheuma cottonii telah dilakukan untuk mendapatkan peralatan sederhana dalam pengolahan refined carrageenan. Prinsip kerja alat filtrasi yang dirancang yaitu dengan sistem penyaringan bertingkat menggunakan pompa vakum untuk menghisap ekstrak rumput laut melalui membran berukuran 100 dan 200 mesh, dengan tekanan vakum hingga 70 cmHg. Bahan baku yang digunakan adalah alkali treated cottonii (ATC) yang ekstraksi dalam larutan air dengan rasio 1:40 (w/v). Hasil pengukuran kecepatan penyaringan (flow-rate) pada penyaringan filtrat menggunakan membran 100 dan 200 mesh yaitu 455 dan 302 L/jam. Filtrat ekstrak rumput laut yang didapatkan kemudian dipresipitasi dalam larutan KCl 1,5% dan dikeringkan di bawah matahari. Hasil uji mutu karaginan yang dihasilkan didapatkan gel strength sebesar 1.134 g/cm2; water gel strength sebesar 946 g/cm2; kadar air 14,38%; kadar abu 28,94%; kadar abu tak larut asam 0,76%; dan nilai kekentalan sebesar 24 cPs.', 'filtrasi; tekanan vakum; ekstrak rumput laut; refined carragenaan', 'D107'),
(108, 'media akuakultur', '2', '1', 'juni', '2007', 'MENGENAL RUMPUT LAUT, Kappaphycus alvarezii', 'Dua jenis rumput laut yang merupakan komoditas utama budi daya di Indonesia yakni Gracillaria di tambak dan Eucheuma/Kappaphycus di laut.\r\nK. alvarezii atau yang lebih populer dengan nama Eucheuma cottonii merupakan salah satu spesies yang paling banyak dibudidayakan di Indonesia. Peluang pasar yang tinggi menjadikan komo-\r\nditas ini semakin banyak diminati. Indonesia merupakan penghasil rumput laut karaginan terbesar kedua dunia setelah Filipina. Untuk mengenal lebih dekat rumput laut tersebut, makalah ini akan memberikan gambaran secara umum dari karakteristik K. alvarezii yang meliputi taksonomi, morfologi, reproduksi, eko-fisiologi, dan distribusi, serta dilengkapi dengan dukungan hasil riset mengenai pertumbuhan dan analisis genetik antara dua perbedaan warna dari spesies rumput laut tersebut.', 'Kappaphycus alvarezii; taksonomi; morfologi; keragaan genetik', 'D108'),
(109, 'buletin teknik litkayasa akuakultur', '18', '2', 'desember', '2020', 'PERHITUNGAN INDEKS NILAI PENTING DAN INDEKS KEANEKARAGAMAN PENUTUPAN JENIS MAKROALGA DENGAN METODE TRANSEK KUADRAT', 'Makroalga merupakan biota laut yang banyak ditemukan di sepanjang perairan pantai Indonesia. Informasi data kelimpahan makroalga di beberapa perairan masih sangat terbatas. Pantai Krakal yang terletak di sekitar perairan Kabupaten Gunung Kidul, Yogyakarta merupakan salah satu tempat yang banyak menghasilkan makrolaga. Kegiatan ini bertujuan untuk mengetahui indeks nilai penting dan indeks keanekaragaman penutupan jenis makroalga dengan metode transek kuadrat. Tahapan meliputi pemilihan lokasi, pembuatan petak transek kuadrat, dan dokumentasi makroalga. Petak transek kuadrat berukuran 100 cm x 100 cm dengan plot kecil berukuran 20 cm x 20 cm. Pengambilan data dilakukan sebanyak 10 kali ulangan dengan cara memasang petak transek kuadrat secara zig-zag dengan jarak antar petak transek yaitu empat meter. Pengambilan data dilakukan dengan cara mencatat semua jenis makroalga dan tutupan makroalga yang terdapat pada setiap luasan petak transek kuadrat. Data tersebut kemudian digunakan untuk menghitung kelimpahan relatif, penutupan relatif jenis, frekuensi relatif, dan indek nilai penting (INP), serta keanekaragaman penutupan jenis (HC ). Hasil yang diperoleh menunjukkan bahwa secara umum makroalga yang ditemukan di Pantai Krakal ada sembilan spesies dari filum Rhodophyta, Chlorophyta, dan Phaeophyta. Keanekaragaman makroalga di Pantai Krakal menunjukkan kategori sedang (1<H <3) dengan nilai sebesar 1,75. Makroalga jenis Gelidium sp. merupakan jenis makroalga yang paling banyak ditemukan di lokasi kegiatan.', 'makroalga; transek kuadrat; kelimpahan relatif; penutupan relatif; frekuensi relatif dan index nilai penting (INP)', 'D109'),
(110, 'jurnal penelitian perikanan indonesia', '1', '3', '-', '1995', 'PENGARUH VARIASI KOMPOSISI PUPUK TERHADAP PERTUMBUHAN RUMPUT LAUT, Eutcheuma cottonii PADA KULTUR IN VITRO', 'Penelitian ini dilaksanakan di laboratorium Balai Penelitian Perikanan Pantai, Maros selama dua bulan dengan tujuan untuk melihat pengaruh variasi beberapa komposisi pupuk dalam media kultur terhedap perkembangan eksplan rumput laut, Eucbetma cottonii sccara kultur in vitro.', 'Seaweed; fertilizer', 'D110'),
(111, 'prosiding FORUM INOVASI TEKNOLOGI AKUAKULTUR', '-', '-', '-', '2012', 'PEMANFAATAN JERAMI, PUPUK KANDANG, DAN RUMPUT LAUT SEBAGAI PUPUK ORGANIK PADA BUDIDAYA UDANG WINDU DI TAMBAK', 'Udang merupakan komoditas ekspor perikanan penting terutama ke negara-negara maju. Semakin meningkatnya perhatian masyarakat terhadap kesehatan menyebabkan makanan yang dikonsumsi mengalami pengawasan yang ketat tentang  kebersihandan kandungan bahan berbahaya bagi tubuh. Fenomena seperti ini akan terus berkembang dan meningkat seiring dengan perkembangan kemajuan dunia. Karena itu, selain produk organik banyak diminati oleh masyarakat, juga produk dihargai 3 kali lipat dibanding dengan harga produk non-organik, Meningkatnya animo masyarakat pada makanan organik menuntut usaha menyediakan makanan organik sehingga perlu banyak penelitian yang menunjang usaha tersebut. Penelitian bertujuan untuk mengetahui pengaruh pupuk organik yang terbuat dari bahan baku jerami, pupuk kandang, dan rumput laut terhadap pertumbuhan, sintasan, dan produksi udang windu di tambak. Hewan uji yang digunakan adalah tokolan udang windu. Perlakuan yang dicobakan yaitu pupuk yang terbuat dari: A (rumput laut + jerami + pupuk kandang), B (pupuk organik komersial) dan C (tanpa pemupukan) masing-masing dengan 3 ulangan. Parameter yang diamati adalah pertumbuhan udang, sintasan, produksi, serta kualitas air dan plankton. Hasil yang dicapai selama 90 hari pemeliharaan adalah sintasan dan produksi tertinggi pada perlakuan A yakni masing-masing sebesar 46,2% dan 84 kg/ha, perlakuan adalah C 43% dan 44,8 kg/ha serta perlakuan B adalah 11,37% dan 15,5 kg/ha. Pertumbuhan mutlak udang windu pada perlakuan A, B, dan C masing-masing sebesar 8,55 g/ekor; 6,55 g/ekor; dan 5,42 g/ekor. Pupuk organik dari bahan baku jerami + pupuk kandang + rumput laut (perlakuan A) memberikan pertumbuhan, sintasan dan produksi yang berbeda nyata (P<0,05) dengan pupuk organik komersial sehingga bahan tersebut dapat dijadikan pupuk organik untuk keperluan tambak.', 'pupuk organik; udang windu; pertumbuhan; sintasan; produks', 'D111'),
(112, 'jurnal penelitian perikanan indonesia', '11', '8', '-', '2005', 'PENGUJIAN SECARA IN VIVO EFEK ANTIOKSIDATIF DARI EKSTRAK AIR RUMPUT LAUT Sargassum crassifolium', 'Naskah ini melaporkan hasil uji toksisitas akut (LD50) dan efek antioksidatif dari ekstrak air rumput faut Sargassum crassifolium. Penentuan LD50 menggunakan metode Weil dengan hewan percobaan mencit (Mus musculus) yang diberikan sediaan secara intraperitoneal (ip). Pada penelitian selanjutnya, digunakan hewan percobaan tikus (Raffus norvegicus L.)', 'water extract; Sargassum crassifolium seaweed; blood plasma; superoxide dismutase; histopathology of rat liver', 'D112'),
(113, 'jurnal riset akuakultur', '10', '3', 'september', '2015', 'EVALUASI BAHAN BAKU PAKAN DAN PENGEMBANGAN PAKAN BUATAN UNTUK BUDIDAYA PEMBESARAN ABALON (Haliotis squamata)', 'Abalon merupakan salah satu jenis moluska laut yang memiliki nilai ekonomis penting dan spesies unggulan untuk budidaya di Indonesia. Keberhasilan budidaya abalon ditentukan oleh ketersediaan benih yang memadai. Selain itu, ketersediaan pakan yang baik juga berpengaruh nyata terhadap pertumbuhan abalon. Efektivitas pakan buatan untuk pembesaran abalon dipengaruhi oleh bahan baku yang digunakan. Untuk itu, penelitian ini bertujuan mendapatkan informasi dasar tentang bahan baku untuk pengembangan pakan buatan dan respons pertumbuhan abalon H. squamata terhadap pakan buatan. Bahan baku pakan dikoleksi, dianalisis komposisi nutriennya yang meliputi komposisi proksimat, asam amino, dan asam lemaknya. Percobaan aplikasi pakan buatan berbahan baku rumput laut dilakukan di Laboratorium Pakan, Balai Besar Penelitian dan Pengembangan Budidaya Laut, Gondol. Empat pakan percobaan dengan kombinasi tepung rumput laut berbeda dibuat dalam bentuk pelet kering. Sebagai pakan kontrol digunakan Gracilaria sp. segar dari tambak. Benih abalon ukuran bobot rata-rata 3,07 1,11 g dengan panjang cangkang 2,79\r\n 0,27 cm dipelihara dalam bak beton ukuran 2 m x 0,5 m x 0,5 m dengan kepadatan 400 ekor/bak. Bak dilengkapi dengan sistem air mengalir dan aerasi. Abalon diberi pakan percobaan dua kali sehari, pagi, dan sore hari. Percobaan dirancang dengan rancangan acak lengkap dengan lima perlakuan dan tiga ulangan untuk setiap perlakuan. Pada penelitian ini diperoleh empat jenis rumput laut yang potensial dapat dimanfaatkan sebagai bahan baku pakan abalon H. squamata. Hasil uji pakan menunjukkan bahwa pakan dari campuran tepung rumput laut Gracilaria sp. tambak dengan Ulva sp. (2:1) atau campuran Gracilaria sp. tambak dengan Sargassum sp. (2,3:1) memberikan respons pertumbuhan abalon H. squamata yang baik.', 'abalon; pembesaran; bahan baku; pengembangan pakan', 'D113'),
(114, 'buletin teknik litkayasa akuakultur', '9', '1', 'juni', '2011', 'Teknik isolasi bakteri dari rumput laut', 'Abstrak lengkap dapat dibaca pada full. PDF Perbagai terobosan yang telah dikembangkan dalam hal penanggulangan penyakit dengan menggunakan bahan- bahan alami sebagai pengganti obat- obatan kimia yang telah beredar di pasaran dan tidak ramah lingkungan.', 'isolasi; morfologi; rumput laut', 'D114'),
(115, 'buletin teknik litkayasa akuakultur', '7', '1', 'juni', '2008', 'IDENTIFIKASI BAKTERI YANG DIISOLASI DARI RUMPUT LAUT YANG TERSERANG PENYAKIT ICE-ICE', 'Identifikasi dilakukan terhadap isolat bakteri dari rumput laut jenis (Kappaphycus alvarezii) yang terserang penyakit ice-ice dan air laut sebagai media budidayanya. Berdasarkan hasil uji secara morfologi dan biokimia dari isolat bakteri tersebut, didapatkan 4 jenis bakteri yang termasuk dalam golongan bakteri gram negatif yaitu Chromobacterium, Acinetobacter (dominan), Flavocytofaga, Vibrio. Bakteri tersebut juga didapatkan pada air laut, sehingga ada kecenderungan bahwa bakteri yang terdapat pada air laut menginfeksi rumput laut yang luka sehingga menyebabkan penyakit ice-ice.', 'bakteri; rumput laut Kappaphycus alvarezii; penyakit ice-ice; isolat', 'D115'),
(116, 'prosiding FORUM INOVASI TEKNOLOGI AKUAKULTUR', '-', '-', '-', '2013', 'PENGARUH PENAMBAHAN ZAT PENGATUR TUMBUH GIBERELLIN (GA3) PADA INDUKSI KALUS RUMPUT LAUT Kappaphycus alvarezii', 'Zat pengatur tumbuh (ZPT) giberellin dianggap memiliki peran tersembunyi dalam pertumbuhan dan perkembangan tanaman. Meskipun pada kultur jaringan tanaman, giberelin jarang digunakan, namun\r\ntidak berarti bahwa zat pengatur tumbuh tersebut tidak penting. Hal ini terbukti secara alami giberellin diproduksi oleh tanaman termasuk rumput laut. Penelitian ini bertujuan untuk mengetahui pengaruh penambahan giberellin pada induksi kalus rumput laut K. alvarezii. Kultur kalus dilakukan pada media Conwy dengan penambahan ZPT indole acetic acid (IAA), zeatin, dan giberellin (GA3). Konsentrasi IAA dan zeatin diatur konstan yakni 0,4 mg/L dan 1 mg/L. Sedangkan konsentrasi GA3 bervariasi yakni: A = 0,4 mg/ L; B = 0,6 mg/L; C = 0,8 mg/L; D = 1 mg/L sedangkan K = kontrol (tanpa GA3). Desain penelitian adalah\r\nrancangan acak lengkap (RAL) dengan pengulangan 3 kali untuk masing-masing perlakuan. Parameter yang diamati adalah laju pertumbuhan harian, kecepatan regenerasi, panjang tunas, dan sintasan kalus. Hasil\r\nyang diperoleh menunjukkan bahwa penambahan giberellin pada induksi kalus memiliki pengaruh yang nyata terhadap laju pertumbuhan harian, kecepatan regenerasi dan panjang tunas rumput laut (P<0,05) namun tidak berpengaruh nyata terhadap sintasan (P>0,05).', 'giberellin, kalus, K. alvarezii', 'D116'),
(117, 'jurnal riset akuakultur', '8', '1', 'april', '2013', 'FORMULASI AUKSIN (INDOLE ACETIC ACID) DAN SITOKININ (KINETIN, ZEATIN) UNTUK MORFOGENESIS SERTA PENGARUHNYA TERHADAP PERTUMBUHAN, SINTASAN DAN LAJU REGENERASI KALUS RUMPUT LAUT, Kappaphycus alvarezii', 'Interaksi auksin dan sitokinin dianggap penting untuk mengatur pertumbuhan dan perkembangan dalam kultur jaringan tanaman. Penelitian ini bertujuan untuk menentukan komposisi auksin dan sitokinin yang optimum untuk morfogenesis kalus rumput laut K. alvarezii, dan mengevaluasi pengaruhnya terhadap pertumbuhan, sintasan, dan laju regenerasi kalus. Kultur kalus dilakukan pada media cair dengan formulasi zat pengatur tumbuh (ZPT) indole acetic acid (IAA) : kinetin : zeatin, dengan komposisi konsentrasi sebagai berikut: A) 0,4:0:1 mg/L; B) 0,4:0,25:0,75 mg/L; C) 0,4:0,5:0,5 mg/L; D) 0,4:0,75: 0,25 mg/L; E) 0,4:1:0 mg/L; kontrol (tanpa ZPT). Desain penelitian adalah rancangan acak lengkap dengan pengulangan tiga kali untuk masing-masing perlakuan. Parameter yang diamati adalah laju pertumbuhan harian, sintasan, laju regenerasi, panjang tunas, dan morfologi tunas. Analisis data dilakukan dengan uji keragaman (ANOVA) dan hasil yang diperoleh disajikan dalam bentuk grafik. Hasil penelitian menunjukkan bahwa formula optimum untuk morfogenesis rumput laut K. alvarezii adalah formula A dengan komposisi IAA : zeatin = 0,4:1 mg/L. Penggunaan formula zat pengatur tumbuh yang berbeda berpengaruh nyata (P<0,05) terhadap laju pertumbuhan harian, laju regenerasi dan panjang tunas yang dihasilkan, tetapi tidak berpengaruh nyata (P>0,05) terhadap sintasan kalus. Tunas rumput laut K. alvarezii mulai terbentuk pada hari ke-15 masa kultur.', 'formulasi; auksin; sitokinin; morfogenesis; K. alvarezii', 'D117'),
(118, 'buletin teknik litkayasa akuakultur', '9', '1', 'juni', '2011', 'Perbanyakan benih rumput laut Gracilaria verrucosa melalui teknik kultur jaringan', 'Abstrak lengkap dapat dibaca pada full. PDF Rumput laut Gracilaria verrucosa telah dibudidayakan di Indonesia secara luas tambak.', 'Gracilaria verrucosa ; perbanyakan benih, kultur jaringan', 'D118'),
(119, 'jurnal riset akuakultur', '11', '1', 'maret', '2016', 'FORMULASI PAKAN BUATAN DENGAN BAHAN BAKU RUMPUT LAUT UNTUK PERTUMBUHAN ABALON Haliotis squamata', 'Abalon merupakan salah satu jenis moluska laut yang memiliki potensi ekonomis untuk dikembangkan usaha budidayanya. Teknologi pembenihan abalon Haliotis squamata telah dikembangkan dan berhasil memproduksi benih secara massal. Selain benih, ketersediaan pakan yang sesuai sangat menentukan keberhasilan budidaya pembesaran abalon. Selain makan pakan segar berupa makroalga, abalon juga dapat menerima pakan buatan dengan baik. Penelitian ini bertujuan untuk mendapatkan formula pakan dengan bahan baku tepung rumput laut untuk pertumbuhan H. squamata. Tiga pakan percobaan diformulasi dengan proporsi tepung rumput laut Ulva sp., Gracilaria sp., dan Sargassum sp. yang berbeda dibuat berbentuk remah dengan kandungan protein dan lemak yang sama.  Sebagai kontrol digunakan pakan Gracilaria sp. segar asal tambak.  Sebanyak 16 buah bak beton berukuran 2,0 x 0,5 x 0,5 m3 dengan ketinggian air 25 cm dan dilengkapi dengan aerasi digunakan sebagai wadah percobaan.  Benih abalon hasil pembenihan di hatcheri dengan ukuran bobot 5,30   1,07 g; panjang cangkang 3,35   0,29 cm ditebar dengan kepadatan 388 ekor per bak.  Abalon diberi pakan percobaan 2 kali sehari selama 168 hari. Jumlah pakan disesuaikan dengan respons makan dari abalon. Percobaan dirancang dengan rancangan acak lengkap dengan 4 perlakuan pakan dan setiap perlakuan terdiri atas 4 ulangan.  Hasil percobaan menunjukkan bahwa pertumbuhan abalon yang diberi pakan buatan tidak berbeda nyata, tetapi pakan dengan proporsi tepung Ulva sp. 35% cenderung memberikan pertumbuhan yang lebih baik. Pertumbuhan abalon terbaik diperoleh pada perlakuan kontrol.  Kandungan protein daging abalon dipengaruhi oleh pakan percobaan. Kandungan protein daging abalon yang diberi pakan buatan signifikan lebih tinggi dibandingkan dengan kontrol.', 'abalon; formulasi pakan; pertumbuhan; rumput laut', 'D119'),
(120, 'prosiding FORUM INOVASI TEKNOLOGI AKUAKULTUR', '-', '-', '-', '2010', 'POLIKULTUR UDANG VANAME (Litopenaeus vannamei) DAN RUMPUT LAUT (Gracilaria verrucosa)', 'Penelitian polikultur udang vaname (Litopenaeus vannamei) dan rumput laut Gracilaria verrucosa dilaksanakan di Instalasi Tambak Percobaan Balai Riset Perikanan Budidaya Air Payau di Marana, Maros dengan menggunakan tambak ukuran 5.000 m2/petak sebanyak 4 petak. Tujuan penelitian ini untuk mengetahui produktivitas tambak pada polikultur udang vaname dan rumput laut. Hewan uji yang digunakan adalah tokolan udang vaname dengan bobot rata-rata 0,22 g/ekor. Sebagai perlakuan adalah: (A) polikultur 2 ekor/ m2 udang vaname + 2.000 kg/ha rumput laut dan (B) monokultur 2 ekor/m2 udang vaname, masing-masing dengan dua ulangan. Sintasan dan produksi udang tertinggi diperoleh pada perlakuan A namun tidak berbeda nyata (P>0,05) dengan perlakuan B dengan sintasan masing-masing 54,66% dan 35,22% serta produksi masing-masing 108,6 kg/ha dan 72,84 kg/ha', 'vaname, Gracilaria verrucosa, polikultur, sintasan, produksi', 'D120'),
(121, 'buletin teknik litkayasa akuakultur', '9', '1', 'juni', '2011', 'Penggunaan shelter rumput laut (Gracilaria verrucosa) dalam pemeliharaan megalopa kepititng bakau (Scylla Serrata)', 'Abstrak lengkap dapat dibaca pada full. PDF Makalah ini menyajikan tentang penggunaan shelter rumput laut (Gracilaria verrucosa) pada pemerliharaan megalopa kepiting bakau (Scylla Serrata)', 'megalopa; Scylla serrata; shelter', 'D121'),
(122, 'jurnal riset akuakultur', '9', '2', 'agustus', '2014', 'PROPAGASI VEGETATIF RUMPUT LAUT Gracilaria sp. MELALUI KULTUR JARINGAN', 'Kultur jaringan merupakan salah satu metode untuk menghasilkan bibit rumput laut secara kontinu. Penelitian ini bertujuan untuk mengevaluasi pertumbuhan dan perkembangan bibit rumput laut Gracilaria sp. pada setiap tahapan proses propagasi vegetatif melalui kultur jaringan. Propagasi di laboratorium dilakukan selama 60 hari menggunakan kontainer kaca berkapasitas 2 L dengan kepadatan eksplan 1.000; 1.500; dan 2.000 eksplan/kontainer, selanjutnya dilakukan aklimatisasi eksplan di tambak menggunakan hapa berukuran 50 cm x 50 cm x 50 cm selama 60 hari dengan kepadatan eksplan 10, 20 dan 30 g/hapa. Propagasi di tambak dilakukan selama lima bulan dengan metode long line dan setiap 30 hari dilakukan perbanyakan bibit dan pengamatan terhadap pertumbuhan. Desain penelitian adalah rancangan acak lengkap dengan tiga ulangan untuk masing-masing perlakuan. Parameter yang diamati adalah sintasan eksplan di laboratorium, pertumbuhan, dan perkembangan bibit. Hasil yang diperoleh pada kultur di laboratorium yaitu sintasan tertinggi (45,38%) diperoleh pada kepadatan 1.500 eksplan/kontainer, pada aklimatisasi di tambak kepadatan eksplan hingga 30 g tidak memberikan pengaruh yang nyata terhadap laju pertumbuhan harian bibit (P>0,05); bobot mutlak tertinggi diperoleh pada perlakuan 30 g/hapa. Laju pertumbuhan bibit rumput laut hasil kultur jaringan pada propagasi di tambak berada pada kisaran 2,33%-4,31%.', 'propagasi; vegetatif; Gracilaria sp.; kultur jaringan', 'D122'),
(123, 'jurnal riset akuakultur', '2', '3', 'desember', '2007', 'PEMILIHAN LOKASI BUDI DAYA IKAN, RUMPUT LAUT, DAN TIRAM MUTIARA YANG RAMAH LINGKUNGAN DI KEPULAUAN TOGEAN, SULAWESI TENGAH', 'Sumber daya lahan perikanan pesisir di Sulawesi Tengah yang potensial untuk pengembangan budi daya laut berada di Teluk Tomini, namun demikian belum diperoleh data secara rinci kelayakannya. Penelitian ini bertujuan untuk menentukan kelayakan lokasi bagi pengembangan budi daya di perairan Kepulauan Togean, Kabupaten Tojo Una-Una, Sulawesi Tengah dan penelitiannya dilaksanakan dengan metode survai. Pengumpulan data sekunder meliputi data iklim, pasang surut, produksi perikanan, peta rupa bumi Indonesia kawasan Tojo Una-Una skala 1:25.000, peta citra landsat7ETM digital, dan peta navigasi (batimetri) skala 1:200.000 yang dilakukan sebelum pelaksanaan survai. Data primer diperoleh melalui pengukuran langsung di lapang yang meliputi topografi pantai, keterlindungan, oseanografi, dan biologi. Seluruh lokasi pengambilan contoh ditentukan posisinya dengan Global Positioning System (GPS) dan data yang diperoleh dianalisis dengan menggunakan Sistem Informasi Geografis (SIG). Dari hasil penelitian ini telah diidentifikasi sumber daya lahan perikanan pesisir yang potensial dikembangkan dan dinilai layak untuk kegiatan budi daya laut yaitu seluas 1.601,3 hektar. Lokasi yang potensial dikembangkan untuk budi daya ikan dalam keramba jaring apung (KJA) terdapat di sekitar Kepulauan Siatu 365,2 hektar; Kepulauan Salaka 385,8 hektar; dan Pulau Kadidiri 270,9 hektar. Sedangkan lokasi yang potensial dikembangkan untuk budi daya rumput laut dan tiram mutiara terdapat di sekitar Pulau Huo dan Bungin 579,4 hektar. Seluruh lokasi tersebut ditampilkan dalam peta prospektif skala 1:50.000.', 'natural resources; coastal; aquaculture; site selection', 'D123'),
(124, 'pelagicus', '1', '3', 'september', '2020', 'Pembuatan Dodol Jelly dengan Penambahan Agar Strip (Gracilaria sp.) di Kabupaten Karawang', 'Kabupaten Karawang merupakan salah satu daerah penghasil rumput laut jenis Gracilaria sp. Untuk meningkatkan nilai jualnya, rumput laut Gracilaria sp. dapat diolah menjadi agar strip. Agar strip Gracilaria sp. kemudian digunakan sebagai bahan baku pembuatan dodol jelly. Menurut SNI 01-2986- 1992, dodol merupakan sejenis makanan yang terbuat dari tepung beras ketan, santan kelapa, dan gula dengan atau tanpa penambahan bahan lainnya yang diizinkan. Namun dalam perkembangannya, dodol dapat dibuat dari bermacam-macam bahan makanan, misalnya dodol buah Garut atau dodol jelly rumput laut khas Lombok. Tujuan penelitian ini untuk memformulasikan produk dodol yang diolah dari karaginan dan agar strip Gracilaria sp. serta menguji kualitas sensori dodol tersebut. Penambahan agar strip Gracilaria sp. mempengaruhi mutu sensori produk dodol jelly pada parameter tekstur. Formulasi bahan dodol jelly meliputi: agar Gracilaria sp, karaginan, gelatin, sirup glukosa, sukrosa, pewarna makanan dan air. Dodol jelly yang dihasilkan memiliki kenampakan jernih dan tekstur kenyal. Nilai tertinggi 4.15 untuk rata-rata kesukaan panelis terhadap tekstur yakni dodol jelly tanpa penambahan agar strip. Untuk warna rata-rata panelis menyukai produk dengan penambahan agar strip 5 gram. Untuk penilaian terhadap aroma semua panelis menyukai aroma dodol dengan atau tanpa penambahan agar strip.', 'Agar Strips; Dodol Jelly; Gracilaria sp', 'D124'),
(125, 'prosiding FORUM INOVASI TEKNOLOGI AKUAKULTUR', '-', '-', '-', '2011', 'PERTUMBUHAN EKSPLAN RUMPUT LAUT, Glacillaria verrucosa HASIL KULTUR JARINGAN DENGAN KEPADATAN TEBAR BERBEDA DI TAMBAK', 'Budidaya rumput laut ............', 'rumput laut; pertumbuhan; kultur jaringan; padat tebar; tambak', 'D125'),
(126, 'buletin teknik litkayasa akuakultur', '12', '1', 'juni', '2014', 'Analisis Kandungan Karagenan Bibit Rumput Laut Kappaphycus alvarezii Hasil Seleksi dan Non Seleksi Varietas', 'Abstrak lengkap dapat dilihat pada full. PDF Rumput laut k. alvarezii merupakan satu di antara beberapa komoditas unggulan sektor perikanan sebagai penghasil karagenan.', 'Kappaphycus alvarezii; karagenan; seleksi varietas', 'D126'),
(127, 'media akuakultur', '9', '1', 'juni', '2014', 'KAJIAN PENGEMBANGAN BUDIDAYA RUMPUT LAUT DI KAWASAN MINAPOLITAN KABUPATEN SUMBAWA BARAT, NUSA TENGGARA BARAT', 'Kabupaten Sumbawa Barat telah ditetapkan sebagai kawasan minapolitan untuk pengembangan komoditas rumput laut. pelaksanaan program minapolitan membutuhkan dukungan data dan informasi yang terbaru mengenai profi, potensi, dan kondisi daya dukung lingkungan.', 'budidaya rumput laut; kesesuaian lahan; minapolitan; Sumbawa Barat', 'D127');
INSERT INTO `tbjurnal` (`Id`, `sumber`, `volume`, `nomor`, `bulan`, `tahun`, `judul`, `abstrak`, `katakunci`, `nm_dk`) VALUES
(128, 'jurnal riset akuakultur', '10', '1', 'maret', '2015', 'INDEKS KUALITAS AIR DAN SEBARAN NUTRIEN SEKITAR BUDIDAYA LAUT TERINTEGRASI DI PERAIRAN TELUK EKAS, NUSA TENGGARA BARAT: ASPEK PENTING BUDIDAYA RUMPUT LAUT', 'Kualitas perairan merupakan salah satu aspek penting dalam perikanan budidaya. Perubahan yang terjadi pada kondisi kimia atau fisik perairan dapat menyebabkan dampak negatif terhadap pertumbuhan biota budidaya. Data kualitas air hasil program pemantauan selama enam bulan di lokasi penelitian telah dianalisis untuk melihat kisaran indeks kualitas air dan sebaran nutrien yang terjadi di sekitar unit budidaya laut terintegrasi berbasis integrated multi-trophic aquaculture (IMTA) di Teluk Ekas Provinsi Nusa Tenggara Barat. Pengamatan dilakukan pada bulan Juni-November 2014, sebanyak 13 titik pengamatan yang disebar secara diagonal dengan pusat keramba jaring apung ikan laut. Seluruh data dianalisis secara spasial dan temporal. Hasil penelitian menunjukkan bahwa nilai indeks kualitas air di lokasi penelitian tergolong kategori sedang-baik. Bulan Juli merupakan bulan dengan nilai indeks yang baik dengan kategori sedang-sangat baik (50-83); sedangkan bulan September memiliki nilai indeks yang relatif rendah dengan kategori buruk sedang (33-60). Berdasarkan sebaran nutrien (amonium, nitrat, dan orto-fosfat) menunjukkan fluktuasi secara spasial dan temporal. Konsentrasi nutrien umumnya tersedia dengan baik pada jarak 60 m dari KJA. Hasil penelitian ini dapat memberikan gambaran tentang kondisi kualitas perairan dan ketersediaan nutrien untuk mendukung pertumbuhan dan produktivitas budidaya rumput laut dengan sistem IMTA.', 'indeks kualitas air, sebaran nutrien, budidaya laut terintegrasi, rumput laut, Teluk Ekas', 'D128'),
(129, 'media akuakultur', '9', '2', 'desember', '2014', 'PENENTUAN POLA MUSIM TANAM BUDIDAYA RUMPUT LAUT, Kappaphycus alvarezii DI PERAIRAN PARIGI MOUTONG, SULAWESI TENGAH', 'Abstrak lengkap dapat di download di File PDF', 'pola musim tanam; Kappaphycus alvarezii; Parigi Moutong', 'D129'),
(130, 'jurnal riset akuakultur', '10', '1', 'maret', '2015', 'PERSPEKTIF PENGEMBANGAN PERIKANAN BUDIDAYA BERDASARKAN KARAKTERISTIK PANTAI DI TELUK GERUPUK DAN TELUK BUMBANG KABUPATEN LOMBOK TENGAH PROVINSI NUSA TENGGARA BARAT', 'tersedianya informasi mengenai karakteristik pantai menjadi salah satu faktor penentu keberhasilan perencanaan dan pengelolaan perikanan budidaya pesisir berbasis lahan. Penelitian ini bertujuan untuk mengetahui karakteristik pantai khususnya aspek topografi dan hidrologi di Teluk Gerupuk dan Teluk Bumbang Kecamatan Pujut Kabupaten Lombok Tengah Provinsi Nusa Tenggara Barat (NTB), hubungannya dengan status eksisting dan kemungkinan pengembangan perikanan budidaya. Variabel topografi dan hidrologi teluk yang diukur meliputi: pasang surut (pasut), kedalaman, dan kelandaian pantai. Hasil analisis menunjukkan bahwa karakteristik pasut dengan tunggang pasut sekitar 2,85 m secara teknis masih tergolong ideal untuk pengembangan berbagai sistem budidaya tambak udang (tradisional plus, semi-intensif, intensif, dan super-intensif). Khusus untuk tambak intensif dan super-intensif, tunggang pasut yang besar harus dicermati sehubungan dengan jauhnya jarak pengambilan air bersih. Secara umum Teluk Gerupuk dan Teluk Bumbang dengan luas   940 ha (9,4 km2) dan kedalaman rata-rata perairan 4,17 0,12 cukup mendukung untuk kegiatan budidaya rumput laut. Berkembangnya pemanfaatan lahan selain budidaya rumput laut di sekitar dan pada teluk seperti pemukiman, pariwisata, dan budidaya tambak, dapat memengaruhi kualitas kimia fisik perairan dan kemungkinan berkaitan erat dengan menurunnya produksi rumput laut pada tahun-tahun terakhir. Dengan batasan karakteristik topografi dan hidrologis teluk yang menjadi pusat berlabuhnya aktivitas penggunaan lahan pantai dan darat, dibutuhkan perhatian serius mengenai rencana umum tata ruang wilayah teluk termasuk penanganan limbah agar tidak berdampak negatif secara ekologis dan sosial yang pada akhirnya akan mengganggu keberlanjutan usaha perikanan budidaya di wilayah ini. hidrologi, topografi, perikanan budidaya, Teluk Gerupuk, Nusa Tenggara Barat', 'hidrologi, topografi, perikanan budidaya, Teluk Gerupuk, Nusa Tenggara Barat', 'D130'),
(131, 'prosiding FORUM INOVASI TEKNOLOGI AKUAKULTUR', '-', '-', '-', '2011', 'APLIKASI KARAGENAN DARI RUMPUT LAUT Eucheuma spinosum PADA PEMBUATAN SUSU KENTAL MANIS', 'Diversifikasi produk rumput laut ............', 'rumput laut; E. spinosum; susu kental manis', 'D131'),
(132, 'prosiding FORUM INOVASI TEKNOLOGI AKUAKULTUR', '-', '-', '-', '2010', 'KERAGAMAN MORFOLOGI EMBRIO SOMATIK PADA RUMPUT LAUT (Kappaphycus alvarezii ) SELAMA PEMELIHARAAN PADA MEDIA CAIR DAN SEMI SOLID YANG DIPERKAYA DENGAN IAA', 'Pekembangan embrio somatik rumput laut Kappaphycus alvarezii (Doty) memperlihatkan keragaman morfologi yang berbeda pada setiap fase pertumbuhan sejak induksi hingga menjadi globular embrio yang dipelihara pada media cair dan semi solid. Medium kultur yang digunakan adalah media Conwy semi solid dengan kepadatan 0,8% agar yan diperkaya dengan zat perangsang tumbuh Indol acetic acid (IAA) 0,4 mg/L. Pemeliharaan dilakukan selama 8 minggu, pengggantian media dilakukan setiap minggu dengan komposisi media yang sama. Induksi kalus dan embrio terjadi pada eksplan rumput laut pada minggu pertama yang ditandai dengan tumbuhnya filamen transparan atau berwarna merah kecoklatan yang timbul pada permukaan jaringan atau kadang-kadang membentuk organ yang belum sempurna pada bagian lainnya. Embrio dan filamen dapat dipindahkan pada media kultur yang baru agar dapat berkembang dengan baik. Pembentukan anakan diawali dari filamen yang menyatu membentuk globular kemudian memanjang dan menyatu menjadi embrio. Persentase sintasan eksplan dan embrio pada induksi kalus sekitar 80%, namun filamen dan embrio yang terbentuk dapat diperbanyak hingga menghasilkan anakan yang seragam dalam waktu yan bersamaan', 'keragaman, morfologi, embrio somatik, Kappaphycus alvarezii', 'D132'),
(133, 'prosiding FORUM INOVASI TEKNOLOGI AKUAKULTUR', '-', '-', '-', '2012', 'POLIKULTUR RAJUNGAN ( Portunus pelagicus ), RUMPUT LAUT ( Gracilaria verrucosa ), DAN IKAN BANDENG ( Chanos chanos ) DI TAMBAK', 'Tujuan penelitian ini adalah untuk mendapatkan data dan informasi tentang laju pertumbuhan sintasan dan produksi rajungan yang dibudidayakan di tambak. Penelitian ini dilaksanakan di Instalasi tambak percobaan Balai Penelitian dan Pengembangan Perikanan Budidaya Air Payau, Maros selama 90 Hari. Tambak yang digunakan berukuran 2.500 m2 yang disekat menjadi dua petak masing-masing seluas 1.250 m2. Perlakuan yang diaplikasikan adalah satu tambak ditebari benih rajungan dan rumput laut dengan kepadatan 100 kg/ petak, sedangkan tambak yang lain di samping ditebar rumput laut juga ditebar bandeng sebanyak 100 ind./petak dengan panjang dan bobot masing-masing adalah 18,0 2,7 cm dan 81,2 3,7 g. Hewan uji yang digunakan adalah krablet 9 dengan lebar karapas dan bobot masing-masing adalah 3,1 0,2 mm dan 0,03 0,02 g dengan kepadatan 3 ind./m2. Peubah yang diamati adalah pertumbuhan lebar karapas, bobot, sintasan, dan produksi, serta parameter kualitas air, data yang diperoleh dibahas secara deskriptif. Selama penelitian diberi makan ikan rucah 2 kali sehari dengan dosis 15%-5% dari total biomassa. Hasil penelitian menunjukkan bahwa perlakuan  tanpa bandeng  memberikan sintasan dan produksi rajungan yang lebih baik daripada perlakuan  dengan bandeng , demikian juga terhadap laju pertumbuhan lebar karapas dan bobot rajungan.', 'rajungan, ikan bandeng; tambak; pertumbuhan; sintasan; produksi', 'D133'),
(134, 'jurnal kelautan nasional', '8', '3', 'desember', '2013', 'TEKNOLOGI PENGKAYAAN UNSUR-UNSUR N, P, Fe PADA RUMPUT LAUT Gracilaria verrucosa', 'Penelitian ini bertujuan  untuk mengkaji respon pertumbuhan Gracilaria verrucosa melalui teknologi pengkayaan N,P dan Fe sebagai unsur hara makro dan mikro ke dalam media budidaya. Metode penelitian menggunakan Rancangan Acak Lengkap (RAL) dengan 4 perlakuan dan 3 ulangan, yaitu tanpa pengkayaan nutrien/non-enriched (A), pengkayaan N (B), pengkayaan N+P (C) dan pengkayaan N+P+Fe (D). Hasil penelitian menunjukkan pengkayaan  N+P+Fe memberi pengaruh yang lebih tinggi terhadap  pertumbuhan G. verrucosa dan berbeda secara signifikan dengan perlakuan lainnya  (p<0.05). Disamping itu,  klorofil dan konsentrasi N, P, Fe pada rumput laut juga terdeteksi lebih tinggi pada perlakuan tersebut. Dengan demikian dapat dikatakan teknologi pengkayaan dengan menggunakan kombinasi unsur hara makro (N,P) dan mikro (Fe) dalam budidaya G. verrucosa dapat meningkatkan pertumbuhan secara signifikan sehingga dapat dipertimbangkan untuk diaplikasikan dalam budidaya rumput laut tersebut.  Meskipun secara umum kadar dan karakteristik physico-kimia agar lebih baik pada perlakuan pengkayaan N+P, namun kadar agar dan gel strengthnya tidak berbeda dengan perlakuan pengkayaan N+P+Fe.', 'pengkayaan, pertumbuhan, klorofil, kadar agar, physico-kimia agar', 'D134'),
(135, 'prosiding FORUM INOVASI TEKNOLOGI AKUAKULTUR', '-', '-', '-', '2009', 'PEMANFAATAN OCEAN-COLORREMOTESENSING UNTUK PENGELOLAANSUMBERDAYA PERIKANANBUDIDAYA', 'Trend produksi perikanan menunjukkan bahwa perikanan budidaya mengalami peningkatan produksi dari tahun ke tahun jika dibandingkan dengan perikanan tangkap yang produksinya cenderung stabil atau bahkan menurun. Kegiatan perikanan budidaya secara umum dapat dikategorikan ke dalam budidaya\r\nrumput laut, kekerangan (moluska), dan ikan dalam keramba jaring apung, serta ikan/udang/rumput laut di tambak. Peningkatan produksi perikanan budidaya tidak terlepas dari berbagai masalah yang dihadapi di antaranya identifikasi kelayakan lahan dan pengaruh lingkungan yang ditimbulkan oleh kegiatan perikanan budidaya. Efek yang ditimbulkan oleh kegiatan perikanan budidaya tentunya dapat diminimalkan melalui perencanaan dan pengelolaan yang baik yang disesuaikan dengan kondisi dan kapasitas lingkungan. Dewasa\r\nini dengan makin berkembangnya teknologi, penginderaan jauh inderaja/remote sensing) sudah mulai dimanfaatkan untuk perikanan budidaya. Kajian yang sering dilakukan dengan menggunakan inderaja meliputi: kajian kelayakan lahan (zoning), efek kegiatan budidaya terhadap lingkungan, konflik kepentingan\r\nantara perikanan budidaya dengan sektor lainnya, dan monitoring perikanan budidaya.', 'pengelolaansumberdaya, budidayaperikanan, oceancolorremotesensing (OCRS)', 'D135'),
(136, 'buletin teknik litkayasa akuakultur', '3', '2', 'desember', '2004', 'KANDUNGAN KIMIAWI BEBERAPA JENIS RUMPUT LAUT', 'Abstrak bisa dilihat di Lampiran', '-', 'D136'),
(137, 'prosiding FORUM INOVASI TEKNOLOGI AKUAKULTUR', '-', '-', '-', '2009', 'PRODUKSI MASSAL BENIH ABALON, Haliotis squamata (Reeve, 1846)', 'Budidaya abalon di dunia saat ini masih terus dikembangkan untuk memenuhi permintaan pasar yang semakin meningkat, di samping itu, harga jual abalon yang cukup tinggi dan cenderung terus meningkat juga merupakan salah satu daya tarik dalam pengembangannya. Di Indonesia pengembangan budidaya\r\nabalon jenis Haliotis squamata juga terus dilakukan, namun masih menghadapi kendala dalam penyediaan benih baik dari segi jumlah, ukuran, dan waktu. Oleh karena itu, pengembangan teknologi pembenihan abalon di hatcheri telah dilakukan di Balai Besar Riset Perikanan Budidaya Laut, Gondol dengan melakukan pemeliharaan dalam bak secara terkontrol untuk memproduksi benih abalon skala massal. Produksi benih abalon dihasilkan melalui pemijahan alami induk abalon dari alam dengan ukuran panjang cangkang 7,13 0,02 cm dan bobot 64,49 3,5 g (ratio jantan dan betina 1:2). Pemeliharaan larva dilakukan dalam bak semen berukuran 10 m3 dan 6 m3 menggunakan plastik pergelombang yang digantung dalam bak pemeliharaan sebagai substrat dan media pakan alami. Penumbuhan pakan alami dilakukan 2 minggu\r\nsebelum penebaran. Jenis pakan alami yang tumbuh dan dimanfaatkan oleh larva, di antaranya adalah diatom dari jenis Nitzschia sp., Melosira sp., Thalassionema sp., Navicula sp., Cocconeis sp. Ketika memasuki\r\numur 1,5-2 bulan, benih mulai dirangsang dengan pemberian pakan rumput laut dari jenis Gracilaria sp. dan Ulva sp. Pada umur 2 bulan, benih dipindahkan ke bak pendederan sampai berukuran 1,5-2 cm. Sintasan rata-rata yang diperoleh pada umur 60 hari sebesar 6,46%. Produksi benih selama 4 siklus dengan\r\nukuran 1,5 2 cm sebanyak 13.898 ekor. Selanjutnya adalah pemeliharaan lanjutan benih di keramba jaring apung.', 'benihabalon, H. squamata, produksi', 'D137'),
(138, 'jurnal penelitian perikanan indonesia', '2', '1', '-', '1996', 'KOMANAJEMEN SUMBER DAYA ANTARA PEMERINTAH DESA, LEMBAGA ADAT DAN MASYARAKAT (KASUS KAWASAN PANTAI DESA JUNGUT BATU, NUSA PENIDA, BALI)', 'Tujuan dari tulisan ini adalah untuk melihat proses terjadinya pengelolaan sumber daya alam secara bersama (komanajemen). Komanajemen oleh pemerintah dan masyarakat dianggap sebagai tipe pengelolaan yang cukup efektif di Desa Jungut Batu, Nusa Penida, Bali. Hal ini ditunjukkan dengan meningkatnya pendapatan dan kesempatan kerja di bidang budidaya rumput laut.', 'Co-management; collaboration; income; employment', 'D138'),
(139, 'jurnal penelitian perikanan indonesia', '9', '5', '-', '2003', 'PENGARUH KONSENTRASI LARUTAN POTASIUM HIDROKSIDA TERHADAP MUTU KAPPA-KARAGINAN YANG DIEKSTRAKSI DARI Eucheuma cottonii', 'Perbaikan teknik ekstraksi kappa karaginan dari rumput laul Eucheuma cottoniitelah dilakukan dengan menggunakan variasi konsentrasi larutan KOH sebagai media pengekstrak.', 'KOH solution; kappa carrageenan; Eucheuma coftonii', 'D139'),
(140, 'jurnal penelitian perikanan indonesia', '7', '4', '-', '2001', 'PENGARUH KONSENTRASI BAHAN PEMUCAT DAN JENIS BAHAN PENGENDAP TERHADAP PEMBENTUKAN SODIUM ALGINAT DARI RUMPUT LAUT COKLAT Sargassum filipendula C. AGARTH', 'Penelitian perbaikan kualitas sodium alginat telah dilakukan dengan menggunakan tiga konsentrasi hidrogen peroksida (H2O2) sebagai bahan pemucat yaitu 3%, 6%, dan 9% (v/v) yang kemudian diendapkan menggunakan dura jenis bahan pengendap yaitu sodium karbonat (NarCOr) 5% (b/v) dan sodium hidroksida (NaOH) 5% (b/v).', 'hydrogen peroxide; sodium carbonate; sodium hydroxide; brown seawee4 sodium alginate', 'D140'),
(141, 'BAWAL Widya riset perikanan tangkap', '2', '4', 'april', '2009', 'TUMBUHAN AIR DI DANAU LIMBOTO, GORONTALO: MANFAAT DAN PERMASALAHANNYA', 'Danau Limboto cenderung semakin hari, semakin menurun luasnya. Luas danau pada tahun 1932 mencapai 8.000 ha, pada tahun 1970 menurun menjadi 4.500 ha. Pada tahun 1993, perairan ini mengalami penurunan luasnya menjadi 3.057 ha dengan kedalaman maksimumnya 2,3 m dan pada tahun 2004 tersisa 3.000 ha. Masalah pendangkalan dengan laju sedimentasi 1,5 cm per tahun dan perkembangan populasi tumbuhan air (rumput liar dan eceng gondok, Eichhornia crassipes) yang telah mencapai luas 9.420 m2menjadi ancaman bagi sumber daya perikanan di danau tersebut. Tujuan dari tulisan ini adalah untuk mengetahui jenis tumbuhan air serta menggambarkan kondisinya di Danau Limboto beserta manfaat dan permasalahannya. Hasil pengamatan menunjukkan bahwa\r\ndi Danau Limboto ditemukan 9 jenis tumbuhan air, meliputi tipe tumbuhan yang muncul di tepian danau, yang tenggelam dan berakar di dasar, dan yang mengapung bebas ataupun yang berakar. Jenis tumbuhan yang dominan adalah eceng gondok yang telah menjadi gulma.', 'tumbuhan air; Danau Limboto; Gorontalo', 'D141'),
(142, 'jurnal segara', '12', '1', 'april', '2016', 'Mina Wisata Sebagai Alternatif Pengembangan Wisata Bahari di Kawasan Pesisir Buleleng, Bali Utara', 'Kawasan pesisir Kabupaten Buleleng saat ini telah dimanfaatkan dengan berbagai kegiatan kepariwisataan, akan tetapi kegiatan tersebut masih belum memberikan manfaat yang optimal bagi masyarakat dan memiliki kecenderungan mengalami kejenuhan. Untuk itu, diperlukan suatu pengembangan wisata alternatif yang sesuai dengan kondisi dan potensi sumber daya alam yang ada serta saling  bersinergi dengan aktivitas wisata lainnya, seperti contohnya pengembangan mina wisata. Penelitian ini bertujuan untuk mengkaji dan menganalisis kondisi dan potensi sumberdaya alam pesisir dan laut, tingkat kesesuaian kawasan pesisir Buleleng dalam menunjang pengembangan mina wisata dan menghasilkan model aktivitas mina wisata di kawasan pesisir Buleleng yang terpadu dan berkelanjutan. Penelitian ini menggunakan pendekatan kesesuaian kawasan dengan rancangan penelitiannya berupa survei lapangan. Hasil penelitian menunjukkan bahwa pesisir Kabupaten Buleleng apabila dilihat dari kondisi dan potensi sumberdaya alamnya masih mampu untuk mendukung aktivitas mina wisata dengan tingkat kesesuaian kawasan berdasarkan indeks kesesuaian wisata, yaitu pesisir Buleleng timur terkategori cukup sesuai (76,92), pesisir Buleleng tengah terkategori cukup sesuai (61,53) dan pesisir Buleleng barat terkategori sangat sesuai (87,17). Rencana model mina wisata yang dapat dikembangkan antara lain pesisir Buleleng timur adalah mina wisata budidaya laut (ikan hias dan karang) dan mina wisata perikanan tangkap (mancing dan spearfishing adventures), pesisir Buleleng tengah adalah mina wisata budidaya laut (rumput laut) dan mina wisata perikanan tangkap (mancing dan spearfishing adventures), dan pesisir Buleleng barat adalah mina wisata budidaya laut (rumput laut, Bandeng, Kerapu, Mutiara, ikan hias dan karang) dan mina wisata perikanan tangkap (mancing dan spearfishing adventures).', 'mina wisata, wisata bahari, kawasan pesisir Buleleng, Bali utara', 'D142'),
(143, 'jurnal kelautan nasional', '10', '1', 'april', '2015', 'PRODUKSI, RENDEMEN DAN KEKUATAN GEL TIGA VARIETAS RUMPUT LAUT Kappaphycus alvarezii YANG DIBUDIDAYA DENGAN METODE LONG LINE', 'Kappaphycus alvarezii merupakan salah satu jenis alga merah (Rhodophyceae) yang bernilai ekonomis penting dan penyuplai karagenan dunia. Berdasarkan warnanya K. alvarezii terbagi menjadi merah, hijau dan coklat. Tujuan penelitian ini untuk menganalisis produksi dan kualitas karaginan dari varietas K. alvarezii  dengan metode budidaya  long line. Bibit rumput laut jenis K. alvarezii diperoleh dari Desa Kamelanta, Kecamatan Kapontori, Kabupaten Buton, Sulawesi Tenggara. Penelitian ini menggunakan Rancangan Acak Kelompok (RAK) dengan tiga perlakuan yaitu; varietas merah, varietas hijau dan varietas coklat, setiap pelakuan diulang dalam  tiga kelompok lokasi perairan (darat, tengah, dan dalam). Parameter yang diamati yaitu produksi, fikoeritrin, rendemen, kekuatan gel, dan kualitas air. Data dianalisis dengan menggunakan sidik ragam (ANOVA). Hasil menunjukkan bahwa varietas warna berpengaruh terhadap kelimpahan pigmen fotosintesis. Produksi dan kualitas karaginan terbaik pada K. alvarezii varietas coklat.', 'Kapphaphycus alvarezii, kekuatan gel, long line, produksi, rendemen', 'D143'),
(144, 'prosiding FORUM INOVASI TEKNOLOGI AKUAKULTUR', '-', '-', '-', '2009', 'PADAT PENEBARAN DAN UKURAN BENIH MENENTUKAN PERTUMBUHAN DAN SINTASAN BENIH ABALON (Haliotis squamata) DI KERAMBA JARING APUNG', 'Padat penebaran dan ukuran benih abalon (Haliotis squamata) pada awal pemeliharaan merupakan salah satu hal yang berperan dalam menunjang keberhasilan budidaya. Penelitian ini bertujuan untuk mengetahui\r\npertumbuhan dan sintasan abalon pada padat penebaran dan ukuran benih saat tebar yang berbeda di keramba jaring apung. Kelompok A merupakan benih abalon yang kecil dengan panjang cangkang 10,0 1,8 mm dan bobot badan 0,10 0,02 g. Sedangkan kelompok B merupakan benih yang lebih besar dengan\r\npanjang cangkang 18,78 2,08 mm dan bobot badan 0,87 0,03 g. Wadah yang digunakan 6 buah jaring yang berukuran 1 m x 1 m x 1 m. Sebagai subtrat penempel abalon, digunakan pipa PVC dengan dimeter 6 inci dengan ukuran panjang 30 cm sebanyak 10 buah tiap unit. Setiap jaring terdiri 4 unit ditempatkan digantung di dalam jaring. Kepadatan benih tiap-tiap kelompok masing-masing 50, 100, dan 200 ekor/m2 luas permukaan shelter. Pakan yang diberikan selama penelitian adalah rumput laut Gracilaria sp. dengan\r\nransum pakan diberikan berlebihan, dengan frekuensi pemberian pakan 3 kali/minggu. Setelah 90 hari pemeliharaan dari ketiga perlakuan kepadatan bahwa pada benih abalon yang berukuran kecil laju pertumbuhan spesifik panjang cangkang (0,92%, 0,96%, 0,97%/hari) lebih besar dibandingkan pada benih yang berukuran benih yang berukuran besar (0,34%, 0,37%, 0,41%/hari). Sintasan dari ketiga kepadatan benih abalon yang kecil (49%, 43%, 40%) lebih kecil dibandingkan pada benih yang besar (83%, 69%, 80%).\r\nPadat penebaran tidak memberikan pengaruh yang nyata terhadap laju pertumbuhan dan sintasan.', 'ukuranbenih, kepadatan, pertumbuhan, sintasan, abalon(Haliotissquamata)', 'D144'),
(145, 'prosiding FORUM INOVASI TEKNOLOGI AKUAKULTUR', '-', '-', '-', '2011', 'PEMANFAATAN RUMPUT LAUT Glacilaria DALAM PAKAN IKAN BERONANG, Siganus guttatus', 'Ikan beronang termasuk jenis ikan ............', 'rumput laut (Glacillaria); pakan buatan; ikan beronang (Siganus guttatus)', 'D145'),
(146, 'jurnal riset akuakultur', '9', '2', 'agustus', '2014', 'PRODUKSI ENZIM SELULASE DARI BAKTERI TS2b YANG DIISOLASI DARI RUMPUT LAUT DAN PEMANFAATANNYA DALAM MENGHIDROLISIS KULIT UBI KAYU DAN DAUN UBI KAYU SEBAGAI BAHAN BAKU PAKAN IKAN Irma', 'Upaya untuk mendapatkan bahan baku pakan alternatif masih perlu dilakukan\r\nmengingat makin meningkatnya harga pakan ikan. Salah satu bahan yang berpotensi untuk dimanfaatkan adalah kulit ubi kayu (KUK) dan daun ubi kayu (DUK). Tingginya kadar serat kasar khususnya selulosa dalam bahan baku tersebut, menjadi kendala dalam upaya pemanfaatannya. Penggunaan enzim selulase dapat menjadi alternatif untuk menangani masalah tersebut. Kemampuan komplek enzim selulase dari bakteri selulolitik dalam mendegradasi selulosa sangat beragam. Tujuan penelitian ini adalah memproduksi dan memanfaatkan enzim selulase dari bakteri yang diisolasi dari rumput laut untuk menghidrolisis KUK, DUK, dan selulosa murni (Carboxymethyl Cellulose). Penelitian ini dilaksanakan dalam dua tahap yaitu: pertama adalah produksi optimum enzim selulase dari bakteri TS2b dengan waktu inkubasi 24, 48, 72, 78, dan 96 jam dan kedua adalah tahap untuk mengetahui kemampuan enzim selulase bakteri TS2b dalam menghidrolisis KUK, DUK, dan Carboxymethyl Cellulose (CMC) (in vitro). Parameter yang diamati adalah aktivitas enzim selulase berdasarkan modifikasi metode Miller dan kadar gula pereduksi (glukosa) berdasarkan metode DNS. Hasil penelitian menunjukkan bahwa waktu optimum untuk produksi enzim selulase terjadi pada jam ke-78 yaitu sebesar 0,0214 U/mL dengan kadar glukosa yang dilepaskan sebesar 0,0231 mg/L. Daya hidrolisis enzim selulase tertinggi diperoleh pada substrat KUK dengan aktivitas enzim selulase dan kadar gula pereduksi yang dilepaskan berturutturut sebesar 0,0179 U/mL dan 0,9701 mg/L; sedangkan daya hidrolisis terendah diperoleh pada substrat DUK dengan aktivitas selulase sebesar 0,0015 U/mL dan kadar gula pereduksi yang dilepaskan sebesar 0,0787 mg/L. Enzim selulase isolat TS2b mempunyai kemampuan menghidrolisis substrat KUK dengan baik, tapi kurang efektif untuk menghidrolisis CMC dan DUK.', 'enzim selulase; kulit ubi kayu; daun ubi kayu; selulosa', 'D146'),
(147, 'jurnal riset akuakultur', '1', '3', 'desember', '2006', 'IDENTIFIKASI KELAYAKAN LOKASI LAHAN BUDIDAYA RUMPUT LAUT (Eucheuma sp) DI PERAIRAN TELUK TAMIANG, KABUPATEN KOTABARU, KALIMANTAN SELATAN', 'Kalimantan selatan memiliki sumber daya lahan perikanan pesisir yang cukup potensial untuk pengembangan budidaya rumput laut, namun demikian belum diperoleh data rinci kelayakanannya', 'natural resources; coastal; seaweed culture; site selection', 'D147'),
(148, 'prosiding FORUM INOVASI TEKNOLOGI AKUAKULTUR', '-', '-', '-', '2011', 'KULITAS AGAR-AGAR DARI RUMPUT LAUT Glacilaria chilensis YANG DIBUDIDAYAKAN DI LAMPUNG', 'Pengamatan kulitas agar-agar .................', 'agar-agar; rumput laut; Lampung', 'D148'),
(149, 'media akuakultur', '2', '2', 'desember', '2007', 'DINAMIKA PERTAMBAKAN PERIKANAN DI SULAWESI SELATAN KURUN WAKTU 1990-2005', 'Luas tambak tambak di Sulawesi Selatan mengalami peningkatan dari 70.707 ha pada tahun 1990 menjadi 96.002 ha pada tahun 2005, sedangkan luas yang siap tebar 64.494 ha pada tahun 1990 menjadi 90.540 ha pada tahun 2005. Hasil produksi total dari luasan tambak tersebut juga mengalami peningkatan dari 65.487,8 ton pada tahun 1990 menjadi 300.242,0 pada tahun 2005. Begitu pula produksi udang windu dari 11.945,6 ton menjadi 20.622,0 ton, dan produksi ikan bandeng dari 40.200 ton menjadi 58.715,4 ton. Peningkatan produksi tentunya akan lebih tinggi seandainya usaha pertambakan di Sulawesi Selatan tidak dilanda oleh wabah penyakit udang yang sampai saat ini belum bisa ditanggulangi secara tuntas. Pada tahun 2003 luas tambak udang di Sulawesi Selatan yang terserang penyakit mencapai 12.648 ha dengan kerugian material sebesar 9 milyar. Jenis komoditas selain udang windu dan ikan bandeng yang memberi kontribusi yang cukup besar pada peningkatan produktivitas tambak di Sulawesi Selatan adalah rumput laut jenis Gracilaria sp., dengan produksi total mencapai 210.510,0 ton.', 'tambak; produktivitas; udang; ikan; rumput laut', 'D149'),
(150, 'jurnal penelitian perikanan indonesia', '11', '8', '-', '2005', 'PENGARUH KONSENTRASI DAN RASIO LARUTAN POTASIUM HIDROKSIDA DAN RUMPUT LAUT TERHADAP MUTU KARAGINAN KERTAS', 'Penelitian perbaikan kualitas karaginan kertas yang diekstrak dari Eucheuma cottonii telah dilakukan dengan melakukan variasi larutan KOH 4o/o, 60/o, dan 12o/o. Rasio E. coffonii kering berbanding larutan KOH 1 \'.8 dan 1:12. Waktu pemasakan 2 jam pada kisaran suhu 70-80oC. E. cottonii yang telah dimasak tersebut kemudian diekstrak menggunakan air tawar pada suhu antara 90o-95oC selama 120 menit.', 'emperature; E. cottonii; KOH solution; sheet carrageenan', 'D150'),
(151, 'prosiding FORUM INOVASI TEKNOLOGI AKUAKULTUR', '-', '-', '-', '2011', 'PROSPEK PENGEMBANGAN TEKNOLOGI PENGOLAHAN RUMPUT LAUT DI INDONESIA', 'Besarnya potensi sumberdaya ...........', 'prospek; rumput laut', 'D151'),
(152, 'jurnal penelitian perikanan indonesia', '8', '6', '-', '2002', 'PENGARUH KOMBINASI PERLAKUAN KALIUM HIDROKSIDA DAN NATRIUM KARBONAT DALAM EKSTRAKSI NATRIUM ALGINAT TERHADAP KUALITAS PRODUK YANG DIHASILKAN', 'Penelitian ekstraksi sodium alginat (Na-alginat) telah dilakukan menggunakan rumput laut coklat Sargassum filipendula yang direndam di dalam larutan KOH: 0,25%, 0,50%, 0,75%, dan 1,0% dengan waktu perendaman setiap perlakuan 30 dan 60 menit.', 'brown seaweed; potassium hydroxide (KoH); sodium carbonate (Na2CO3); Na-alginate', 'D152'),
(153, 'buletin teknik litkayasa akuakultur', '4', '1', 'juni', '2005', 'KANDUNGAN KIMIAWI BEBERAPA JENIS RUMPUT LAUT DARI PANTAI SELATAN JAWA TENGAH', 'Abstrak bisa dilihat di Lampiran', '-', 'D153'),
(154, 'prosiding FORUM INOVASI TEKNOLOGI AKUAKULTUR', '-', '-', '-', '2011', 'BUDIDAYA MULTITROPIK UDANG WINDU (Penaeus monodon), NILA MERAH (Oreochromis niloticus), DAN RUMPUT LAUT (Kappaphicus alvarezii) DI TAMBAK', 'Budidaya multitopik adalah suatu sistem ....', 'multitropik; udang windu; nila merah; rumput laut; tambak', 'D154'),
(155, 'jurnal penelitian perikanan indonesia', '11', '4', '-', '2005', 'PENGARUH ALKALINISASI SELULOSA TERHADAP PRODUKSI SODIUM KARBOKSIMETIL SELULOSA', 'Penelitian pemanfaatan limbah pengolahan rumput laut sebagai bahan dasar untuk\r\npembuatan sodium karboksimetil selulosa lelah dilakukan.', 'alkalicellulose; sodium carboxymethyl cellulose', 'D155'),
(156, 'prosiding FORUM INOVASI TEKNOLOGI AKUAKULTUR', '-', '-', '-', '2011', 'PROSPEK PENGEMBANGAN PRODUK BERBASIS RUMPUT LAUT Echeuma spinosum DARI NUSA PENIDA, BALI', 'Rumput laut merupakan komoditas ........', 'Eucheuma spinosum; Nusa Penida; diversifikasi', 'D156'),
(157, 'media akuakultur', '2', '2', 'desember', '2007', 'RUMPUT LAUT JENIS CAULERPA DAN PELUANG BUDI DAYANYA DI SULAWESI SELATAN', 'Caulerpa merupakan salah satu komoditas rumput laut yang telah dimanfaatkan oleh masyarakat secara langsung sebagai makanan dalam bentuk lalapan dan sayuran. Di Sulawesi Selatan, Caulerpa yang dipanen dari laut sangat digemari bahkan telah diproduksi melalui usaha budi daya pada tambak-tambak terlantar di pinggir pantai. Produksi Caulerpa telah menjadi komoditas yang bernilai ekonomi dan diperjualbelikan di pasarpasar lokal dan telah menjadi sajian menu khas di sejumlah restoran menengah. Studi awal telah dilakukan di wilayah pesisir Sulawesi Selatan, yaitu untuk pengamatan lahan budi daya serta analisis proksimat terhadap spesies Caulerpa lentillifera, Caulerpa recemosa var macrophysa, dan Caulerpa sp. di tambak dan pantai. Terlihat bahwa kandungan air 3,09 1,03; abu 60,67 2,62; lemak 0,39 0,33; protein 7,93 2,32; serat kasar 13,33 8,33; dan BETN 17,67 3,88. Tekstur tanah dengan debu berpasir atau pasir berdebu cocok untuk budi daya Caulerpa, di mana budi daya dengan penerapan metode long-line kurang produktif.', 'Caulerpa; nutrisi; lahan; budi daya', 'D157'),
(158, 'buletin teknik litkayasa akuakultur', '3', '2', 'desember', '2004', 'ANALISIS SIFAT KIMIA DAN FISIK KAPPA KARAGINAN DARI RUMPUT LAUT JENIS Euchema cottoni', 'Abstrak bisa dilihat di Lampiran', '-', 'D158'),
(159, 'buletin teknik litkayasa akuakultur', '3', '2', 'desember', '2004', 'PEMBUATAN KARAGINAN KERING DARI RUMPUT LAUT', 'Abstrak bisa dilihat Lampiran', '-', 'D159'),
(160, 'jurnal riset akuakultur', '9', '3', 'desember', '2014', 'INTRODUKSI GEN METALLOTHIONEIN TIPE II KE DALAM RUMPUT LAUT Kappaphycus alvarezii MENGGUNAKAN Agrobacterium tumefaciens', 'Kappaphycus alvarezii adalah jenis alga merah yang memproduksi kappa karagenan yang sangat penting untuk industri makanan, farmasi, dan kosmetik. Untuk meningkatkan produksi, diperlukan ketersediaan bahan baku yang baik. Salah satu yang memengaruhi ketersediaan bahan baku adalah kondisi ingkungan perairan untuk budidaya. Metallothionein (MT) adalah protein yang memiliki kemampuan untuk mengikat ion logam seperti Cd, Zn, dan Cu. Tujuan penelitian ini adalah untuk mengintroduksi gen Metallothionein Tipe II (MaMt2) ke dalam genom K. alvarezii menggunakan Agrobacterium tumefaciens. Talus rumput laut diinokulasi dengan A. tumefaciens mengandung plasmid pIG6-SMt2 yang membawa gen MaMt2, selanjutnya dilakukan seleksi bertingkat menggunakan higromisin 10 mg/L dan 20 mg/L. Hasil efisiensi transformasi yang diperoleh adalah 27,4%, efisiensi regenerasi tunas transgenik adalah 27,6%. Analisis molekuler dengan PCR menunjukkan bahwa 13 tunas transgenik mengandung gen MaMt2. Tunas transgenik putatif ditumbuhkan hingga menjadi talus baru dan dapat dilakukan uji tantang pada penelitian selanjutnya.', 'Kappaphycus alvarezii; MaMt2; transformasi genetik; alga merah', 'D160'),
(161, 'prosiding FORUM INOVASI TEKNOLOGI AKUAKULTUR', '-', '-', '-', '2009', 'PEMANFAATAN OCEAN-COLORREMOTESENSING UNTUK PENGELOLAANSUMBERDAYA PERIKANANBUDIDAYA', 'Trend produksi perikanan menunjukkan bahwa perikanan budidaya mengalami peningkatan produksi dari tahun ke tahun jika dibandingkan dengan perikanan tangkap yang produksinya cenderung stabil atau bahkan menurun. Kegiatan perikanan budidaya secara umum dapat dikategorikan ke dalam budidaya\r\nrumput laut, kekerangan (moluska), dan ikan dalam keramba jaring apung, serta ikan/udang/rumput laut di tambak. Peningkatan produksi perikanan budidaya tidak terlepas dari berbagai masalah yang dihadapi di antaranya identifikasi kelayakan lahan dan pengaruh lingkungan yang ditimbulkan oleh kegiatan perikanan budidaya. Efek yang ditimbulkan oleh kegiatan perikanan budidaya tentunya dapat diminimalkan melalui perencanaan dan pengelolaan yang baik yang disesuaikan dengan kondisi dan kapasitas lingkungan. Dewasa\r\nini dengan makin berkembangnya teknologi, penginderaan jauh inderaja/remote sensing) sudah mulai dimanfaatkan untuk perikanan budidaya. Kajian yang sering dilakukan dengan menggunakan inderaja meliputi: kajian kelayakan lahan (zoning), efek kegiatan budidaya terhadap lingkungan, konflik kepentingan\r\nantara perikanan budidaya dengan sektor lainnya, dan monitoring perikanan budidaya.', 'pengelolaansumberdaya, budidayaperikanan, oceancolorremotesensing (OCRS)', 'D161'),
(162, 'buletin teknik litkayasa akuakultur', '3', '2', 'desember', '2004', 'KANDUNGAN KIMIAWI BEBERAPA JENIS RUMPUT LAUT', 'Abstrak bisa dilihat di Lampiran', '-', 'D162'),
(163, 'prosiding FORUM INOVASI TEKNOLOGI AKUAKULTUR', '-', '-', '-', '2009', 'PRODUKSI MASSAL BENIH ABALON, Haliotis squamata (Reeve, 1846)', 'Budidaya abalon di dunia saat ini masih terus dikembangkan untuk memenuhi permintaan pasar yang semakin meningkat, di samping itu, harga jual abalon yang cukup tinggi dan cenderung terus meningkat juga merupakan salah satu daya tarik dalam pengembangannya. Di Indonesia pengembangan budidaya\r\nabalon jenis Haliotis squamata juga terus dilakukan, namun masih menghadapi kendala dalam penyediaan benih baik dari segi jumlah, ukuran, dan waktu. Oleh karena itu, pengembangan teknologi pembenihan abalon di hatcheri telah dilakukan di Balai Besar Riset Perikanan Budidaya Laut, Gondol dengan melakukan pemeliharaan dalam bak secara terkontrol untuk memproduksi benih abalon skala massal. Produksi benih abalon dihasilkan melalui pemijahan alami induk abalon dari alam dengan ukuran panjang cangkang 7,13 0,02 cm dan bobot 64,49 3,5 g (ratio jantan dan betina 1:2). Pemeliharaan larva dilakukan dalam bak semen berukuran 10 m3 dan 6 m3 menggunakan plastik pergelombang yang digantung dalam bak pemeliharaan sebagai substrat dan media pakan alami. Penumbuhan pakan alami dilakukan 2 minggu\r\nsebelum penebaran. Jenis pakan alami yang tumbuh dan dimanfaatkan oleh larva, di antaranya adalah diatom dari jenis Nitzschia sp., Melosira sp., Thalassionema sp., Navicula sp., Cocconeis sp. Ketika memasuki\r\numur 1,5-2 bulan, benih mulai dirangsang dengan pemberian pakan rumput laut dari jenis Gracilaria sp. dan Ulva sp. Pada umur 2 bulan, benih dipindahkan ke bak pendederan sampai berukuran 1,5-2 cm. Sintasan rata-rata yang diperoleh pada umur 60 hari sebesar 6,46%. Produksi benih selama 4 siklus dengan\r\nukuran 1,5 2 cm sebanyak 13.898 ekor. Selanjutnya adalah pemeliharaan lanjutan benih di keramba jaring apung.', 'benihabalon, H. squamata, produksi', 'D163'),
(164, 'jurnal penelitian perikanan indonesia', '2', '1', '-', '1996', 'KOMANAJEMEN SUMBER DAYA ANTARA PEMERINTAH DESA, LEMBAGA ADAT DAN MASYARAKAT (KASUS KAWASAN PANTAI DESA JUNGUT BATU, NUSA PENIDA, BALI)', 'Tujuan dari tulisan ini adalah untuk melihat proses terjadinya pengelolaan sumber daya alam secara bersama (komanajemen). Komanajemen oleh pemerintah dan masyarakat dianggap sebagai tipe pengelolaan yang cukup efektif di Desa Jungut Batu, Nusa Penida, Bali. Hal ini ditunjukkan dengan meningkatnya pendapatan dan kesempatan kerja di bidang budidaya rumput laut.', 'Co-management; collaboration; income; employment', 'D164'),
(165, 'jurnal penelitian perikanan indonesia', '9', '5', '-', '2003', 'PENGARUH KONSENTRASI LARUTAN POTASIUM HIDROKSIDA TERHADAP MUTU KAPPA-KARAGINAN YANG DIEKSTRAKSI DARI Eucheuma cottoni', 'Perbaikan teknik ekstraksi kappa karaginan dari rumput laul Eucheuma cottoniitelah dilakukan dengan menggunakan variasi konsentrasi larutan KOH sebagai media pengekstrak.', 'KOH solution; kappa carrageenan; Eucheuma coftonii', 'D165'),
(166, 'jurnal penelitian perikanan indonesia', '7', '4', '-', '2001', 'PENGARUH KONSENTRASI BAHAN PEMUCAT DAN JENIS BAHAN PENGENDAP TERHADAP PEMBENTUKAN SODIUM ALGINAT DARI RUMPUT LAUT COKLAT Sargassum filipendula C. AGARTH', 'Penelitian perbaikan kualitas sodium alginat telah dilakukan dengan menggunakan tiga konsentrasi hidrogen peroksida (H2O2) sebagai bahan pemucat yaitu 3%, 6%, dan 9% (v/v) yang kemudian diendapkan menggunakan dura jenis bahan pengendap yaitu sodium karbonat (NarCOr) 5% (b/v) dan sodium hidroksida (NaOH) 5% (b/v).', 'hydrogen peroxide; sodium carbonate; sodium hydroxide; brown seawee4 sodium alginate', 'D166'),
(167, 'BAWAL Widya riset perikanan tangkap', '2', '4', 'april', '2009', 'TUMBUHAN AIR DI DANAU LIMBOTO, GORONTALO: MANFAAT DAN PERMASALAHANNYA', 'Danau Limboto cenderung semakin hari, semakin menurun luasnya. Luas danau pada tahun 1932 mencapai 8.000 ha, pada tahun 1970 menurun menjadi 4.500 ha. Pada tahun 1993, perairan ini mengalami penurunan luasnya menjadi 3.057 ha dengan kedalaman maksimumnya 2,3 m dan pada tahun 2004 tersisa 3.000 ha. Masalah pendangkalan dengan laju sedimentasi 1,5 cm per tahun dan perkembangan populasi tumbuhan air (rumput liar dan eceng gondok, Eichhornia crassipes) yang telah mencapai luas 9.420 m2menjadi ancaman bagi sumber daya perikanan di danau tersebut. Tujuan dari tulisan ini adalah untuk mengetahui jenis tumbuhan air serta menggambarkan kondisinya di Danau Limboto beserta manfaat dan permasalahannya. Hasil pengamatan menunjukkan bahwa\r\ndi Danau Limboto ditemukan 9 jenis tumbuhan air, meliputi tipe tumbuhan yang muncul di tepian danau, yang tenggelam dan berakar di dasar, dan yang mengapung bebas ataupun yang berakar. Jenis tumbuhan yang dominan adalah eceng gondok yang telah menjadi gulma.', 'tumbuhan air; Danau Limboto; Gorontalo', 'D167'),
(168, 'prosiding FORUM INOVASI TEKNOLOGI AKUAKULTUR', '-', '-', '-', '2014', 'PROSPEK SUMBERDAYA PERIKANAN DAN SOSIAL EKONOMI DI KABUPATEN BERAU, KALIMANTAN TIMUR (Studi Kasus Pengelolaan Sumberdaya Perikanan di Kabupaten Berau, Kalimantan Timur)', 'Aspek sosial ekonomi merupakan bagian dari potensi perikanan budidaya yang bertujuan untuk mendapatkan gambaran pengembangan budidaya perikanan secara parsial, dan diharapkan menjadi bahan pertimbangan untuk pembangunan perikanan daerah Kabupaten Berau, Survei dilaksanakan menggunakan metode Pemahaman Pedesaan dalam Waktu Singkat (PPWS), Data primer diperoleh dari observasi dan wawancara dengan Nelayan Tangkap kelompok nelayan pembudidaya dan data sekunder yang diperoleh dari intansi yang terkait. Tipologi perikanan di Kabupaten Berau terdiri atas perikanan tangkap (di laut dan perairan umum), budidaya (air payau dan air tawar), dan pasca panen. Panjang Garis pantai Kabupaten Berau 629,2 km. Produksi perikanan Kabupaten Berau tahun 2010 sebesar 7.996 ton, atau 7% dari total produksi perikanan KalimantanTimur,  79,5% berasal dari perikanan tangkap, 13,3%, dari hasil budidaya air payau (tambak dan karamba) sisanya 7,2% dari perairan umum berupa rawa dan  Sungai (Sungai Mahakam). Produksi perikanan yang dimanfaatkan baru sekitar 11,2%. Potensi perikanan perairan umum yang cukup besar  membutuhkan penanganan secara terpadu untuk memperoleh hasil yang optimal.  Optimalisasi lahan tambak potensial dengan menerapkan teknologi remediasi tanah dasar untuk polikultur udang windu dengan bandeng dan mono kultur udang secara ekstensif, meningkatkan produktivitas tambak hingga 300%. Kelembagaan pengelolaan sumber daya perikanan, kelembagaan perencanaan, kelembagaan pengelolaan, kelembagaan pengawasan,  pembiayaan perikanan non formal dalam pengelolaan  sumbedaya pantai, serta laut perlu diterapkan. Prospek perdagangan ikan segar akan semakin jauh pemasarannya apabila tersedia kredit modal kerja bagi pedagang ikan,ditunjang dengan pengadaan TPI yang akan memberikan kontribusi pendapatan yang lebih besar bagi daerah. Komoditi hasil laut seperti rumput laut, teripang dan lobster yang memiliki nilai ekonomi tinggi perlu dipertimbangkan untuk dibudidayakan. Prospek pengembangan sumberdaya perikanan, melalui budidaya tambak, pola pengembangan perikanan lepas pantai, dan  perencanaan pasar antar pulau dengan memanfaatkan faktor keunggulan komparatif wilayah dengan mempertimbangkan kemampuan sumberdaya perikanan, sumber daya manusia, prasarana dan sarana yang tersedia. diharapkan dapat meningkatkan percepatan pemanfaatan sumberdaya perikanan secara optimal.', 'prospek; sumberdaya perikanan; sosial ekonomi; Kabupaten Berau', 'D168'),
(169, 'jurnal riset akuakultur', '8', '1', 'april', '2013', 'KARAKTERISTIK GENETIK Kappaphycus alvarezii SEHAT DAN TERINFEKSI PENYAKIT ICE-ICE DENGAN METODE Amplified Fragment Length Polymorphism (AFLP)', 'Infeksi penyakit ice-ice pada Kappaphycus alvarezii seringkali menyebabkan penurunan produksi yang sangat signifikan. K. alvarezii merupakan alga merah penghasil karaginan yang memiliki nilai ekonomi tinggi dan banyak dimanfaatkan dalam berbagai industri, seperti farmasi, makanan, stabilizer, dan kosmetik. Perbaikan genetik sangat diperlukan untuk meningkatkan produksi. Penelitian ini bertujuan untuk mengetahui karakteristik kemiripan genetik K. alvarezii sehat dan terinfeksi penyakit dari Balai Penelitian dan Pengembangan Budidaya Air Payau (BPPBAP), Maros dengan metode Amplified Fragment Length Polymorphism (AFLP). Pada penelitian ini juga dianalisis K. alvarezii asal Bone (BNE), Gorontalo (GRL), Tambalang (TMB), dan Kendari (KND) sebagai kontrol rumput laut sehat. Metode AFLP menggunakan enzim restriksi Psti dan Mset, preamplifikasi dan amplifikasi selektif diawali dengan isolsi DNA, uji genimoc DNA, restriksi dan ligasi. Hasil yang diperoleh menunjukkan penggunaan marker AFLP dengan primer forward P11 dan primer reverse M48, M49 dan M50 terhadap K. alvarezii yang berasal dari Takalar (TKL), dan Mataram (MTR), tanpa infeksi (sehat) dan terinfeksi penyakit Takalar ice (TKL+), Mataram ice (MTR+), serta K. alvarezii kontrol (BNE), (GRL), (TMB), dan (KND) menghasilkan 519 fragmen dalam 122 lokus dengan ukuran 50 - ~370 pb. Kemiripan genetik K. alvarezii yang terinfeksi penyakit ice-ice lebih rendah jika dibandingkan dengan yang sehat. Kemiripan genetik K. alvarezii dari Takalar sehat (TKL) dan terinfeksi ice-ice (TKL+) adalah 0,8176 dan MTR-MTR+ adalah 0,8033.', 'identifikasi fragmen; Kappaphycus alvarezii; penyakit ice-ice; AFLP', 'D169'),
(170, 'jurnal kelautan nasional', '11', '3', 'desember', '2016', 'ANALISIS PEMANFAATAN DATA KUALITAS PERAIRAN UNTUK PERENCANAAN ZONASI PESISIR', 'Perairan pesisir pulau Wangi-wangi di kabupaten Wakatobi, Sulawesi Tenggara telah mengalami tekanan aktifitas manusia (antropogenik) sejak menjadi kabupaten baru tahun 2003. Tekanan antropogenik diukur menggunakan parameter kualitas air (suhu dan oksigen terlarut). Tujuan riset ini adalah menganalisis pemanfaatan data pemonitoran waktu serial dan pemanfaatannya untuk perencanaan zonasi perairan, yang dikaitkan dengan data parameter kualitas air. Dinamika perairan pesisir telah terjadi pada musim angin timur dan barat, pada kedalaman 5 meter dan 25 meter. Hasil menunjukkan kegunaan data waktu serial untuk dinamika zonasi perairan pesisir. Bagian timur dan utara perairan direkomendasikan untuk zona konservasi, sementara zona pemanfaatan lainnya dialokasikan buat sub-zona perikanan berkelanjutan (rumput laut)', 'zona, data waktu serial, parameter kualitas air, oksigen terlarut', 'D170'),
(171, 'prosiding FORUM INOVASI TEKNOLOGI AKUAKULTUR', '-', '-', '-', '2011', 'JENIS DAN KOMPOSISI PLANKTON PADA BUDIDAYA POLIKULTUR UDANG WINDU, UDANG VANAME, IKAN BANDENG, DAN RUMPUT LAUT DI TAMBAK', 'Penelitian bertujuan mengetahui kondisi ...........', 'jenis; komposisi; plankton; polikultur; tambak', 'D171'),
(172, 'buletin teknik litkayasa akuakultur', '11', '1', 'juni', '2013', 'ANALISIS TANAH TAMBAK DI KABUPATEN KONAWE SELATAN PROVINSI SULAWESI TENGGARA', 'Komoditas udang, ikan bandeng, dan rumput laut merupakan komoditas yang penting dikembangkan di Kabupaten Konawe Selatan Provinsi Sulawesi Tenggara, karena permintaan pasar yang masih cukup besar. Lahan tambak harus diperhatikan karena merupakan media untuk hidup dan tumbuh bagi komoditas tersebut. Salah satu lingkungan fisik penyusun lahan adalah tanah. Dengan mengetahui kualitas tanah tambak maka perlakuan terhadap tambak tersebut dapat disesuaikan dengan teknologi yang akan diterapkan. Penelitian dengan contoh tanah tambak diambil pada 71 titik di 4 kecamatan yaitu Kecamatan Tinanggea, Pallangga Selatan, Laeya, dan Lainea pada\r\nkedalaman 0-0,2 m dan 0,2-0,4 m dari permukaan. Hasil analisis tanah tambak adalah bahwa pHF tertinggi terdapat pada Kecamatan Tinanggea pada kedalaman 0-0,20 m yaitu 7,39 sedang pHFOX terendah didapatkan pada Kecamatan Laeya yaitu 0,74. Hasil pengukuran potensial redoks pada umumnya menunjukkan nilai negatif menandakan keadaan tanah tambak di kabupaten tersebut dalam keadaan tereduksi. Kandungan bahan organik tertinggi terdapat di Kecamatan Tinanggea adalah 30,63% dan terendah juga terdapat di Kecamatan Tinanggea yaitu < 0,01%. Kandungan N-total tertinggi terdapat di Kecamatan Tinanggea adalah 0,56% dan terendah juga terdapat di Kecamatan tersebut yaitu 0,03%. Kandungan fosfat tertinggi juga terdapat di Kecamatan\r\nTinanggea yaitu 233,4 mg/L dan yang terendah pun di Kecamatan Tinanggea yaitu 7,49 mg/L.', '-', 'D172'),
(173, 'prosiding FORUM INOVASI TEKNOLOGI AKUAKULTUR', '-', '-', '-', '2012', 'PENENTUAN POTENSI LAHAN DAN PROFIL BUDIDAYA TAMBAK DI KABUPATEN GRESIK PROVINSI JAWA TIMUR', 'Kabupaten Gresik dihadapkan pada masalah pembangunan yang kurang memperhatikan penataan ruang di mana lahan tambak terancam alih fungsi lahan untuk permukiman, pengembangan kota, dan industri. Sebagai salah satu kawasan Minapolitan di Indonesia, maka profil budidaya tambak di Kabupaten Gresik perlu mendapat perhatian. Oleh karena itu, dilakukan penelitian yang bertujuan untuk mengetahui potensi lahan tambak dan profil budidaya tambak di Kabupaten Gresik untuk mendukung program Minapolitan. Teknologi penginderaan jauh dan sistem informasi geografis diaplikasikan dalam penentuan potensi lahan budidaya tambak. Profil budidaya tambak diketahui dari pengamatan di lapangan dan dari berbagai informasi yang ada. Hasil penelitian menunjukkan bahwa luas tambak di Kabupaten Gresik pada tahun 2011 mencapai 30.904,5 ha. Perikanan budidaya yang ada di Kabupaten Gresik terdiri atas budidaya tambak (payau) dan budidaya sawah tambak dengan komoditas unggulan adalah udang vaname, ikan bandeng, nila, kakap, kerapu, bawal, tawes, kepiting, tombro, patin, dan lele, serta rumput laut. Pembenihan di Kabupaten Gresik baik skala rumah tangga maupun hatcheri belum ada, yang ada adalah kegiatan penggelondongan udang dan pentokolan bandeng.', 'potensi; profil; lahan; tambak; Kabupaten Gresik', 'D173'),
(174, 'jurnal riset akuakultur', '9', '1', 'april', '2014', 'KARAKTERISTIK, KESESUAIAN, DAN PENGELOLAAN LAHAN UNTUK BUDIDAYA DI TAMBAK KABUPATEN POHUWATO PROVINSI GORONTALO', 'Kabupaten Pohuwato di Provinsi Gorontalo telah ditetapkan sebagai salah satu kabupaten/kota untuk lokasi pengembangan Kawasan Minapolitan di Indonesia, namun produktivitas tambaknya masih tergolong relatif rendah. Oleh karena itu, dilakukan penelitian untuk mengetahui karakteristik lahan dalam upaya menentukan kesesuaian dan pengelolaan lahan untuk budidaya di tambak demi peningkatan produktivitas tambak, serta penentuan Rencana Tata Ruang Wilayah di Kabupaten Pohuwato. Faktor yang dipertimbangkan dalam mengetahui karakteristik lahan adalah: topografi, tanah, hidrologi, dan iklim. Analisis spasial dalam Sistem Informasi Geografis digunakan dalam penentuan kesesuaian lahan untuk budidaya tambak. Pengelolaan lahan ditentukan berdasarkan karakteristik lahan yang disesuaikan dengan teknologi dan komoditas yang dapat diaplikasikan di tambak. Hasil penelitian menunjukkan bahwa karakteristik lahan tambak di Kabupaten Pohuwato ditunjukkan oleh topografi yang bentuk wilayahnya relatif datar dan berelevasi rendah, tanah didominasi oleh tanah sulfat masam, kualitas air maupun pasang surut dapat mendukung usaha budidaya di tambak, dan curah hujan tergolong rendah. Dari luas tambak yang ada di Kabupaten Pohuwato yaitu 5.368,2 ha ternyata 1.954,4 ha tergolong cukup sesuai (Kelas S2), 2.556,2 ha tergolong kurang sesuai (Kelas S3), dan 857,6 ha tergolong tidak sesuai (Kelas N). Sebagai faktor pembatas budidaya di tambak adalah kemasaman tanah yang tinggi, kandungan bahan organik tanah yang tinggi, dan tekstur yang tergolong kasar, sehingga pengelolaan lahan yang dilakukan adalah remediasi untuk menurunkan kemasaman tanah, pemberian pupuk yang mengandung nitrogen untuk mempercepat proses penguraian bahan organik dan pemberian pupuk kandang untuk lokasi yang rendah kandungan bahan organiknya untuk memperbaiki struktur tanah dasar tambak. Sistem dan teknologi budidaya yang disarankan adalah monokultur udang dengan teknologi tradisional dan tradisional plus untuk tambak yang tergolong cukup sesuai (Kelas S2) dan monokultur ikan bandeng atau polikultur ikan bandeng dan rumput laut dengan teknologi tradisional untuk tambak yang tergolong kurang sesuai (Kelas S3). ', 'karakteristik; kesesuaian; pengelolaan; tambak; Kabupaten Pohuwato', 'D174');
INSERT INTO `tbjurnal` (`Id`, `sumber`, `volume`, `nomor`, `bulan`, `tahun`, `judul`, `abstrak`, `katakunci`, `nm_dk`) VALUES
(175, 'prosiding FORUM INOVASI TEKNOLOGI AKUAKULTUR', '-', '-', '-', '2012', 'PENENTUAN POTENSI LAHAN DAN PROFIL BUDIDAYA TAMBAK DI KABUPATEN LAMONGAN, PROVINSI JAWA TIMUR', 'Kabupaten Lamongan merupakan salah satu daerah sentra pengembangan perikanan budidaya yang telah lama dikenal di Indonesia yang masih memiliki berbagai masalah dalam pemanfaatan lahan. Sebagai salah satu kawasan Minapolitan di Indonesia, maka profil budidaya tambak di Kabupaten Lamongan perlu mendapat kajian khusus. Oleh karena itu, dilakukan penelitian yang bertujuan untuk mengetahui potensi lahan tambak dan profil budidaya tambak di Kabupaten Lamongan untuk mendukung program Minapolitan. Potensi lahan budidaya tambak ditentukan dengan aplikasi teknologi penginderaan jauh dan sistem informasi geografis. Profil budidaya tambak diketahui dari pengamatan di lapangan dan dari berbagai informasi yang ada. Hasil penelitian menunjukkan bahwa potensi luas tambak di Kabupaten Lamongan tahun 2011 sebesar 25.313 ha, berbeda 113 ha dari data statistik perikanan Kabupaten Lamongan tahun 2009 (25.200 ha). Pematang tambak tidak sesuai dengan standar pematang tambak pada umumnya, lokasi tambak telah bersih dan tertata dengan baik. Di sebagian kawasan budidaya, jalan produksi berbahan beton telah dibangun untuk menghubungkan antara satu tambak dengan tambak lainnya. Pada saat tertentu saluran air dan sungai ditumbuhi oleh eceng gondok. Tumbuhan ini telah menghambat sirkulasi air tambak dan transportasi sungai. Keberadaan kelompok produksi perikanan telah terbukti membantu pembudidaya dalam memanajemen pengadaan bibit, sarana produksi, proses produksi, dan penanganan pasca panen. Komoditas yang dibudidayakan di tambak adalah bandeng, kerapu, vaname, dan rumput laut, sedangkan komoditas yang dibudidayakan di sawah tambak adalah bandeng, vaname, dan lele.', 'potensi; profil; lahan; tambak; Kabupaten Lamongan', 'D175'),
(176, 'prosiding FORUM INOVASI TEKNOLOGI AKUAKULTUR', '-', '-', '-', '2013', 'PEMELIHARAAN INDUK IKAN LETTER SIX (Paracanthurus hepatus) PADA BAK TERKONTROL', 'Sampai saat ini hampir seluruh ekspor ikan hias laut berasal dari hasil tangkapan di alam, sehingga menyebabkan banyaknya permintaan jauh melebihi jumlah produksi yang ada bahkan beberapa jenis sudah mulai langka. Oleh karena itu, perlu dilakukan upaya pembudidayaan ikan hias air laut. Wadah yang digunakan untuk pemeliharaan induk bak fiberglass volume 2 m3 diisi ikan letter six sebanyak 39 ekor dengan ukuran induk 12-19 cm. Pakan yang diberikan berupa udang jembret (mysid), cacing Nereis, ikan teri, kerang darah, rumput laut, dan benthic alga lainya. Pergantian air dengan air mengalir. Pemijahan terjadi setelah 3 bulan pemeliharaan yaitu pada bulan Juni. Pemijahan terjadi pada bulan Juni sampai Juli. Pemijahan kembali terjadi pada bulan September sampai Desember. Jumlah telur yang dihasilkan sangat bervariasi 160-50.700 butir, dengan tingkat fertilitas 0%-98%. Diameter telur 660-730  m, oil globule 150- 183  m, dan derajat tetas larva yang dihasilkan dapat  mencapai 98%.', 'pemeliharaan, perkembangan, induk, larva, pakan, blue tang', 'D176'),
(177, 'media akuakultur', '9', '2', 'desember', '2014', 'POTENSI PENGEMBANGAN BUDIDAYA ABALON DI NUSA PENIDA, BALI', 'Abstrak lengkap dapat dilihat di file PDF', 'abalon; budidaya; rumput laut; nusa penida', 'D177'),
(178, 'jurnal riset akuakultur', '10', '3', 'september', '2015', 'ANALISIS SPASIAL DAN TEMPORAL KONDISI KUALITAS PERAIRAN MELALUI PENDEKATAN STATISTIK MULTIVARIAT DI TELUK GERUPUK PROVINSI NUSA TENGGARA BARAT', 'Kondisi kualitas perairan dipengaruhi oleh aktivitas antropogenik dan proses alami. Statistik multivariat, seperti analisis klaster (cluster analysis/CA) dan analisis komponen utama (principal component analysis/PCA), telah digunakan dalam penelitian ini untuk menganalisis kondisi kualitas perairan dan mengidentifikasi parameter kualitas air yang memengaruhi secara keruangan (spasial) dan waktu (temporal) di kawasan Teluk Gerupuk, Nusa Tenggara Barat. Data kondisi kualitas perairan di 16 titik pengamatan dikumpulkan selama enam bulan program pemantauan dari bulan Juli-Desember 2013. Hasil penelitian menunjukkan bahwa CA mengklasifikasikan enam bulan pengamatan menjadi dua periode; periode satu: Juli-September 2013, dan periode dua: Oktober-Desember 2013. Pengelompokkan ini berhubungan dengan pola musim tanam rumput laut di lokasi penelitian. CA juga mengklasifikasikan stasiun pengamatan menjadi tiga kelompok besar sesuai dengan kesamaan karakteristik kualitas air. PCA yang diaplikasikan pada seluruh data menghasilkan empat komponen utama dengan ragam kumulatif 69,93%. Analisis PCA selama enam bulan pengamatan (Juli-Desember) menunjukkan bahwa parameter utama yang memengaruhi variasi kualitas air terutama adalah: suhu, pH, dan konduktivitas. Penelitian ini menunjukkan efektivitas statistik multivariat untuk analisis dan interpretasi kondisi kualitas perairan baik secara spasial dan temporal. Pendekatan ini dapat berguna bagi pengelolaan dan evaluasi kondisi kualitas perairan.', 'kualitas air; multivariat statistik; analisis klaster; analisis komponen utama; Teluk Gerupuk', 'D178'),
(179, 'jurnal kelautan nasional', '9', '3', 'desember', '2014', 'UJI PERFORMANSI BUOY PLUTO UNTUK PERINGATAN DINI PENCEMARAN PERAIRAN', 'Aplikasi buoy (pelampung) untuk berbagai keperluan di Indonesia sudah bukan hal yang baru. Ada yang dipergunakan untuk navigasi, pemantauan tsunami, penelitian, perikanan dan energi. Kementerian Kelautan dan Perikanan (KKP) telah mengembangan buoy PLUTO (singkatan Perairan selaLU termoniTOr) tahun 2010. Awalnya buoy PLUTO ini dipergunakan untuk memantau kualitas perairan budidaya rumput laut di Wakatobi dengan sistem non-telemetri. Tahun 2013 dikembangkan kapasitasnya memiliki sistem telemetri. Hasilnya diujikan untuk peringatan dini pencemaran di perairan pelabuhan perikanan Pekalongan. Hasilnya menunjukkan hal positif bahwa dengan memakai 3 sensor saja, yaitu suhu, salinitas dan oksigen terlarut (DO), pencemaran yang terjadi dapat terdeteksi. Demikian pula sistem telemetri berjalan dengan baik.', 'buoy PLUTO, salinitas, suhu, oksigen terlarut (DO), telemetri', 'D179'),
(180, 'media akuakultur', '5', '2', 'desember', '2010', 'KERAGAAN BUDIDAYA TAMBAK DI SULAWESI SELATAN DENGAN MENGGUNAKAN DATA SENSUS', 'Data sensus yang runut waktu dari perikanan budidaya tambak telah tersedia yang diharapkan dapat digunakan semaksimal mungkin agar dapat memberikan informasi yang maksimal pula. Oleh karena itu, dilakukan suatu kegiatan yang memanfaatkan data runut waktu dari perikanan budidaya tambak di Sulawesi Selatan untuk menginformasikan keragaan budidaya tambak termasuk daya dukung ekonomis tambak. Data yang digunakan adalah data yang berasal dari Laporan Statistik Perikanan Sulawesi Selatan dari tahun 1985 sampai 2004. Keragaan budidaya tambak yang diinformasikan meliputi: perubahan luas, produksi dan produktivitas tambak pada tiga pantai yang berbeda di Sulawesi Selatan serta produksi berdasarkan kelompok komoditas. Analisis daya dukung ekonomis tambak ditentukan dengan metode analisis regresi polinomial. Hasil kegiatan ini menunjukkan bahwa luas tambak di Sulawesi Selatan (termasuk Sulawesi Barat) meningkat dari 64.741 ha pada tahun 1985 menjadi 111.425 ha pada tahun 2004. Produksi total tambak tertinggi pada tahun 1985 didapatkan di pantai barat yang mencapai 26.323,9 ton yang didominasi oleh ikan dan pada tahun 2004 didapatkan di pantai timur yang mencapai 66.294,1 ton yang didominasi oleh rumput laut. Produktivitas tambak tertinggi pada tahun 1985 didapatkan di pantai barat yaitu 772,2 kg/ha/tahun dan pada tahun 2004 didapatkan di pantai timur yaitu 7.127,6 kg/ha/tahun. Lahan Kabupaten Pinrang yang merupakan sentra produksi tambak di Sulawesi Selatan, hanya bisa mendukung luas total tambak sekitar 13.136 ha dan daya dukung ekonomis tambak hanya bisa memproduksi udang dan ikan sekitar 1.286 kg/ha/tahun.', 'sensus; keragaan; tambak; Sulawesi Selatan', 'D180'),
(181, 'prosiding FORUM INOVASI TEKNOLOGI AKUAKULTUR', '-', '-', '-', '2014', 'TEKNOLOGI PEMBESARAN ABALON (Haliotis squamata) MELALUI SISTEM RESIRKULASI SEMI TERTUTUP', 'Penelitian pembesaran abalon dengan sistem resirkulasi semi tertutup mempunyai tujuan untuk mendapatkan teknik pembesaran abalon H. squamata yang lebih efisien dan optimal dalam peningkatan pertumbuhan serta sintasannya. Metode resirkulasi semi tertutup dibuat dengan menggunakan bak yang terdiri dari bak filter pasir (sand filter), bak penampungan (reservoir) dan bak pemeliharaan abalon. Bak penampungan diberi bio-block dan dilengkapi pompa dengan kapasitas air 280 l/min (400 watt), Bak pemeliharaan abalon berupa bak beton ukuran PxLxT= 170 cm x 80 cm x 70 cm. Sebagai perlakuan adalah R-1: kepadatan rendah (10% area=19 ekor), R-2: kepadatan normal (40% area= 74 ekor), dan R-3: kepadatan tinggi (70% area = 130 ekor). Selama penelitian, abalon diberikan pakan berupa rumput laut Gracillaria sp. asal tambak dengan dosis adlibitum. Hasil yang diperoleh menunjukkan ukuran panjang cangkan mutlak, peningkatan pertumbuhan dan pertumbuhan harian untuk masing-masing perlakuan berturut-turut adalah untuk perlakuan R-1: 17,06 mm, 61,60 %, 115,67  m; perlakuan R-2: 19,61 mm, 37,84%, 69,23  m; perlakuan R3: 9,13 mm, 37,83 %, 61,29  m. Bobot badan mutlak, peningkatan pertumbuhan dan pertumbuhan harian masing-masing perlakuan berturut-turut adalah untuk perlakuan R-1: 12,19 g, 322,04%, 81,30  g; perlakuan R-2: 6,08 g, 174,36%, 40,56  g; perlakuan R-3: 4,22 g, 167,69%, 28,15  g. Sintasan pada masing-masing perlakuan sebesar R-1: 89,65 2,19%, R-2: 91,51 3,25% dan R-3: 78,54 5.59%. Dapat disimpulkan bahwa kepadatan awal tebar 40% area memberikan hasil terbaik untuk pembesaran abalon dengan sistem resirkulasi semi-tertutup', 'abalon; Haliotis squamata; pembesaran; resirkulasi semi-tertutup; sintasan', 'D181'),
(182, 'prosiding FORUM INOVASI TEKNOLOGI AKUAKULTUR', '-', '-', '-', '2015', 'STUDI APLIKASI BAKTERI SELULOLITIK Bacillus subtilis TS2B UNTUK MENINGKATKAN KUALITAS BAHAN BAKU DAUN SINGKONG BERDASARKAN UJI GLUKOSA DAN PROTEIN TERLARUT', 'Upaya pencarian alternatif bahan baku pakan non impor potensial perlu terus dikembangkan untuk menghindari keterpurukan pembudidaya air tawar, akibat dampak peningkatan biaya produksi yang tidak diimbangi dengan harga jual komoditas yang sesuai. Salah satu cara yang ditempuh adalah dengan memanfaatkan bakteri selulolitik untuk memperbaiki kualitas bahan baku nabati lokal yang potensial. Kandidat bakteri selulolitik yang telah berhasil diisolasi oleh BPPBAT Bogor selama 2012   2013 yaitu Bacillus subtilis TS2B yang diperoleh dari rumput laut. Penelitian yang dilakukan di BPPBAT Bogor ini, merupakan studi aplikasi B. subtilis TS2B melalui uji glukosa dan protein terlarut yang bertujuan untuk mendapatkan dosis inokulum optimal untuk menghidrolisis selulosa yang terkandung dalam daun singkong. Rancangan percobaan yang digunakan adalah RAL dengan 4 perlakuan dan 3 ulangan, yaitu perlakuan dosis inokulum sebesar 0% sebagai kontrol, 5%, 10%, dan 15% dari total bahan baku tepung daun singkong dengan kepadatan bakteri 1012cfu/ml. Bahan baku yang telah diinokulasi, selanjutnya diinkubasi pada 25oC selama tiga hari. Parameter uji yang digunakan adalah uji glukosa dan protein terlarut yang hasilnya kemudian diuji statistika untuk membuktikan respon perlakuan. Berdasarkan kedua uji parameter tersebut, dosis inokulum yang optimal untuk menghidrolis tepung daun singkong adalah 5% dari total bahan baku.', 'bakteri selulolitik; Bacillus subtilis; tepung daun singkong', 'D182'),
(183, 'prosiding FORUM INOVASI TEKNOLOGI AKUAKULTUR', '-', '-', '-', '2014', 'KAJIAN KERAGAAN TEKNOLOGI HASIL INTRODUKSI PROGRAM IPTEKMAS DI WILAYAH KIMBis KABUPATEN INDRAMAYU', 'Salah satu peran Klinik Iptek Mina Bisnis KIMBis Indramayu sebagai pusat kegiatan adalah melakukan (penyebaran teknologi hasil introduksi dan kajian tentang penyebaran teknologi) hasil introduksi Program Ilmu Pengetahuan untuk Masyarakat IPTEKMAS. Fokus bahasan/kajian pada makalah ini adalah tentang jenis teknologi yang diintroduksikan, status keberlanjutan (adopsi, difusi dan kondisi eksisting) teknologi, ketepatgunaan teknologi hasil introduksi Program IPTEKMAS serta dampak terhadap masyarakat. Teknologi hasil introduksi Program Iptekmas sudah diterapkan di Kabupaten Indramayu sejak tahun 2011 sampai dengan tahun 2013. Lokasi penerapan teknologi tersebut berada di Kecamatan Sindang dan Kecamatan Kandanghaur. Teknologi yang diintroduksikan oleh Program Iptekmas adalah teknologi pemurnian garam, teknologi budidaya udang windu dan vaname dengan sistim probiotik, teknologi diversifikasi pengolahan produk perikanan dan teknologi budidaya rumput laut E cottonii. Status keberlanjutan teknologi hasil introduksi program Iptekmas cukup beragam, dari 5 teknologi yang diintroduksikan, hanya 2 teknologi yang masih diterapkan dan diadopsi bahkan sudah terdifusi, yaitu teknologi budidaya udang windu dan udang vaname dengan sistim probiotik dan teknologi pemurnian garam.', 'keragaan teknologi; introduksi; program IPTEKMAS', 'D183'),
(184, 'prosiding FORUM INOVASI TEKNOLOGI AKUAKULTUR', '-', '-', '-', '2016', 'PERBAIKAN TEKNOLOGI PEMBESARAN ABALON (Haliotis squamata) DENGAN SISTEM KERANJANG GANTUNG', 'Kegiatan pembesaran abalon (Haliotis squamata) telah dilaksanakan di masyarakat dengan melibatkan pembudidaya/nelayan. Kegiatan ini diawali dengan sosialisasi cara pemeliharaan abalon, kemudian dilanjutkan dengan pendampingan untuk memberikan pemahaman cara pemeliharaan abalon,mempersiapkan wadah abalon, dan cara penebaran benih abalon pada sistem keranjang gantung. Wadah pemeliharaan abalon yang digunakan berupa keranjang plastik berlubang dengan ukuran 47,5 x 36,5 x 12,4 cm, terdiri atas dua buah keranjang yang disusun dan diikat secara vertikal dan digantungkan pada keramba apung. Setiap gantungan (satu unit keranjang susun) digantungkan pada kedalaman antara 2-3 m dari permukaan laut. Benih abalon dengan ukuran rata-rata panjang cangkang 3,21 0,32 cm dan bobot 5,74 1,09 g ditebarkan di dalam keranjang pemeliharaan dengan kepadatan 150 ekor per gantungan. Selama pemeliharaan abalon diberi pakan berupa rumput laut (Gracillaria sp.) segar. Setelah dipelihara selama lima bulan, abalon menunjukkan pertumbuhan panjang cangkang dan bobot badan masing-masing berkisar 4,3-4,4 cm (meningkat 35-38%) dan 12,6-14,4 g (meningkat 120-150%), dengan nilai sintasan berkisar 77,93-83,5%.', 'abalon; Haliotis squamata; pembesaran; keranjang gantung', 'D184'),
(185, 'prosiding FORUM INOVASI TEKNOLOGI AKUAKULTUR', '-', '-', '-', '2014', 'PROSPEK SUMBERDAYA PERIKANAN DAN SOSIAL EKONOMI DI KABUPATEN BERAU, KALIMANTAN TIMUR (Studi Kasus Pengelolaan Sumberdaya Perikanan di Kabupaten Berau, Kalimantan Timur)', 'Aspek sosial ekonomi merupakan bagian dari potensi perikanan budidaya yang bertujuan untuk mendapatkan gambaran pengembangan budidaya perikanan secara parsial, dan diharapkan menjadi bahan pertimbangan untuk pembangunan perikanan daerah Kabupaten Berau, Survei dilaksanakan menggunakan metode Pemahaman Pedesaan dalam Waktu Singkat (PPWS), Data primer diperoleh dari observasi dan wawancara dengan Nelayan Tangkap kelompok nelayan pembudidaya dan data sekunder yang diperoleh dari intansi yang terkait. Tipologi perikanan di Kabupaten Berau terdiri atas perikanan tangkap (di laut dan perairan umum), budidaya (air payau dan air tawar), dan pasca panen. Panjang Garis pantai Kabupaten Berau 629,2 km. Produksi perikanan Kabupaten Berau tahun 2010 sebesar 7.996 ton, atau 7% dari total produksi perikanan KalimantanTimur,  79,5% berasal dari perikanan tangkap, 13,3%, dari hasil budidaya air payau (tambak dan karamba) sisanya 7,2% dari perairan umum berupa rawa dan  Sungai (Sungai Mahakam). Produksi perikanan yang dimanfaatkan baru sekitar 11,2%. Potensi perikanan perairan umum yang cukup besar  membutuhkan penanganan secara terpadu untuk memperoleh hasil yang optimal.  Optimalisasi lahan tambak potensial dengan menerapkan teknologi remediasi tanah dasar untuk polikultur udang windu dengan bandeng dan mono kultur udang secara ekstensif, meningkatkan produktivitas tambak hingga 300%. Kelembagaan pengelolaan sumber daya perikanan, kelembagaan perencanaan, kelembagaan pengelolaan, kelembagaan pengawasan,  pembiayaan perikanan non formal dalam pengelolaan  sumbedaya pantai, serta laut perlu diterapkan. Prospek perdagangan ikan segar akan semakin jauh pemasarannya apabila tersedia kredit modal kerja bagi pedagang ikan,ditunjang dengan pengadaan TPI yang akan memberikan kontribusi pendapatan yang lebih besar bagi daerah. Komoditi hasil laut seperti rumput laut, teripang dan lobster yang memiliki nilai ekonomi tinggi perlu dipertimbangkan untuk dibudidayakan. Prospek pengembangan sumberdaya perikanan, melalui budidaya tambak, pola pengembangan perikanan lepas pantai, dan  perencanaan pasar antar pulau dengan memanfaatkan faktor keunggulan komparatif wilayah dengan mempertimbangkan kemampuan sumberdaya perikanan, sumber daya manusia, prasarana dan sarana yang tersedia. diharapkan dapat meningkatkan percepatan pemanfaatan sumberdaya perikanan secara optimal.', 'prospek; sumberdaya perikanan; sosial ekonomi; Kabupaten Berau', 'D185'),
(186, 'jurnal riset akuakultur', '8', '1', 'april', '2013', 'KARAKTERISTIK GENETIK Kappaphycus alvarezii SEHAT DAN TERINFEKSI PENYAKIT ICE-ICE DENGAN METODE Amplified Fragment Length Polymorphism (AFLP)', 'Infeksi penyakit ice-ice pada Kappaphycus alvarezii seringkali menyebabkan penurunan produksi yang sangat signifikan. K. alvarezii merupakan alga merah penghasil karaginan yang memiliki nilai ekonomi tinggi dan banyak dimanfaatkan dalam berbagai industri, seperti farmasi, makanan, stabilizer, dan kosmetik. Perbaikan genetik sangat diperlukan untuk meningkatkan produksi. Penelitian ini bertujuan untuk mengetahui karakteristik kemiripan genetik K. alvarezii sehat dan terinfeksi penyakit dari Balai Penelitian dan Pengembangan Budidaya Air Payau (BPPBAP), Maros dengan metode Amplified Fragment Length Polymorphism (AFLP). Pada penelitian ini juga dianalisis K. alvarezii asal Bone (BNE), Gorontalo (GRL), Tambalang (TMB), dan Kendari (KND) sebagai kontrol rumput laut sehat. Metode AFLP menggunakan enzim restriksi Psti dan Mset, preamplifikasi dan amplifikasi selektif diawali dengan isolsi DNA, uji genimoc DNA, restriksi dan ligasi. Hasil yang diperoleh menunjukkan penggunaan marker AFLP dengan primer forward P11 dan primer reverse M48, M49 dan M50 terhadap K. alvarezii yang berasal dari Takalar (TKL), dan Mataram (MTR), tanpa infeksi (sehat) dan terinfeksi penyakit Takalar ice (TKL+), Mataram ice (MTR+), serta K. alvarezii kontrol (BNE), (GRL), (TMB), dan (KND) menghasilkan 519 fragmen dalam 122 lokus dengan ukuran 50 - ~370 pb. Kemiripan genetik K. alvarezii yang terinfeksi penyakit ice-ice lebih rendah jika dibandingkan dengan yang sehat. Kemiripan genetik K. alvarezii dari Takalar sehat (TKL) dan terinfeksi ice-ice (TKL+) adalah 0,8176 dan MTR-MTR+ adalah 0,8033.', 'identifikasi fragmen; Kappaphycus alvarezii; penyakit ice-ice; AFLP', 'D186'),
(187, 'jurnal kelautan nasional', '11', '3', 'desember', '2016', 'ANALISIS PEMANFAATAN DATA KUALITAS PERAIRAN UNTUK PERENCANAAN ZONASI PESISIR', 'Perairan pesisir pulau Wangi-wangi di kabupaten Wakatobi, Sulawesi Tenggara telah mengalami tekanan aktifitas manusia (antropogenik) sejak menjadi kabupaten baru tahun 2003. Tekanan antropogenik diukur menggunakan parameter kualitas air (suhu dan oksigen terlarut). Tujuan riset ini adalah menganalisis pemanfaatan data pemonitoran waktu serial dan pemanfaatannya untuk perencanaan zonasi perairan, yang dikaitkan dengan data parameter kualitas air. Dinamika perairan pesisir telah terjadi pada musim angin timur dan barat, pada kedalaman 5 meter dan 25 meter. Hasil menunjukkan kegunaan data waktu serial untuk dinamika zonasi perairan pesisir. Bagian timur dan utara perairan direkomendasikan untuk zona konservasi, sementara zona pemanfaatan lainnya dialokasikan buat sub-zona perikanan berkelanjutan (rumput laut)', 'zona, data waktu serial, parameter kualitas air, oksigen terlarut', 'D187'),
(188, 'prosiding FORUM INOVASI TEKNOLOGI AKUAKULTUR', '-', '-', '-', '2011', 'JENIS DAN KOMPOSISI PLANKTON PADA BUDIDAYA POLIKULTUR UDANG WINDU, UDANG VANAME, IKAN BANDENG, DAN RUMPUT LAUT DI TAMBAK', 'Penelitian bertujuan mengetahui kondisi ...........', 'jenis; komposisi; plankton; polikultur; tambak', 'D188'),
(189, 'buletin teknik litkayasa akuakultur', '11', '1', 'juni', '2013', 'ANALISIS TANAH TAMBAK DI KABUPATEN KONAWE SELATAN PROVINSI SULAWESI TENGGARA', 'Komoditas udang, ikan bandeng, dan rumput laut merupakan komoditas yang penting dikembangkan di Kabupaten Konawe Selatan Provinsi Sulawesi Tenggara, karena permintaan pasar yang masih cukup besar. Lahan tambak harus diperhatikan karena merupakan media untuk hidup dan tumbuh bagi komoditas tersebut. Salah satu lingkungan fisik penyusun lahan adalah tanah. Dengan mengetahui kualitas tanah tambak maka perlakuan terhadap tambak tersebut dapat disesuaikan dengan teknologi yang akan diterapkan. Penelitian dengan contoh tanah tambak diambil pada 71 titik di 4 kecamatan yaitu Kecamatan Tinanggea, Pallangga Selatan, Laeya, dan Lainea pada\r\nkedalaman 0-0,2 m dan 0,2-0,4 m dari permukaan. Hasil analisis tanah tambak adalah bahwa pHF tertinggi terdapat pada Kecamatan Tinanggea pada kedalaman 0-0,20 m yaitu 7,39 sedang pHFOX terendah didapatkan pada Kecamatan Laeya yaitu 0,74. Hasil pengukuran potensial redoks pada umumnya menunjukkan nilai negatif menandakan keadaan tanah tambak di kabupaten tersebut dalam keadaan tereduksi. Kandungan bahan organik tertinggi terdapat di Kecamatan Tinanggea adalah 30,63% dan terendah juga terdapat di Kecamatan Tinanggea yaitu < 0,01%. Kandungan N-total tertinggi terdapat di Kecamatan Tinanggea adalah 0,56% dan terendah juga terdapat di Kecamatan tersebut yaitu 0,03%. Kandungan fosfat tertinggi juga terdapat di Kecamatan\r\nTinanggea yaitu 233,4 mg/L dan yang terendah pun di Kecamatan Tinanggea yaitu 7,49 mg/L.', '-', 'D189'),
(190, 'prosiding FORUM INOVASI TEKNOLOGI AKUAKULTUR', '-', '-', '-', '2011', 'PENGARUH PENGEMPAAN Eucheuma cottonii TERHADAP MUTU KEKUATAN GEL KARAGINAN YANG DIHASILKAN', 'Untuk mempercepat proses pengeringan .........', 'pengempaan; rumput laut; kekuatan gel; dan Eucheuma cottonii', 'D190'),
(191, 'media akuakultur', '3', '1', 'juni', '2008', 'PELESTARIAN SUMBER DAYA TERIPANG MELALUI RESTOCKING DAN BUDI DAYA DI SULAWESI SELATAN', 'Teripang pasir (Holothuria scabra) merupakan salah satu komoditas ekspor dari sektor perikanan yang sudah menurun produksi dan kelestarian sumber dayanya. Hal ini ditandai semakin kurangnya hasil tangkapan dan semakin kecilnya ukuran teripang yang tertangkap. Untuk meningkatkan produksi dan mempertahankan kelestariannya, perlu dilakukan upaya restocking dan budidaya di tambak. Restocking dilakukan dengan menebar benih teripang dari panti benih ke perairan dengan tujuan untuk memperkaya stok populasi teripang tersebut, sedangkan budidaya teripang di tambak, seperti di tambak tanah sulfat masam yang berasosiasi tanah gambut adalah selain bertujuan untuk meningkatkan produksi teripang, juga untuk meningkatkan produktivitas tambak tersebut yang selama ini kurang dimanfaatkan oleh pemiliknya oleh karena tingkat produktivitasnya sangat rendah bila digunakan untuk budidaya udang. Padahal jenis tambak semacam ini cukup luas di Sulawesi Selatan. Dasar pertimbangan untuk pengembangan budidaya teripang pasir di tambak sulfat masam yang berasosiasi tanah gambut adalah hasil temuan di lapangan di mana teripang pasir yang terikut pada saat panen ikan bandeng dan rumput laut mencapai bobot 300--500 g/ekor. Untuk keberhasilan budidaya teripang pasir di tambak tersebut teknik budidaya yang diaplikasikan antara lain padat penebaran 3--5 ekor/m2, pemberian pakan berupa klekap, dedak halus dicampur kotoran ayam dengan dosis dari bobot total biomassa di samping melakukan pemupukan awal dan susulan untuk menumbuhkan pakan alami berupa klekap dan plankton yang merupakan makanan utama bagi teripang. Untuk menjaga kestabilan kualitas air selama pemeliharan dilakukan penggantian air secara teratur mengikuti pola pasang surut.', 'teripang pasir; produksi; restocking; teknik budidaya; tambak', 'D191'),
(192, 'prosiding FORUM INOVASI TEKNOLOGI AKUAKULTUR', '-', '-', '-', '2015', 'PENELITIAN DAN PENGEMBANGAN BUDIDAYA UDANG VANAME (Litopenaeus vannamei) POLA EKSTENSIF PLUS DI LAHAN MARGINAL', 'Prinsip budidaya udang ekstensif plus meningkatkan kepadatan dengan menggunakan pakan tambahan (pakan komersil), di samping pakan alami, dan sarana tambahan (pompa) yang masih sesuai kemampuan pembudidaya, tanpa menggunakan kincir air. Tujuan penelitian ini adalah melakukan kajian kajian penelitian budidaya udang vaname ekstensif plus di lahan marginal dengan out put data dan informasi, yang digunakan dalam pengembangan budidaya udang vaname melalui uji lapang di lahan pembudidaya. Balai Penelitian dan Pengembangan Budidaya Air Payau, Maros telah melakukan kajian penelitian budidaya udang vaname (Litopenaeus vannamei) ekstensif plus sejak tahun 2005. Dari kajian ini telah output yang dapat digunakan sebagai bahan untuk menyusun petunjuk teknis, antara lain padat penebaran yang optimal adalah 8 ekor/ m2, benih vaname yang baik untuk ditebar di pembesaran adalah dalam bentuk tokolan yang berumur 15 hari (PL-27) dari PL-12, dan kepadatan benur vaname yang optimal di pentokolan adalah 6.000 ekor/m3, jika menggunakan aerasi (hyblow). Disamping itu juga telah melakukan kajian wadah pentokolan yang baik yaitu bak terkontrol dan hapa dengan waring ukuran mata jaring yang kecil (waring hijau), dengan menggunakan shelter yang terbaik dari bahan rumput laut (Glacilaria verrucosa)  Disamping kajian penelitian juga telah melakukan kajian pengembangan dalam bentuk uji lapang budidaya udang vaname ekstensif plus pada beberapa lokasi, utamanya pada lahan yang terlantar milik pembudidaya ekstensif antara lain di kabupaten Barru dengan produksi 1.050 kg/ha, di Kabupaten Selayar dengan produksi : 1100 kg/ha dan di Kabupaten Maros yang merupakan percontohan dinas Kelautan dan Perikanan Sulawesi Selatan dengan produksi 850 kg/ha.Dari kajian ini memperlihatkan bahwa melalui uji lapang dari hasil penelitian yang diramu dalam kajian pengembangan dapat meningkatkan produksi tambak ekstensif mencapai 850-1.100 kg/ha.', 'udang vaname; budidaya ekstensifl plus; lahan marginal', 'D192'),
(193, 'jurnal segara', '11', '1', 'agustus', '2015', 'Kesesuaian Lahan Budidaya Rumput Laut Eucheuma Cottonii di Perairan Tarakan dengan Faktor Pembatas Variabilitas ENSO dan Musim', 'Satelit inderaja oseanografi Aqua MODIS dan altimetri digunakan untuk mempelajari perubahan parameter lingkungan perairan Tarakan (suhu, klorofil-a, arus permukaan) terhadap variabilitas ENSO dan Musim, agar diperoleh pemahaman dinamika oseanografi selama perioda El Nino (Desember 2008, Januari-Februari 2009), La Nina (September-Oktober-November 2010), dan Normal ((Mei-Juni-Juli 2012), Musim Barat (Desember, Januari, Februari selama 2008, 2009, 2010, 2012), dan Timur (Juni, Juli Agustus selama 2009, 2010, 2012). Analisis kesesuaian lahan budidaya Eucheuma cottonii menggunakan pengukuran langsung pada 11 titik sampling tgl. 11 Juli 2013 di perairan pantai Amal dan Mamburungan, dan P. Sadau dengan parameter suhu, salinitas, kecerahan, turbiditas, kimia keasaman, nitrat, fosfat, kalium. Hasil penelitian menunjukkan faktor lingkungan sangat dipengaruhi variabilitas ENSO dan Musim. Perairan timur Tarakan memiliki tingkat kesesuaian lebih tinggi daripada bagian barat. Arus Lintas Indonesia mempengaruhi transfer massa air dari kolam panas Pasifik Barat memasuki perairan Tarakan. Pada perioda El Nino dan Musim Timur perairan Tarakan timur memiliki tingkat kesesuaian tinggi dan selama La Nina dan Musim Barat tingkat kesesuaian tinggi berpindah ke utara perairan Tarakan. Analisis kesesuaian lahan budidaya dengan metoda scoring dan pembobotan menunjukkan perairan sekitar pantai Amal sampai selatan memiliki kesesuaian paling tinggi dan pantai Mamburungan dan P. Sadau dengan kesesuian sedang. Analisis tingkat kesesuaian di perairan Tarakan menggunakan data satelit inderaja memberikan informasi pada perioda El Nino berada di pantai Amal dan Tanjung Simaya, perioda La Nina di Tanjung Simaya dan Juata, perioda Normal di Tanjung Binalatung dan Simaya, Musim Barat di Tanjung Simaya dan Juata, dan Musim Timur di pantai Amal dan Tanjung Selayang. ', 'dinamika oseanografi, variabilitas ENSO dan musim, tingkat kekesuaian', 'D193'),
(194, 'media akuakultur', '2', '2', 'desember', '2007', 'BUDI DAYA UDANG VANNAMEI (Litopenaeus vannamei) POLA TRADISIONAL PLUS DI KABUPATEN MAROS, SULAWESI SELATAN', 'Udang merupakan salah satu komoditas perikanan unggulan dalam program revitalisasi perikanan, di samping rumput laut dan tuna. Pada awalnya, jenis udang yang dibudidayakan di air payau adalah udang windu, namun setelah mewabahnya penyakit terutama WSSV yang mengakibatkan menurunnya usaha budi daya udang windu, pemerintah kemudian mengintroduksi udang vannamei pada tahun 2001 untuk membangkitkan kembali usaha perudangan di Indonesia dan dalam rangka diversifikasi komoditas perikanan. Untuk mengembangkan budi daya udang kedepan, upaya-upaya yang dilakukan pemerintah antara lain: (i) Revitalisasi tambak intensif dengan udang vannamei seluas 7.000 ha dengan produktivitas 30 ton/ha/tahun, (ii) revitalisasi tambak tradisional seluas 140.000 ha (40% dari tambak tradisional) dengan produktivitas 600--700 kg/ha/tahun, (iii) impor vannamei SPF/SPR, (iv) pengembangan induk SPF vannamei dalam negeri, (v) revitalisasi backyard hatchery  (HSRT), (vi) penerapan sertifikasi, (vii) pengembangan laboratorium, dan (viii) pengembangan sarana/prasarana (Nurjana, 2005). Aspek-aspek yang perlu diperhatikan dalam usaha budi daya udang vannamei pola tradisional plus antara lain: persiapan tambak, kualitas benih, teknik penebaran, padat penebaran, manajemen pakan, pemeliharaan kualitas air, dan teknik panen. Tulisan ini menjelaskan secara ringkas mengenai teknologi budi daya udang vannamei pola tradisional plus di Kabupaten Maros, Sulawesi Selatan yang dapat dilakukan oleh pembudi daya udang.', 'udang vannamei; tradisional plus; teknik budi daya', 'D194'),
(195, 'prosiding FORUM INOVASI TEKNOLOGI AKUAKULTUR', '-', '-', '-', '2011', 'STUDI KELAYAKAN TEKNIS DAN EKONOMIS PENGOLAHAN ALKALI TREATED COTTONII (ATC) SKALA PILOT PLANT', 'Telah dilakukan penelitian .........', 'pengolahan ATC; kelayakan ekonomi; kelayakan teknis; rumput laut; pilot plant', 'D195'),
(196, 'jurnal riset akuakultur', '7', '1', 'april', '2012', 'OPTIMALISASI PEMELIHARAAN YUWANA ABALON ( H. squamata) DENGAN KEPADATAN DAN JENIS PAKAN YANG BERBEDA', 'Optimalisasi pemeliharaan yuwana abalon telah dilakukan dengan tiga berbeda kepadatan dan memanfaatkan tiga jenis rumput laut. Tujuan penelitian ini adalah untuk memperoleh teknik pemeliharaan yuwana abalon H. squamata yang efisien dan aplikatif melalui kepadatan dan jenis pakan yang berbeda. Digunakan yuwana abalon dengan ukuran panjang cangkang awal 7,8-10,1 mm; kepadatan yuwana awal yaitu 500, 250, dan 125 ekor/keranjang, dan jenis pakan yang berbeda yaitu Ulva sp., Gracilaria sp. asal laut, dan Gracilaria sp. asal tambak. Hasil yang dicapai pada akhir penelitian menunjukkan pengaruh yang nyata (P<0,05) terhadap pertumbuhan panjang cangkang, di mana pada perlakuan (A) 500 ekor + Gracilaria asal tambak sebesar 15,07 3,08 mm; (B) 500 ekor + Ulva sebesar 13,58 2,65 mm; (C) 500 ekor + Gracilaria asal laut sebesar 13,27 2,75 mm; (D) 250 ekor + Gracilaria asal tambak sebesar 17,17 3,29 mm; (E) 250 ekor + Ulva sebesar 16,44 2,90 mm; (F) 250 ekor + Gracilaria asal laut sebesar 16,08 3,21mm; (G) 125 ekor + Gracilaria asal tambak sebesar 17,94 2,49 mm; (H) 125 ekor + Ulva sebesar 18,65 2,72 mm; (I) 125 ekor + Gracilaria asal laut 17,87 3,16 mm. Sintasan yuwana abalon pada akhir penelitian berkisar antara 84% sampai 99%.', 'yuwana; kepadatan; makroalga; abalon', 'D196'),
(197, 'buletin teknik litkayasa sumber daya dan penangkapan', '11', '2', 'desember', '2013', 'KADAR SALINITAS DI BEBERAPA SUNGAI YANG BERMUARA DI TELUK CEMPI, KABUPATEN DOMPU-PROVINSI NUSA TENGGARA BARAT', 'Teluk cempi secara geografis terletak diKabupaten Dompu Provinsi Nusa Tenggara Barat (NTB) yang merupakan salah satu perairan penghasil udang yang cukup potensial di Indonesia. Teluk Cempi memiliki beberapa sungai, yaitu: sungai Soroadu, sungai Jambu, sungaiMbawi, sungai Noa, sungaiWoja, dan sungai Lara. Lingkungan sekitar Teluk Cempi berupa daerah kawasan mangrove, perumahan, pelabuhan, tambak, budidaya rumput laut, dan tempat wisata. Daerah kawasan mangrove membentang dariwilayah Soroadu, Jambu, Mbawi, Noa, Woja, dan Lara. Menurut Nastiti, et al (2012), Stasiun Noa danMbawi memiliki kawasan mangrove yang lebih luas dibandingkan stasiun lainnya. Seiring dengan perkembangannya, daerah sekitar kawasan Teluk Cempi banyak mengalami degradasi lingkungan, seperti pembukaan lahan tambak di sekitar sungai-sungai yang banyak memotong pohonpohon mangrove. Sehingga pada akhirnya dapat mempengaruhi ekosistem dan kualitas perairan sekitar Teluk Cempi.', 'Teluk campi, mangrove, degradasi lingkungan', 'D197');
